          "description": "Date record was first recorded",
          "definition":
              "Represents when this particular CarePlan record was created in the system, which is often a system-generated date."
        },
        {
          "name": "author",
          "elementType": "Reference",
          "description": "Who is the designated responsible party",
          "definition":
              "When populated, the author is responsible for the care plan.  The care plan is attributed to the author.",
          "comment":
              "The author may also be a contributor.  For example, an organization can be an author, but not listed as a contributor."
        },
        {
          "name": "contributor",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Who provided the content of the care plan",
          "definition":
              "Identifies the individual(s) or organization who provided the contents of the care plan.",
          "comment": "Collaborative care plans may have multiple contributors."
        },
        {
          "name": "careTeam",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Who's involved in plan?",
          "definition":
              "Identifies all people and organizations who are expected to be involved in the care envisioned by this plan."
        },
        {
          "name": "addresses",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Health issues this plan addresses",
          "definition":
              "Identifies the conditions/problems/concerns/diagnoses/etc. whose management and/or mitigation are handled by this plan.",
          "comment":
              "When the diagnosis is related to an allergy or intolerance, the Condition and AllergyIntolerance resources can both be used. However, to be actionable for decision support, using Condition alone is not sufficient as the allergy or intolerance condition needs to be represented as an AllergyIntolerance."
        },
        {
          "name": "supportingInfo",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Information considered as part of plan",
          "definition":
              "Identifies portions of the patient's record that specifically influenced the formation of the plan.  These might include comorbidities, recent procedures, limitations, recent assessments, etc.",
          "comment":
              "Use \"concern\" to identify specific conditions addressed by the care plan."
        },
        {
          "name": "goal",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Desired outcome of plan",
          "definition":
              "Describes the intended objective(s) of carrying out the care plan.",
          "comment":
              "Goal can be achieving a particular change or merely maintaining a current state or even slowing a decline."
        },
        {
          "name": "activity",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Action to occur as part of plan",
          "definition":
              "Identifies a planned action to occur as part of the plan.  For example, a medication to be used, lab tests to perform, self-monitoring, education, etc."
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Comments about the plan",
          "definition":
              "General notes about the care plan not covered elsewhere."
        }
      ],
      "contextRelationship": [
        {"context": "Practitioner", "relatedKeyElement": "performer"},
        {"context": "Patient", "relatedKeyElement": "patient"},
        {"context": "Patient", "relatedKeyElement": "performer"},
        {"context": "Encounter", "relatedKeyElement": "encounter"},
        {"context": "RelatedPerson", "relatedKeyElement": "performer"}
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "CarePlan.Activity",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "outcomeCodeableConcept",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "CarePlanActivityOutcome",
            "description": "Identifies the results of the activity.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Results of the activity",
          "definition":
              "Identifies the outcome at the point when the status of the activity is assessed.  For example, the outcome of an education activity could be patient understands (or not).",
          "comment":
              "Note that this should not duplicate the activity status (e.g. completed or in progress)."
        },
        {
          "name": "outcomeReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Appointment, Encounter, Procedure, etc.",
          "definition":
              "Details of the outcome or action resulting from the activity.  The reference to an \"event\" resource, such as Procedure or Encounter or Observation, is the result/outcome of the activity itself.  The activity can be conveyed using CarePlan.activity.detail OR using the CarePlan.activity.reference (a reference to a “request” resource).",
          "comment":
              "The activity outcome is independent of the outcome of the related goal(s).  For example, if the goal is to achieve a target body weight of 150 lbs and an activity is defined to diet, then the activity outcome could be calories consumed whereas the goal outcome is an observation for the actual body weight measured."
        },
        {
          "name": "progress",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Comments about the activity status/progress",
          "definition":
              "Notes about the adherence/status/progress of the activity.",
          "comment":
              "This element should NOT be used to describe the activity to be performed - that occurs either within the resource pointed to by activity.detail.reference or in activity.detail.description."
        },
        {
          "name": "reference",
          "elementType": "Reference",
          "description": "Activity details defined in specific resource",
          "definition":
              "The details of the proposed activity represented in a specific resource.",
          "comment":
              "Standard extension exists ([resource-pertainsToGoal](http://hl7.org/fhir/R4/extension-resource-pertainstogoal.html)) that allows goals to be referenced from any of the referenced resources in CarePlan.activity.reference.  \\rThe goal should be visible when the resource referenced by CarePlan.activity.reference is viewed independently from the CarePlan.  Requests that are pointed to by a CarePlan using this element should *not* point to this CarePlan using the \"basedOn\" element.  i.e. Requests that are part of a CarePlan are not \"based on\" the CarePlan."
        },
        {
          "name": "detail",
          "elementType": "CarePlan.Activity.Detail",
          "description": "In-line definition of activity",
          "definition":
              "A simple summary of a planned activity suitable for a general care plan system (e.g. form driven) that doesn't know about specific resources such as procedure etc."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "CarePlan.Activity.Detail",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "kind",
          "binding": {
            "name": "CarePlanActivityKind",
            "description":
                "Resource types defined as part of FHIR that can be represented as in-line definitions of a care plan activity.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "CarePlanActivityKind",
          "target": "%value.value",
          "description":
              "Appointment | CommunicationRequest | DeviceRequest | MedicationRequest | NutritionOrder | Task | ServiceRequest | VisionPrescription",
          "definition":
              "A description of the kind of resource the in-line definition of a care plan activity is representing.  The CarePlan.activity.detail is an in-line definition when a resource is not referenced using CarePlan.activity.reference.  For example, a MedicationRequest, a ServiceRequest, or a CommunicationRequest."
        },
        {
          "name": "instantiatesCanonical",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "Instantiates FHIR protocol or definition",
          "definition":
              "The URL pointing to a FHIR-defined protocol, guideline, questionnaire or other definition that is adhered to in whole or in part by this CarePlan activity."
        },
        {
          "name": "instantiatesUri",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "Instantiates external protocol or definition",
          "definition":
              "The URL pointing to an externally maintained protocol, guideline, questionnaire or other definition that is adhered to in whole or in part by this CarePlan activity.",
          "comment":
              "This might be an HTML page, PDF, etc. or could just be a non-resolvable URI identifier."
        },
        {
          "name": "code",
          "binding": {
            "name": "CarePlanActivityType",
            "description":
                "Detailed description of the type of activity; e.g. What lab test, what procedure, what kind of encounter.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Detail type of activity",
          "definition":
              "Detailed description of the type of planned activity; e.g. what lab test, what procedure, what kind of encounter.",
          "comment":
              "Tends to be less relevant for activities involving particular products.  Codes should not convey negation - use \"prohibited\" instead."
        },
        {
          "name": "reasonCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "CarePlanActivityReason",
            "description":
                "Identifies why a care plan activity is needed.  Can include any health condition codes as well as such concepts as \"general wellness\", prophylaxis, surgical preparation, etc.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description":
              "Why activity should be done or why activity was prohibited",
          "definition":
              "Provides the rationale that drove the inclusion of this particular activity as part of the plan or the reason why the activity was prohibited.",
          "comment":
              "This could be a diagnosis code.  If a full condition record exists or additional detail is needed, use reasonCondition instead."
        },
        {
          "name": "reasonReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Why activity is needed",
          "definition":
              "Indicates another resource, such as the health condition(s), whose existence justifies this request and drove the inclusion of this particular activity as part of the plan.",
          "comment":
              "Conditions can be identified at the activity level that are not identified as reasons for the overall plan."
        },
        {
          "name": "goal",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Goals this activity relates to",
          "definition":
              "Internal reference that identifies the goals that this activity is intended to contribute towards meeting."
        },
        {
          "name": "status",
          "binding": {
            "name": "CarePlanActivityStatus",
            "description":
                "Codes that reflect the current state of a care plan activity within its overall life cycle.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "CarePlanActivityStatus",
          "target": "%value.value",
          "description":
              "not-started | scheduled | in-progress | on-hold | completed | cancelled | stopped | unknown | entered-in-error",
          "definition":
              "Identifies what progress is being made for the specific activity.",
          "comment":
              "Some aspects of status can be inferred based on the resources linked in actionTaken.  Note that \"status\" is only as current as the plan was most recently updated.  \\\\nThe unknown code is not to be used to convey other statuses.  The unknown code should be used when one of the statuses applies, but the authoring system doesn't know the current state of the activity."
        },
        {
          "name": "statusReason",
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Reason for current status",
          "definition":
              "Provides reason why the activity isn't yet started, is on hold, was cancelled, etc.",
          "comment":
              "Will generally not be present if status is \"complete\".  Be sure to prompt to update this (or at least remove the existing value) if the status is changed."
        },
        {
          "name": "doNotPerform",
          "elementType": "System.Boolean",
          "target": "%value.value",
          "description": "If true, activity is prohibiting action",
          "definition":
              "If true, indicates that the described activity is one that must NOT be engaged in when following the plan.  If false, or missing, indicates that the described activity is one that should be engaged in when following the plan.",
          "comment":
              "This element is labeled as a modifier because it marks an activity as an activity that is not to be performed."
        },
        {
          "name": "scheduled",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {"name": "Timing", "type": "NamedTypeSpecifier"},
              {"type": "IntervalTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}String",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "When activity is to occur",
          "definition":
              "The period, timing or frequency upon which the described activity is to occur."
        },
        {
          "name": "location",
          "elementType": "Reference",
          "description": "Where it should happen",
          "definition":
              "Identifies the facility where the activity will occur; e.g. home, hospital, specific clinic, etc.",
          "comment":
              "May reference a specific clinical location or may identify a type of location."
        },
        {
          "name": "performer",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Who will be responsible?",
          "definition":
              "Identifies who's expected to be involved in the activity.",
          "comment": "A performer MAY also be a participant in the care plan."
        },
        {
          "name": "product",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              },
              {"name": "Reference", "type": "NamedTypeSpecifier"}
            ]
          },
          "binding": {
            "name": "CarePlanProduct",
            "description":
                "A product supplied or administered as part of a care plan activity.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "What is to be administered/supplied",
          "definition":
              "Identifies the food, drug or other product to be consumed or supplied in the activity."
        },
        {
          "name": "dailyAmount",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description": "How to consume/day?",
          "definition":
              "Identifies the quantity expected to be consumed in a given day."
        },
        {
          "name": "quantity",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description": "How much to administer/supply/consume",
          "definition":
              "Identifies the quantity expected to be supplied, administered or consumed by the subject."
        },
        {
          "name": "description",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Extra info describing activity to perform",
          "definition":
              "This provides a textual description of constraints on the intended activity occurrence, including relation to other activities.  It may also include objectives, pre-conditions and end-conditions.  Finally, it may convey specifics about the activity such as body site, method, route, etc."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "CarePlanActivityKind",
      "baseType": "System.String",
      "retrievable": false
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "CarePlanActivityStatus",
      "baseType": "System.String",
      "retrievable": false
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "CareTeam",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-careteam",
      "label": "QICore CareTeam",
      "primaryCodePath": "category",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "External Ids for this team",
          "definition":
              "Business identifiers assigned to this care team by the performer or other systems which remain constant as the resource is updated and propagates from server to server.",
          "comment":
              "This is a business identifier, not a resource identifier (see [discussion](http://hl7.org/fhir/R4/resource.html#identifiers)).  It is best practice for the identifier to only appear on a single resource instance, however business practices may occasionally dictate that multiple resource instances with the same identifier can exist - possibly even with different resource types.  For example, multiple Patient and a Person resource instance might share the same social insurance number."
        },
        {
          "name": "status",
          "binding": {
            "name": null,
            "description":
                "Indicates whether the team is current , represents future intentions or is now a historical record.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "System.String",
          "target": "%value.value",
          "description":
              "proposed | active | suspended | inactive | entered-in-error",
          "definition": "Indicates the current state of the care team.",
          "comment":
              "This element is labeled as a modifier because the status contains the code entered-in-error that marks the care team as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "category",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "CareTeamCategory",
            "description": "Indicates the type of care team.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Type of team",
          "definition":
              "Identifies what kind of team.  This is to support differentiation between multiple co-existing teams, such as care plan team, episode of care team, longitudinal care team.",
          "comment":
              "There may be multiple axis of categorization and one team may serve multiple purposes."
        },
        {
          "name": "name",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Name of the team, such as crisis assessment team",
          "definition":
              "A label for human use intended to distinguish like teams.  E.g. the \"red\" vs. \"green\" trauma teams.",
          "comment":
              "The meaning/purpose of the team is conveyed in CareTeam.category.  This element may also convey semantics of the team (e.g. \"Red trauma team\"), but its primary purpose is to distinguish between identical teams in a human-friendly way.  (\"Team 18735\" isn't as friendly.)."
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Who care team is for",
          "definition":
              "Identifies the patient or group whose intended care is handled by the team.",
          "mustSupport": true
        },
        {
          "name": "encounter",
          "elementType": "Reference",
          "description": "Encounter created as part of",
          "definition":
              "The Encounter during which this CareTeam was created or to which the creation of this record is tightly associated.",
          "comment":
              "This will typically be the encounter the event occurred within, but some activities may be initiated prior to or after the official completion of an encounter but still be tied to the context of the encounter."
        },
        {
          "name": "period",
          "elementTypeSpecifier": {"type": "IntervalTypeSpecifier"},
          "target": "FHIRHelpers.ToInterval(%value)",
          "description": "Time period team covers",
          "definition":
              "Indicates when the team did (or is intended to) come into effect and end."
        },
        {
          "name": "participant",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Members of the team",
          "definition":
              "Identifies all people and organizations who are expected to be involved in the care team.",
          "mustSupport": true
        },
        {
          "name": "reasonCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "CareTeamReason",
            "description": "Indicates the reason for the care team.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Why the care team exists",
          "definition": "Describes why the care team exists."
        },
        {
          "name": "reasonReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Why the care team exists",
          "definition": "Condition(s) that this care team addresses."
        },
        {
          "name": "managingOrganization",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Organization responsible for the care team",
          "definition": "The organization responsible for the care team."
        },
        {
          "name": "telecom",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "A contact detail for the care team (that applies to all members)",
          "definition":
              "A central contact detail for the care team (that applies to all members).",
          "comment":
              "The ContactPoint.use code of home is not appropriate to use. These contacts are not the contact details of individual care team members."
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Comments made about the CareTeam",
          "definition": "Comments made about the CareTeam."
        }
      ],
      "contextRelationship": [
        {"context": "Practitioner", "relatedKeyElement": "member"},
        {"context": "Patient", "relatedKeyElement": "patient"},
        {"context": "Patient", "relatedKeyElement": "member"},
        {"context": "Encounter", "relatedKeyElement": "encounter"},
        {"context": "RelatedPerson", "relatedKeyElement": "member"}
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "CareTeam.Participant",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "role",
          "binding": {
            "name": null,
            "description":
                "Indicates specific responsibility of an individual within the care team, such as Primary physician, Team coordinator, Caregiver, etc.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Type of involvement",
          "definition":
              "Indicates specific responsibility of an individual within the care team, such as \"Primary care physician\", \"Trained social worker counselor\", \"Caregiver\", etc.",
          "comment":
              "Roles may sometimes be inferred by type of Practitioner.  These are relationships that hold only within the context of the care team.  General relationships should be handled as properties of the Patient resource directly.",
          "mustSupport": true
        },
        {
          "name": "member",
          "elementType": "Reference",
          "description": "Who is involved",
          "definition":
              "The specific person or organization who is participating/expected to participate in the care team.",
          "comment":
              "Patient only needs to be listed if they have a role other than \"subject of care\".\\\\n\\\\nMember is optional because some participants may be known only by their role, particularly in draft plans.",
          "mustSupport": true
        },
        {
          "name": "onBehalfOf",
          "elementType": "Reference",
          "description": "Organization of the practitioner",
          "definition": "The organization of the practitioner."
        },
        {
          "name": "period",
          "elementTypeSpecifier": {"type": "IntervalTypeSpecifier"},
          "target": "FHIRHelpers.ToInterval(%value)",
          "description": "Time period of participant",
          "definition":
              "Indicates when the specific member or organization did (or is intended to) come into effect and end."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Claim",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-claim",
      "label": "QICore Claim",
      "primaryCodePath": "type",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Business Identifier for claim",
          "definition": "A unique identifier assigned to this claim."
        },
        {
          "name": "status",
          "binding": {
            "name": "ClaimStatus",
            "description":
                "A code specifying the state of the resource instance.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "ClaimStatus",
          "target": "%value.value",
          "description": "active | cancelled | draft | entered-in-error",
          "definition": "The status of the resource instance.",
          "comment":
              "This element is labeled as a modifier because the status contains codes that mark the resource as not currently valid."
        },
        {
          "name": "type",
          "binding": {
            "name": "ClaimType",
            "description": "The type or discipline-style of the claim.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Category or discipline",
          "definition":
              "The category of claim, e.g. oral, pharmacy, vision, institutional, professional.",
          "comment":
              "The majority of jurisdictions use: oral, pharmacy, vision, professional and institutional, or variants on those terms, as the general styles of claims. The valueset is extensible to accommodate other jurisdictional requirements."
        },
        {
          "name": "subType",
          "binding": {
            "name": "ClaimSubType",
            "description": "A more granular claim typecode.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "More granular claim type",
          "definition":
              "A finer grained suite of claim type codes which may convey additional information such as Inpatient vs Outpatient and/or a specialty service.",
          "comment":
              "This may contain the local bill type codes, for example the US UB-04 bill type code or the CMS bill type."
        },
        {
          "name": "use",
          "binding": {
            "name": "Use",
            "description":
                "The purpose of the Claim: predetermination, preauthorization, claim.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "Use",
          "target": "%value.value",
          "description": "claim | preauthorization | predetermination",
          "definition":
              "A code to indicate whether the nature of the request is: to request adjudication of products and services previously rendered; or requesting authorization and adjudication for provision in the future; or requesting the non-binding adjudication of the listed products and services which could be provided in the future."
        },
        {
          "name": "patient",
          "elementType": "Reference",
          "description": "The recipient of the products and services",
          "definition":
              "The party to whom the professional services and/or products have been supplied or are being considered and for whom actual or forecast reimbursement is sought.",
          "mustSupport": true
        },
        {
          "name": "billablePeriod",
          "elementTypeSpecifier": {"type": "IntervalTypeSpecifier"},
          "target": "FHIRHelpers.ToInterval(%value)",
          "description": "Relevant time frame for the claim",
          "definition": "The period for which charges are being submitted.",
          "comment":
              "Typically this would be today or in the past for a claim, and today or in the future for preauthorizations and predeterminations. Typically line item dates of service should fall within the billing period if one is specified.",
          "mustSupport": true
        },
        {
