      "retrievable": false,
      "element": [
        {
          "name": "sequence",
          "elementType": "System.Integer",
          "target": "%value.value",
          "description": "Item instance identifier",
          "definition": "A number to uniquely identify item entries."
        },
        {
          "name": "revenue",
          "binding": {
            "name": "RevenueCenter",
            "description":
                "Codes for the revenue or cost centers supplying the service and/or products.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Revenue or cost center code",
          "definition":
              "The type of revenue or cost center providing the product and/or service."
        },
        {
          "name": "category",
          "binding": {
            "name": "BenefitCategory",
            "description":
                "Benefit categories such as: oral-basic, major, glasses.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Benefit classification",
          "definition":
              "Code to identify the general type of benefits under which products and services are provided.",
          "comment":
              "Examples include Medical Care, Periodontics, Renal Dialysis, Vision Coverage."
        },
        {
          "name": "productOrService",
          "binding": {
            "name": "ServiceProduct",
            "description": "Allowable service and product codes.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Billing, service, product, or drug code",
          "definition":
              "When the value is a group code then this item collects a set of related claim details, otherwise this contains the product, service, drug or other billing code for the item.",
          "comment":
              "If this is an actual service or product line, i.e. not a Group, then use code to indicate the Professional Service or Product supplied (e.g. CTP, HCPCS, USCLS, ICD10, NCPDP, DIN, RxNorm, ACHI, CCI). If a grouping item then use a group code to indicate the type of thing being grouped e.g. 'glasses' or 'compound'."
        },
        {
          "name": "modifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "Modifiers",
            "description":
                "Item type or modifiers codes, eg for Oral whether the treatment is cosmetic or associated with TMJ, or an appliance was lost or stolen.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Service/Product billing modifiers",
          "definition":
              "Item typification or modifiers codes to convey additional context for the product or service.",
          "comment":
              "For example in Oral whether the treatment is cosmetic or associated with TMJ, or for Medical whether the treatment was outside the clinic or out of office hours."
        },
        {
          "name": "programCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ProgramCode",
            "description": "Program specific reason codes.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Program the product or service is provided under",
          "definition":
              "Identifies the program under which this may be recovered.",
          "comment":
              "For example: Neonatal program, child dental program or drug users recovery program."
        },
        {
          "name": "quantity",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description": "Count of products or services",
          "definition": "The number of repetitions of a service or product."
        },
        {
          "name": "unitPrice",
          "elementType": "System.Decimal",
          "target": "%value.value",
          "description": "Fee, charge or cost per item",
          "definition":
              "If the item is not a group then this is the fee for the product or service, otherwise this is the total of the fees for the details of the group."
        },
        {
          "name": "factor",
          "elementType": "System.Decimal",
          "target": "%value.value",
          "description": "Price scaling factor",
          "definition":
              "A real number that represents a multiplier used in determining the overall value of services delivered and/or goods received. The concept of a Factor allows for a discount or surcharge multiplier to be applied to a monetary amount.",
          "comment":
              "To show a 10% senior's discount, the value entered is: 0.90 (1.00 - 0.10)."
        },
        {
          "name": "net",
          "elementType": "System.Decimal",
          "target": "%value.value",
          "description": "Total item cost",
          "definition":
              "The quantity times the unit price for an additional service or product or charge.",
          "comment":
              "For example, the formula: quantity * unitPrice * factor  = net. Quantity and factor are assumed to be 1 if not supplied."
        },
        {
          "name": "udi",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Unique device identifier",
          "definition":
              "Unique Device Identifiers associated with this line item."
        },
        {
          "name": "subDetail",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Product or service provided",
          "definition":
              "A claim detail line. Either a simple (a product or service) or a 'group' of sub-details which are simple items."
        }
      ]
    },
