    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "ClaimResponse",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-claimresponse",
      "label": "QICore ClaimResponse",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Business Identifier for a claim response",
          "definition": "A unique identifier assigned to this claim response."
        },
        {
          "name": "status",
          "binding": {
            "name": "ClaimResponseStatus",
            "description":
                "A code specifying the state of the resource instance.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "ClaimResponseStatus",
          "target": "%value.value",
          "description": "active | cancelled | draft | entered-in-error",
          "definition": "The status of the resource instance.",
          "comment":
              "This element is labeled as a modifier because the status contains codes that mark the resource as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "type",
          "binding": {
            "name": "ClaimType",
            "description": "The type or discipline-style of the claim.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "More granular claim type",
          "definition":
              "A finer grained suite of claim type codes which may convey additional information such as Inpatient vs Outpatient and/or a specialty service.",
          "comment":
              "This may contain the local bill type codes, for example the US UB-04 bill type code or the CMS bill type.",
          "mustSupport": true
        },
        {
          "name": "subType",
          "binding": {
            "name": "ClaimSubType",
            "description": "A more granular claim typecode.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "More granular claim type",
          "definition":
              "A finer grained suite of claim type codes which may convey additional information such as Inpatient vs Outpatient and/or a specialty service.",
          "comment":
              "This may contain the local bill type codes, for example the US UB-04 bill type code or the CMS bill type."
        },
        {
          "name": "use",
          "binding": {
            "name": "Use",
            "description": "Claim, preauthorization, predetermination.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "Use",
          "target": "%value.value",
          "description": "claim | preauthorization | predetermination",
          "definition":
              "A code to indicate whether the nature of the request is: to request adjudication of products and services previously rendered; or requesting authorization and adjudication for provision in the future; or requesting the non-binding adjudication of the listed products and services which could be provided in the future.",
          "mustSupport": true
        },
        {
          "name": "patient",
          "elementType": "Reference",
          "description": "The recipient of the products and services",
          "definition":
              "The party to whom the professional services and/or products have been supplied or are being considered and for whom actual for facast reimbursement is sought.",
          "mustSupport": true
        },
        {
          "name": "created",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "Response creation date",
          "definition": "The date this resource was created.",
          "mustSupport": true
        },
        {
          "name": "insurer",
          "elementType": "Reference",
          "description": "Party responsible for reimbursement",
          "definition":
              "The party responsible for authorization, adjudication and reimbursement.",
          "mustSupport": true
        },
        {
          "name": "requestor",
          "elementType": "Reference",
          "description": "Party responsible for the claim",
          "definition":
              "The provider which is responsible for the claim, predetermination or preauthorization.",
          "comment":
              "Typically this field would be 1..1 where this party is responsible for the claim but not necessarily professionally responsible for the provision of the individual products and services listed below.",
          "mustSupport": true
        },
        {
          "name": "request",
          "elementType": "Reference",
          "description": "Id of resource triggering adjudication",
          "definition": "Original request resource reference.",
          "mustSupport": true
        },
        {
          "name": "outcome",
          "binding": {
            "name": "RemittanceOutcome",
            "description": "The result of the claim processing.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "RemittanceOutcome",
          "target": "%value.value",
          "description": "queued | complete | error | partial",
          "definition":
              "The outcome of the claim, predetermination, or preauthorization processing.",
          "comment":
              "The resource may be used to indicate that: the request has been held (queued) for processing; that it has been processed and errors found (error); that no errors were found and that some of the adjudication has been undertaken (partial) or that all of the adjudication has been undertaken (complete)."
        },
        {
          "name": "disposition",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Disposition Message",
          "definition":
              "A human readable description of the status of the adjudication."
        },
        {
          "name": "preAuthRef",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Preauthorization reference",
          "definition":
