        {
          "name": "payment",
          "elementType": "ClaimResponse.Payment",
          "description": "Payment Details",
          "definition": "Payment details for the adjudication of the claim."
        },
        {
          "name": "fundsReserve",
          "binding": {
            "name": "FundsReserve",
            "description":
                "For whom funds are to be reserved: (Patient, Provider, None).",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Funds reserved status",
          "definition":
              "A code, used only on a response to a preauthorization, to indicate whether the benefits payable have been reserved and for whom.",
          "comment":
              "Fund would be release by a future claim quoting the preAuthRef of this response. Examples of values include: provider, patient, none."
        },
