          "name": "formCode",
          "binding": {
            "name": "Forms",
            "description": "The forms codes.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Printed form identifier",
          "definition":
              "A code for the form to be used for printing the content.",
          "comment": "May be needed to identify specific jurisdictional forms."
        },
        {
          "name": "form",
          "elementType": "Attachment",
          "description": "Printed reference or actual form",
          "definition":
              "The actual form, by reference or inclusion, for printing the content or an EOB.",
          "comment": "Needed to permit insurers to include the actual form."
        },
        {
          "name": "processNote",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Note concerning adjudication",
          "definition":
              "A note that describes or explains adjudication results in a human readable form."
        },
        {
          "name": "communicationRequest",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Request for additional information",
          "definition":
              "Request for additional supporting or authorizing information.",
          "comment":
              "For example: professional reports, documents, images, clinical resources, or accident reports."
        },
        {
          "name": "insurance",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Patient insurance information",
          "definition":
              "Financial instruments for reimbursement for the health care products and services specified on the claim.",
          "comment":
              "All insurance coverages for the patient which may be applicable for reimbursement, of the products and services listed in the claim, are typically provided in the claim to allow insurers to confirm the ordering of the insurance coverages relative to local 'coordination of benefit' rules. One coverage (and only one) with 'focal=true' is to be used in the adjudication of this claim. Coverages appearing before the focal Coverage in the list, and where 'subrogation=false', should provide a reference to the ClaimResponse containing the adjudication results of the prior claim."
        },
        {
          "name": "error",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Processing errors",
          "definition":
              "Errors encountered during the processing of the adjudication.",
          "comment":
              "If the request contains errors then an error element should be provided and no adjudication related sections (item, addItem, or payment) should be present."
        }
