              "Business identifiers assigned to this communication by the performer or other systems which remain constant as the resource is updated and propagates from server to server.",
          "comment":
              "This is a business identifier, not a resource identifier (see [discussion](http://hl7.org/fhir/R4/resource.html#identifiers)).  It is best practice for the identifier to only appear on a single resource instance, however business practices may occasionally dictate that multiple resource instances with the same identifier can exist - possibly even with different resource types.  For example, multiple Patient and a Person resource instance might share the same social insurance number."
        },
        {
          "name": "instantiatesCanonical",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "Instantiates FHIR protocol or definition",
          "definition":
              "The URL pointing to a FHIR-defined protocol, guideline, orderset or other definition that is adhered to in whole or in part by this Communication."
        },
        {
          "name": "instantiatesUri",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "Instantiates external protocol or definition",
          "definition":
              "The URL pointing to an externally maintained protocol, guideline, orderset or other definition that is adhered to in whole or in part by this Communication.",
          "comment":
              "This might be an HTML page, PDF, etc. or could just be a non-resolvable URI identifier."
        },
        {
          "name": "basedOn",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Request fulfilled by this communication",
          "definition":
              "An order, proposal or plan fulfilled in whole or in part by this Communication.",
          "comment":
              "This must point to some sort of a 'Request' resource, such as CarePlan, CommunicationRequest, ServiceRequest, MedicationRequest, etc."
        },
        {
          "name": "partOf",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Part of this action",
          "definition": "Part of this action."
        },
        {
          "name": "inResponseTo",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Reply to",
          "definition":
              "Prior communication that this communication is in response to."
        },
        {
          "name": "status",
          "binding": {
            "name": "CommunicationStatus",
            "description": "The status of the communication.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "CommunicationStatus",
          "target": "%value.value",
          "description":
              "preparation | in-progress | on-hold | stopped | completed | entered-in-error | unknown",
          "definition": "The status of the transmission.",
          "comment":
              "This element is labeled as a modifier because the status contains the codes aborted and entered-in-error that mark the communication as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "statusReason",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Reason for current status",
          "definition":
              "Captures the reason for the current state of the Communication.",
          "comment":
              "This is generally only used for \"exception\" statuses such as \"not-done\", \"suspended\" or \"aborted\". The reason for performing the event at all is captured in reasonCode, not here.",
          "mustSupport": true
        },
        {
          "name": "category",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description": null,
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Message category",
          "definition":
              "The type of message conveyed such as alert, notification, reminder, instruction, etc.",
          "comment":
              "There may be multiple axes of categorization and one communication may serve multiple purposes.",
          "mustSupport": true
        },
        {
          "name": "priority",
          "binding": {
            "name": "CommunicationPriority",
            "description":
                "Codes indicating the relative importance of a communication.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "CommunicationPriority",
          "target": "%value.value",
          "description": "routine | urgent | asap | stat",
          "definition":
              "Characterizes how quickly the planned or in progress communication must be addressed. Includes concepts such as stat, urgent, routine.",
          "comment":
              "Used to prioritize workflow (such as which communication to read first) when the communication is planned or in progress."
        },
        {
