          "elementType": "assertedDate",
          "target":
              "%parent.extension[url='http://hl7.org/fhir/StructureDefinition/condition-assertedDate'].value.value",
          "description": "Date the condition was first asserted",
          "definition":
              "The date on which the existence of the Condition was first asserted or acknowledged.",
          "comment":
              "The assertedDate is in the context of the recording practitioner and might not be the same as the recordedDate.",
          "mustSupport": true
        },
        {
          "name": "dueTo",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target":
              "FHIRHelpers.ToValue(%parent.extension[url='http://hl7.org/fhir/StructureDefinition/condition-dueTo'].value)",
          "description": "What caused the Condition?",
          "definition":
              "Further conditions, problems, diagnoses, procedures or events or the substance that caused/triggered this Condition.",
          "comment":
              "Although a condition may be caused by a substance, this is not intended to be used to record allergies/adverse reactions to substances.",
          "mustSupport": false
        },
        {
          "name": "occurredFollowing",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target":
              "FHIRHelpers.ToValue(%parent.extension[url='http://hl7.org/fhir/StructureDefinition/condition-occurredFollowing'].value)",
          "description": "Precedent for this Condition",
          "definition":
              "Further conditions, problems, diagnoses, procedures or events or the substance that preceded this Condition.",
          "mustSupport": false
        },
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "External Ids for this condition",
          "definition":
              "Business identifiers assigned to this condition by the performer or other systems which remain constant as the resource is updated and propagates from server to server.",
          "comment":
              "This is a business identifier, not a resource identifier (see [discussion](http://hl7.org/fhir/R4/resource.html#identifiers)).  It is best practice for the identifier to only appear on a single resource instance, however business practices may occasionally dictate that multiple resource instances with the same identifier can exist - possibly even with different resource types.  For example, multiple Patient and a Person resource instance might share the same social insurance number."
        },
        {
          "name": "clinicalStatus",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description":
              "active | recurrence | relapse | inactive | remission | resolved",
          "definition": "The clinical status of the condition.",
          "comment":
              "The data type is CodeableConcept because clinicalStatus has some clinical judgment involved, such that there might need to be more specificity than the required FHIR value set allows. For example, a SNOMED coding might allow for additional specificity.",
          "mustSupport": true
        },
        {
          "name": "verificationStatus",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description":
              "unconfirmed | provisional | differential | confirmed | refuted | entered-in-error",
          "definition":
              "The verification status to support the clinical status of the condition.",
          "comment":
              "verificationStatus is not required.  For example, when a patient has abdominal pain in the ED, there is not likely going to be a verification status.\\\\nThe data type is CodeableConcept because verificationStatus has some clinical judgment involved, such that there might need to be more specificity than the required FHIR value set allows. For example, a SNOMED coding might allow for additional specificity.",
          "mustSupport": true
        },
        {
          "name": "category",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ConditionCategory",
            "description": "A category assigned to the condition.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "category codes",
          "definition": "A category assigned to the condition.",
          "comment":
              "The categorization is often highly contextual and may appear poorly differentiated or not very useful in other contexts.",
          "mustSupport": true
        },
        {
          "name": "us-core",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description": null,
            "strength": "Required",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "problem-list-item | health-concern",
          "definition": "A category assigned to the condition.",
          "comment":
              "The categorization is often highly contextual and may appear poorly differentiated or not very useful in other contexts.",
          "mustSupport": true
        },
        {
          "name": "sdoh",
          "binding": {
            "name": "ConditionCategory",
            "description": "A category assigned to the condition.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "problem-list-item | encounter-diagnosis",
          "definition": "A category assigned to the condition.",
          "comment":
              "The categorization is often highly contextual and may appear poorly differentiated or not very useful in other contexts.",
          "mustSupport": true
        },
        {
          "name": "severity",
          "binding": {
            "name": null,
            "description":
                "Codes describing anatomical locations. May include laterality.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Subjective severity of condition",
          "definition":
              "A subjective assessment of the severity of the condition as evaluated by the clinician.",
          "comment":
              "Coding of the severity with a terminology is preferred, where possible.",
          "mustSupport": true
        },
        {
          "name": "code",
          "binding": {
            "name": null,
            "description":
                "Valueset to describe the actual problem experienced by the patient",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description":
              "Identification of the condition, problem or diagnosis",
          "definition":
              "Identification of the condition, problem or diagnosis.",
          "mustSupport": true
        },
        {
          "name": "bodySite",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description":
                "Codes describing anatomical locations. May include laterality.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Anatomical location, if relevant",
          "definition":
              "The anatomical location where this condition manifests itself.",
          "comment":
              "Only used if not implicit in code found in Condition.code. If the use case requires attributes from the BodySite resource (e.g. to identify and track separately) then use the standard extension [bodySite](http://hl7.org/fhir/R4/extension-bodysite.html).  May be a summary code, or a reference to a very precise definition of the location, or both.",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Who has the condition?",
          "definition":
              "Indicates the patient or group who the condition record is associated with.",
          "mustSupport": true
        },
        {
          "name": "encounter",
          "elementType": "Reference",
          "description": "Encounter created as part of",
          "definition":
              "The Encounter during which this Condition was created or to which the creation of this record is tightly associated.",
          "comment":
              "This will typically be the encounter the event occurred within, but some activities may be initiated prior to or after the official completion of an encounter but still be tied to the context of the encounter. This record indicates the encounter this particular record is associated with.  In the case of a \"new\" diagnosis reflecting ongoing/revised information about the condition, this might be distinct from the first encounter in which the underlying condition was first \"known\"."
        },
        {
          "name": "onset",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {"type": "IntervalTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Estimated or actual date,  date-time, or age",
          "definition":
              "Estimated or actual date or date-time  the condition began, in the opinion of the clinician.",
          "comment":
              "Age is generally used when the patient reports an age at which the Condition began to occur.",
          "mustSupport": true
        },
        {
          "name": "abatement",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {"type": "IntervalTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "When in resolution/remission",
          "definition":
              "The date or estimated date that the condition resolved or went into remission. This is called \"abatement\" because of the many overloaded connotations associated with \"remission\" or \"resolution\" - Conditions are never really resolved, but they can abate.",
          "comment":
              "There is no explicit distinction between resolution and remission because in many cases the distinction is not clear. Age is generally used when the patient reports an age at which the Condition abated.  If there is no abatement element, it is unknown whether the condition has resolved or entered remission; applications and users should generally assume that the condition is still valid.  When abatementString exists, it implies the condition is abated.",
          "mustSupport": true
        },
        {
          "name": "recordedDate",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "Date record was first recorded",
          "definition":
              "The recordedDate represents when this particular Condition record was created in the system, which is often a system-generated date.",
          "mustSupport": true
        },
        {
          "name": "recorder",
          "elementType": "Reference",
          "description": "Who recorded the condition",
          "definition":
              "Individual who recorded the record and takes responsibility for its content."
        },
        {
          "name": "asserter",
          "elementType": "Reference",
          "description": "Person who asserts this condition",
          "definition": "Individual who is making the condition statement.",
          "mustSupport": false
        },
        {
          "name": "stage",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Stage/grade, usually assessed formally",
          "definition":
              "Clinical stage or grade of a condition. May include formal severity assessments.",
          "mustSupport": true
        },
        {
          "name": "evidence",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Supporting evidence",
          "definition":
              "Supporting evidence / manifestations that are the basis of the Condition's verification status, such as evidence that confirmed or refuted the condition.",
          "comment":
              "The evidence may be a simple list of coded symptoms/manifestations, or references to observations or formal assessments, or both."
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Additional information about the Condition",
          "definition":
              "Additional information about the Condition. This is a general notes/comments entry  for description of the Condition, its diagnosis and prognosis."
        }
      ]
    },
