    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Coverage",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-coverage",
      "label": "QICore Coverage",
      "primaryCodePath": "type",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Business Identifier for the coverage",
          "definition": "A unique identifier assigned to this coverage.",
          "comment":
              "The main (and possibly only) identifier for the coverage - often referred to as a Member Id, Certificate number, Personal Health Number or Case ID. May be constructed as the concatenation of the Coverage.SubscriberID and the Coverage.dependant."
        },
        {
          "name": "status",
          "binding": {
            "name": "CoverageStatus",
            "description":
                "A code specifying the state of the resource instance.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "CoverageStatus",
          "target": "%value.value",
          "description": "active | cancelled | draft | entered-in-error",
          "definition": "The status of the resource instance.",
          "comment":
              "This element is labeled as a modifier because the status contains the code entered-in-error that marks the coverage as not currently valid."
        },
        {
          "name": "type",
          "binding": {
            "name": null,
            "description":
                "Categories of types of health care payor entities as defined by the US Public Health Data Consortium SOP code system",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Coverage category such as medical or accident",
          "definition":
              "The type of coverage: social program, medical plan, accident coverage (workers compensation, auto), group health or payment by an individual or organization.",
          "mustSupport": true
        },
        {
          "name": "policyHolder",
          "elementType": "Reference",
          "description": "Owner of the policy",
          "definition": "The party who 'owns' the insurance policy.",
          "comment":
              "For example: may be an individual, corporation or the subscriber's employer.",
          "mustSupport": true
        },
        {
          "name": "subscriber",
          "elementType": "Reference",
          "description": "Subscriber to the policy",
          "definition":
              "The party who has signed-up for or 'owns' the contractual relationship to the policy or to whom the benefit of the policy for services rendered to them or their family is due.",
          "comment": "May be self or a parent in the case of dependants."
        },
        {
          "name": "subscriberId",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "ID assigned to the subscriber",
          "definition": "The insurer assigned ID for the Subscriber.",
          "mustSupport": true
        },
        {
          "name": "beneficiary",
          "elementType": "Reference",
          "description": "Plan beneficiary",
          "definition":
              "The party who benefits from the insurance coverage; the patient when products and/or services are provided.",
          "mustSupport": true
        },
        {
          "name": "dependent",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Dependent number",
          "definition":
              "A unique identifier for a dependent under the coverage.",
          "comment":
              "Periodically the member number is constructed from the subscriberId and the dependant number."
        },
        {
          "name": "relationship",
          "binding": {
            "name": "Relationship",
            "description":
                "The relationship between the Subscriber and the Beneficiary (insured/covered party/patient).",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Beneficiary relationship to the subscriber",
          "definition":
              "The relationship of beneficiary (patient) to the subscriber.",
          "comment":
              "Typically, an individual uses policies which are theirs (relationship='self') before policies owned by others."
        },
        {
          "name": "period",
          "elementTypeSpecifier": {"type": "IntervalTypeSpecifier"},
          "target": "FHIRHelpers.ToInterval(%value)",
          "description": "Coverage start and end dates",
          "definition":
              "Time period during which the coverage is in force. A missing start date indicates the start date isn't known, a missing end date means the coverage is continuing to be in force.",
          "mustSupport": true
        },
        {
          "name": "payor",
          "elementType": "Reference",
          "description": "Issuer of the policy",
          "definition":
              "The program or plan underwriter or payor including both insurance and non-insurance agreements, such as patient-pay agreements.",
          "comment":
              "May provide multiple identifiers such as insurance company identifier or business identifier (BIN number).\\\\nFor selfpay it may provide multiple paying persons and/or organizations.",
          "mustSupport": true
        },
        {
          "name": "class",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Additional coverage classifications",
          "definition": "A suite of underwriter specific classifiers.",
          "comment":
              "For example may be used to identify a class of coverage or employer group, Policy, Plan."
        },
        {
          "name": "order",
          "elementType": "System.Integer",
          "target": "%value.value",
          "description": "Relative order of the coverage",
          "definition":
              "The order of applicability of this coverage relative to other coverages which are currently in force. Note, there may be gaps in the numbering and this does not imply primary, secondary etc. as the specific positioning of coverages depends upon the episode of care.",
          "mustSupport": true
        },
        {
          "name": "network",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Insurer network",
          "definition":
              "The insurer-specific identifier for the insurer-defined network of providers to which the beneficiary may seek treatment which will be covered at the 'in-network' rate, otherwise 'out of network' terms and conditions apply."
        },
        {
          "name": "costToBeneficiary",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Patient payments for services/products",
          "definition":
              "A suite of codes indicating the cost category and associated amount which have been detailed in the policy and may have been  included on the health card.",
          "comment":
              "For example by knowing the patient visit co-pay, the provider can collect the amount prior to undertaking treatment."
        },
        {
          "name": "subrogation",
          "elementType": "System.Boolean",
          "target": "%value.value",
          "description": "Reimbursement to insurer",
          "definition":
              "When 'subrogation=true' this insurance instance has been included not for adjudication but to provide insurers with the details to recover costs.",
          "comment":
              "Typically, automotive and worker's compensation policies would be flagged with 'subrogation=true' to enable healthcare payors to collect against accident claims."
        },
        {
          "name": "contract",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Contract details",
          "definition":
              "The policy(s) which constitute this insurance coverage.",
          "mustSupport": true
        }
      ],
      "contextRelationship": [
        {"context": "Patient", "relatedKeyElement": "policyHolder"},
        {"context": "Patient", "relatedKeyElement": "subscriber"},
        {"context": "Patient", "relatedKeyElement": "beneficiary"},
        {"context": "Patient", "relatedKeyElement": "payor"},
        {"context": "RelatedPerson", "relatedKeyElement": "policyHolder"},
        {"context": "RelatedPerson", "relatedKeyElement": "subscriber"},
        {"context": "RelatedPerson", "relatedKeyElement": "payor"}
      ]
    },
