      "baseType": "System.String",
      "retrievable": false,
      "identifier": "http://hl7.org/fhir/StructureDefinition/display",
      "label": "Display Name"
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "DoNotPerformReason",
