    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "DomainResource",
      "baseType": "Resource",
      "retrievable": true,
      "identifier": "http://hl7.org/fhir/StructureDefinition/DomainResource",
      "label": "DomainResource",
      "element": [
        {
          "name": "text",
          "elementType": "Narrative",
          "description":
              "Text summary of the resource, for human interpretation",
          "definition":
              "A human-readable narrative that contains a summary of the resource and can be used to represent the content of the resource to a human. The narrative need not encode all the structured data, but is required to contain sufficient detail to make it \"clinically safe\" for a human to just read the narrative. Resource definitions may define what content should be represented in the narrative to ensure clinical safety.",
          "comment":
              "Contained resources do not have narrative. Resources that are not contained SHOULD have a narrative. In some cases, a resource may only have text with little or no additional discrete data (as long as all minOccurs=1 elements are satisfied).  This may be necessary for data from legacy systems where information is captured as a \"text blob\" or where text is additionally entered raw or narrated and encoded information is added later."
        },
        {
          "name": "contained",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Contained, inline Resources",
          "definition":
              "These resources do not have an independent existence apart from the resource that contains them - they cannot be identified independently, and nor can they have their own independent transaction scope.",
          "comment":
              "This should never be done when the content can be identified properly, as once identification is lost, it is extremely difficult (and context dependent) to restore it again. Contained resources may have profiles and tags In their meta elements, but SHALL NOT have security labels."
        },
        {
          "name": "extension",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Additional content defined by implementations",
          "definition":
              "May be used to represent additional information that is not part of the basic definition of the resource. To make the use of extensions safe and manageable, there is a strict set of governance  applied to the definition and use of extensions. Though any implementer can define an extension, there is a set of requirements that SHALL be met as part of the definition of the extension.",
          "comment":
              "There can be no stigma associated with the use of extensions by any application, project, or standard - regardless of the institution or jurisdiction that uses or defines the extensions.  The use of extensions is what allows the FHIR specification to retain a core level of simplicity for everyone."
        },
        {
          "name": "modifierExtension",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Extensions that cannot be ignored",
          "definition":
              "May be used to represent additional information that is not part of the basic definition of the resource and that modifies the understanding of the element that contains it and/or the understanding of the containing element's descendants. Usually modifier elements provide negation or qualification. To make the use of extensions safe and manageable, there is a strict set of governance applied to the definition and use of extensions. Though any implementer is allowed to define an extension, there is a set of requirements that SHALL be met as part of the definition of the extension. Applications processing a resource are required to check for modifier extensions.\\\\n\\\\nModifier extensions SHALL NOT change the meaning of any elements on Resource or DomainResource (including cannot change the meaning of modifierExtension itself).",
          "comment":
              "There can be no stigma associated with the use of extensions by any application, project, or standard - regardless of the institution or jurisdiction that uses or defines the extensions.  The use of extensions is what allows the FHIR specification to retain a core level of simplicity for everyone."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Dosage",
      "baseType": "BackboneElement",
      "retrievable": false,
      "identifier": "http://hl7.org/fhir/StructureDefinition/Dosage",
      "label": "Dosage",
      "element": [
        {
          "name": "sequence",
          "elementType": "System.Integer",
          "target": "%value.value",
          "description": "The order of the dosage instructions",
          "definition":
              "Indicates the order in which the dosage instructions should be applied or interpreted."
        },
        {
          "name": "text",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Free text dosage instructions e.g. SIG",
          "definition": "Free text dosage instructions e.g. SIG."
        },
        {
          "name": "additionalInstruction",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "AdditionalInstruction",
            "description":
                "A coded concept identifying additional instructions such as \"take with water\" or \"avoid operating heavy machinery\".",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description":
              "Supplemental instruction or warnings to the patient - e.g. \"with meals\", \"may cause drowsiness\"",
          "definition":
              "Supplemental instructions to the patient on how to take the medication  (e.g. \"with meals\" or\"take half to one hour before food\") or warnings for the patient about the medication (e.g. \"may cause drowsiness\" or \"avoid exposure of skin to direct sunlight or sunlamps\").",
          "comment":
              "Information about administration or preparation of the medication (e.g. \"infuse as rapidly as possibly via intraperitoneal port\" or \"immediately following drug x\") should be populated in dosage.text."
        },
        {
          "name": "patientInstruction",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Patient or consumer oriented instructions",
          "definition":
              "Instructions in terms that are understood by the patient or consumer."
        },
        {
          "name": "timing",
          "elementType": "Timing",
          "description": "When medication should be administered",
          "definition": "When medication should be administered.",
          "comment":
              "This attribute might not always be populated while the Dosage.text is expected to be populated.  If both are populated, then the Dosage.text should reflect the content of the Dosage.timing."
        },
        {
          "name": "asNeeded",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Boolean",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "binding": {
            "name": "MedicationAsNeededReason",
            "description":
                "A coded concept identifying the precondition that should be met or evaluated prior to consuming or administering a medication dose.  For example \"pain\", \"30 minutes prior to sexual intercourse\", \"on flare-up\" etc.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Take \"as needed\" (for x)",
          "definition":
              "Indicates whether the Medication is only taken when needed within a specific dosing schedule (Boolean option), or it indicates the precondition for taking the Medication (CodeableConcept).",
          "comment":
              "Can express \"as needed\" without a reason by setting the Boolean = True.  In this case the CodeableConcept is not populated.  Or you can express \"as needed\" with a reason by including the CodeableConcept.  In this case the Boolean is assumed to be True.  If you set the Boolean to False, then the dose is given according to the schedule and is not \"prn\" or \"as needed\"."
        },
        {
          "name": "site",
          "binding": {
            "name": "MedicationAdministrationSite",
            "description":
                "A coded concept describing the site location the medicine enters into or onto the body.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Body site to administer to",
          "definition": "Body site to administer to.",
          "comment":
              "If the use case requires attributes from the BodySite resource (e.g. to identify and track separately) then use the standard extension [bodySite](extension-bodysite.html).  May be a summary code, or a reference to a very precise definition of the location, or both."
        },
        {
          "name": "route",
          "binding": {
            "name": "RouteOfAdministration",
            "description":
                "A coded concept describing the route or physiological path of administration of a therapeutic agent into or onto the body of a subject.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "How drug should enter body",
          "definition": "How drug should enter body."
        },
        {
          "name": "method",
          "binding": {
            "name": "MedicationAdministrationMethod",
            "description":
                "A coded concept describing the technique by which the medicine is administered.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Technique for administering medication",
          "definition": "Technique for administering medication.",
          "comment":
              "Terminologies used often pre-coordinate this term with the route and or form of administration."
        },
        {
          "name": "doseAndRate",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Amount of medication administered",
          "definition": "The amount of medication administered."
        },
        {
          "name": "maxDosePerPeriod",
          "elementType": "System.Ratio",
          "target": "FHIRHelpers.ToRatio(%value)",
          "description": "Upper limit on medication per unit of time",
          "definition": "Upper limit on medication per unit of time.",
          "comment":
              "This is intended for use as an adjunct to the dosage when there is an upper cap.  For example \"2 tablets every 4 hours to a maximum of 8/day\"."
        },
        {
          "name": "maxDosePerAdministration",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description": "Upper limit on medication per administration",
          "definition": "Upper limit on medication per administration.",
          "comment":
              "This is intended for use as an adjunct to the dosage when there is an upper cap.  For example, a body surface area related dose with a maximum amount, such as 1.5 mg/m2 (maximum 2 mg) IV over 5 – 10 minutes would have doseQuantity of 1.5 mg/m2 and maxDosePerAdministration of 2 mg."
        },
        {
          "name": "maxDosePerLifetime",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description":
              "Upper limit on medication per lifetime of the patient",
          "definition": "Upper limit on medication per lifetime of the patient."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Dosage.DoseAndRate",
      "baseType": "Element",
      "retrievable": false,
      "element": [
        {
          "name": "type",
          "binding": {
            "name": "DoseAndRateType",
            "description": "The kind of dose or rate specified.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "The kind of dose or rate specified",
          "definition":
              "The kind of dose or rate specified, for example, ordered or calculated."
        },
        {
          "name": "dose",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {"type": "IntervalTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Amount of medication per dose",
          "definition": "Amount of medication per dose.",
          "comment":
              "Note that this specifies the quantity of the specified medication, not the quantity for each active ingredient(s). Each ingredient amount can be communicated in the Medication resource. For example, if one wants to communicate that a tablet was 375 mg, where the dose was one tablet, you can use the Medication resource to document that the tablet was comprised of 375 mg of drug XYZ. Alternatively if the dose was 375 mg, then you may only need to use the Medication resource to indicate this was a tablet. If the example were an IV such as dopamine and you wanted to communicate that 400mg of dopamine was mixed in 500 ml of some IV solution, then this would all be communicated in the Medication resource. If the administration is not intended to be instantaneous (rate is present or timing has a duration), this can be specified to convey the total amount to be administered over the period of time as indicated by the schedule e.g. 500 ml in dose, with timing used to convey that this should be done over 4 hours."
        },
        {
          "name": "rate",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Ratio",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Amount of medication per unit of time",
          "definition": "Amount of medication per unit of time.",
          "comment":
              "It is possible to supply both a rate and a doseQuantity to provide full details about how the medication is to be administered and supplied. If the rate is intended to change over time, depending on local rules/regulations, each change should be captured as a new version of the MedicationRequest with an updated rate, or captured with a new MedicationRequest with the new rate.\\r\\rIt is possible to specify a rate over time (for example, 100 ml/hour) using either the rateRatio and rateQuantity.  The rateQuantity approach requires systems to have the capability to parse UCUM grammer where ml/hour is included rather than a specific ratio where the time is specified as the denominator.  Where a rate such as 500ml over 2 hours is specified, the use of rateRatio may be more semantically correct than specifying using a rateQuantity of 250 mg/hour."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Element",
      "baseType": "System.Any",
      "retrievable": false,
      "identifier": "http://hl7.org/fhir/StructureDefinition/Element",
      "label": "Element",
      "element": [
        {
          "name": "id",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Unique id for inter-element referencing",
          "definition":
              "Unique id for the element within a resource (for internal references). This may be any string value that does not contain spaces."
        },
        {
          "name": "extension",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Additional content defined by implementations",
          "definition":
              "May be used to represent additional information that is not part of the basic definition of the element. To make the use of extensions safe and manageable, there is a strict set of governance  applied to the definition and use of extensions. Though any implementer can define an extension, there is a set of requirements that SHALL be met as part of the definition of the extension.",
          "comment":
              "There can be no stigma associated with the use of extensions by any application, project, or standard - regardless of the institution or jurisdiction that uses or defines the extensions.  The use of extensions is what allows the FHIR specification to retain a core level of simplicity for everyone."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "EnableWhenBehavior",
      "baseType": "System.String",
      "retrievable": false
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Encounter",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-encounter",
      "label": "QICore Encounter",
      "primaryCodePath": "type",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Identifier(s) by which this encounter is known",
          "definition": "Identifier(s) by which this encounter is known.",
          "mustSupport": true
        },
        {
          "name": "status",
          "binding": {
            "name": "EncounterStatus",
            "description": "Current state of the encounter.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "EncounterStatus",
          "target": "%value.value",
          "description":
              "planned | arrived | triaged | in-progress | onleave | finished | cancelled +",
          "definition":
              "planned | arrived | triaged | in-progress | onleave | finished | cancelled +.",
          "comment":
              "Note that internal business rules will determine the appropriate transitions that may occur between statuses (and also classes).",
          "mustSupport": true
        },
        {
          "name": "statusHistory",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "List of past encounter statuses",
          "definition":
              "The status history permits the encounter resource to contain the status history without needing to read through the historical versions of the resource, or even have the server store them.",
          "comment":
              "The current status is always found in the current version of the resource, not the status history."
        },
        {
          "name": "class",
          "binding": {
            "name": "EncounterClass",
            "description": "Classification of the encounter.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Code",
          "target": "FHIRHelpers.ToCode(%value)",
          "description": "Classification of patient encounter",
          "definition":
              "Concepts representing classification of patient encounter such as ambulatory (outpatient), inpatient, emergency, home health or others due to local variations.",
          "mustSupport": true
        },
        {
          "name": "classHistory",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "List of past encounter classes",
          "definition":
              "The class history permits the tracking of the encounters transitions without needing to go  through the resource history.  This would be used for a case where an admission starts of as an emergency encounter, then transitions into an inpatient scenario. Doing this and not restarting a new encounter ensures that any lab/diagnostic results can more easily follow the patient and not require re-processing and not get lost or cancelled during a kind of discharge from emergency to inpatient."
        },
        {
          "name": "type",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description": "Valueset to describe the Encounter Type",
            "strength": "Extensible",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Specific type of encounter",
          "definition":
              "Specific type of encounter (e.g. e-mail consultation, surgical day-care, skilled nursing, rehabilitation).",
          "comment":
              "Since there are many ways to further classify encounters, this element is 0..*.",
          "mustSupport": true
        },
        {
          "name": "serviceType",
          "binding": {
            "name": "EncounterServiceType",
            "description":
                "Broad categorization of the service that is to be provided.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Specific type of service",
          "definition":
              "Broad categorization of the service that is to be provided (e.g. cardiology)."
        },
        {
          "name": "priority",
          "binding": {
            "name": null,
            "description":
                "A code or set of codes (e.g., for routine, emergency,) specifying the urgency under which the Act happened, can happen, is happening, is intended to happen, or is requested/demanded to happen.\\r\\\\n\\r\\\\n*Discussion:* This attribute is used in orders to indicate the ordered priority, and in event documentation it indicates the actual priority used to perform the act. In definition mood it indicates the available priorities.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Indicates the urgency of the encounter",
          "definition": "Indicates the urgency of the encounter.",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "The patient or group present at the encounter",
          "definition": "The patient or group present at the encounter.",
          "comment":
              "While the encounter is always about the patient, the patient might not actually be known in all contexts of use, and there may be a group of patients that could be anonymous (such as in a group therapy for Alcoholics Anonymous - where the recording of the encounter could be used for billing on the number of people/staff and not important to the context of the specific patients) or alternately in veterinary care a herd of sheep receiving treatment (where the animals are not individually tracked).",
          "mustSupport": true
        },
        {
          "name": "episodeOfCare",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "Episode(s) of care that this encounter should be recorded against",
          "definition":
              "Where a specific encounter should be classified as a part of a specific episode(s) of care this field should be used. This association can facilitate grouping of related encounters together for a specific purpose, such as government reporting, issue tracking, association via a common problem.  The association is recorded on the encounter as these are typically created after the episode of care and grouped on entry rather than editing the episode of care to append another encounter to it (the episode of care could span years)."
        },
        {
          "name": "basedOn",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "The ServiceRequest that initiated this encounter",
          "definition":
              "The request this encounter satisfies (e.g. incoming referral or procedure request).",
          "mustSupport": false
        },
        {
          "name": "participant",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "List of participants involved in the encounter",
          "definition":
              "The list of people responsible for providing the service.",
          "mustSupport": true
        },
        {
          "name": "appointment",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "The appointment that scheduled this encounter",
          "definition": "The appointment that scheduled this encounter."
        },
        {
          "name": "period",
          "elementTypeSpecifier": {"type": "IntervalTypeSpecifier"},
          "target": "FHIRHelpers.ToInterval(%value)",
          "description": "The start and end time of the encounter",
          "definition": "The start and end time of the encounter.",
          "comment":
              "If not (yet) known, the end of the Period may be omitted.",
          "mustSupport": true
        },
        {
          "name": "length",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description":
              "Quantity of time the encounter lasted (less time absent)",
          "definition":
              "Quantity of time the encounter lasted. This excludes the time during leaves of absence.",
          "comment":
              "May differ from the time the Encounter.period lasted because of leave of absence.",
          "mustSupport": true
        },
        {
          "name": "reasonCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "EncounterReason",
            "description": "Reason why the encounter takes place.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Coded reason the encounter takes place",
          "definition":
              "Reason the encounter takes place, expressed as a code. For admissions, this can be used for a coded admission diagnosis.",
          "comment":
              "For systems that need to know which was the primary diagnosis, these will be marked with the standard extension primaryDiagnosis (which is a sequence value rather than a flag, 1 = primary diagnosis).",
          "mustSupport": true
        },
        {
          "name": "reasonReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Reason the encounter takes place (reference)",
          "definition":
              "Reason the encounter takes place, expressed as a code. For admissions, this can be used for a coded admission diagnosis.",
          "comment":
              "For systems that need to know which was the primary diagnosis, these will be marked with the standard extension primaryDiagnosis (which is a sequence value rather than a flag, 1 = primary diagnosis).",
          "mustSupport": true
        },
        {
          "name": "diagnosis",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "The list of diagnosis relevant to this encounter",
          "definition": "The list of diagnosis relevant to this encounter.",
          "mustSupport": true
        },
        {
          "name": "account",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "The set of accounts that may be used for billing for this Encounter",
          "definition":
              "The set of accounts that may be used for billing for this Encounter.",
          "comment":
              "The billing system may choose to allocate billable items associated with the Encounter to different referenced Accounts based on internal business rules."
        },
        {
          "name": "hospitalization",
          "elementType": "Encounter.Hospitalization",
          "description": "Details about the admission to a healthcare service",
          "definition": "Details about the admission to a healthcare service.",
          "comment":
              "An Encounter may cover more than just the inpatient stay. Contexts such as outpatients, community clinics, and aged care facilities are also included.\\r\\rThe duration recorded in the period of this encounter covers the entire scope of this hospitalization record.",
          "mustSupport": true
        },
        {
          "name": "location",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "List of locations where the patient has been",
          "definition":
              "List of locations where  the patient has been during this encounter.",
          "comment":
              "Virtual encounters can be recorded in the Encounter by specifying a location reference to a location of type \"kind\" such as \"client's home\" and an encounter.class = \"virtual\".",
          "mustSupport": true
        },
        {
          "name": "serviceProvider",
          "elementType": "Reference",
          "description":
              "The organization (facility) responsible for this encounter",
          "definition":
              "The organization that is primarily responsible for this Encounter's services. This MAY be the same as the organization on the Patient record, however it could be different, such as if the actor performing the services was from an external organization (which may be billed seperately) for an external consultation.  Refer to the example bundle showing an abbreviated set of Encounters for a colonoscopy.",
          "mustSupport": true
        },
        {
          "name": "partOf",
          "elementType": "Reference",
          "description": "Another Encounter this encounter is part of",
          "definition":
              "Another Encounter of which this encounter is a part of (administratively or in time).",
          "comment":
