          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "male | female | other | unknown",
          "definition": "The birth sex of the family member.",
          "comment":
              "This element should ideally reflect whether the individual is genetically male or female.  However, as reported information based on the knowledge of the patient or reporting friend/relative, there may be situations where the reported sex might not be totally accurate.  E.g. 'Aunt Sue' might be XY rather than XX.  Questions soliciting this information should be phrased to encourage capture of genetic sex where known.  However, systems performing analysis should also allow for the possibility of imprecision with this element."
        },
        {
          "name": "born",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {"type": "IntervalTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}Date",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}String",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "(approximate) date of birth",
          "definition":
              "The actual or approximate date of birth of the relative."
        },
        {
          "name": "age",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}String",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "(approximate) age",
          "definition":
              "The age of the relative at the time the family member history is recorded.",
          "comment":
              "use estimatedAge to indicate whether the age is actual or not.",
          "mustSupport": true
        },
        {
          "name": "estimatedAge",
          "elementType": "System.Boolean",
          "target": "%value.value",
          "description": "Age is estimated?",
          "definition":
              "If true, indicates that the age value specified is an estimated value.",
          "comment":
              "This element is labeled as a modifier because the fact that age is estimated can/should change the results of any algorithm that calculates based on the specified age."
        },
        {
          "name": "deceased",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Boolean",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}Date",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}String",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Dead? How old/when?",
          "definition":
              "Deceased flag or the actual or approximate age of the relative at the time of death for the family member history record.",
          "mustSupport": true
        },
        {
          "name": "reasonCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "FamilyHistoryReason",
            "description":
                "Codes indicating why the family member history was done.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Why was family member history performed?",
          "definition":
              "Describes why the family member history occurred in coded or textual form.",
          "comment": "Textual reasons can be captured using reasonCode.text."
        },
        {
          "name": "reasonReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Why was family member history performed?",
          "definition":
              "Indicates a Condition, Observation, AllergyIntolerance, or QuestionnaireResponse that justifies this family member history event."
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "General note about related person",
          "definition":
              "This property allows a non condition-specific note to the made about the related person. Ideally, the note would be in the condition property, but this is not always possible."
        },
        {
          "name": "condition",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Condition that the related person had",
          "definition":
              "The significant Conditions (or condition) that the family member had. This is a repeating section to allow a system to represent more than one condition per resource, though there is nothing stopping multiple resources - one per condition.",
          "mustSupport": false
        }
      ],
      "contextRelationship": {
        "context": "Patient",
        "relatedKeyElement": "patient"
      }
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "FamilyMemberHistory.Condition",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "code",
          "binding": {
            "name": null,
            "description": "Identification of the Condition or diagnosis.",
