        {
          "name": "condition-severity",
          "elementType": "severity",
          "target":
              "FHIRHelpers.ToConcept(%parent.condition.extension[url='http://hl7.org/fhir/StructureDefinition/familymemberhistory-severity'].value)",
          "description": "The seriousness of the family member condition",
          "definition":
              "A qualification of the seriousness or impact on health of the family member condition.",
          "mustSupport": false
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Flag",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-flag",
      "label": "QICore Flag",
      "primaryCodePath": "code",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Business identifier",
          "definition":
              "Business identifiers assigned to this flag by the performer or other systems which remain constant as the resource is updated and propagates from server to server.",
          "comment":
              "This is a business identifier, not a resource identifier (see [discussion](http://hl7.org/fhir/R4/resource.html#identifiers)).  It is best practice for the identifier to only appear on a single resource instance, however business practices may occasionally dictate that multiple resource instances with the same identifier can exist - possibly even with different resource types.  For example, multiple Patient and a Person resource instance might share the same social insurance number."
        },
        {
          "name": "status",
          "binding": {
            "name": "FlagStatus",
            "description":
                "Indicates whether this flag is active and needs to be displayed to a user, or whether it is no longer needed or was entered in error.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "FlagStatus",
          "target": "%value.value",
          "description": "active | inactive | entered-in-error",
          "definition": "Supports basic workflow.",
          "comment":
              "This element is labeled as a modifier because the status contains codes that mark the resource as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "category",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description": null,
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Clinical, administrative, etc.",
          "definition":
              "Allows a flag to be divided into different categories like clinical, administrative etc. Intended to be used as a means of filtering which flags are displayed to particular user or in a given context.",
          "comment":
              "The value set will often need to be adjusted based on local business rules and usage context.",
          "mustSupport": true
        },
        {
          "name": "code",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Coded or textual message to display to user",
          "definition":
              "The coded value or textual component of the flag to display to the user.",
          "comment":
              "If non-coded, use CodeableConcept.text.  This element should always be included in the narrative.",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Who/What is flag about?",
          "definition":
              "The patient, location, group, organization, or practitioner etc. this is about record this flag is associated with.",
          "mustSupport": true
        },
        {
          "name": "period",
          "elementTypeSpecifier": {"type": "IntervalTypeSpecifier"},
          "target": "FHIRHelpers.ToInterval(%value)",
          "description": "Time period when flag is active",
          "definition":
              "The period of time from the activation of the flag to inactivation of the flag. If the flag is active, the end of the period should be unspecified.",
          "mustSupport": true
        },
        {
          "name": "encounter",
          "elementType": "Reference",
          "description": "Alert relevant during encounter",
          "definition": "This alert is only relevant during the encounter.",
          "comment":
              "If both Flag.encounter and Flag.period are valued, then Flag.period.start shall not be before Encounter.period.start and Flag.period.end shall not be after Encounter.period.end."
        },
        {
          "name": "author",
          "elementType": "Reference",
          "description": "Flag creator",
          "definition":
              "The person, organization or device that created the flag."
        }
      ],
      "contextRelationship": [
        {"context": "Practitioner", "relatedKeyElement": "author"},
        {"context": "Patient", "relatedKeyElement": "patient"},
        {"context": "Device", "relatedKeyElement": "author"}
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "FlagStatus",
      "baseType": "System.String",
      "retrievable": false
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Goal",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-goal",
      "label": "QICore Goal",
      "primaryCodePath": "category",
      "element": [
        {
          "name": "reasonRejected",
          "elementType": "reasonRejected",
          "target":
              "FHIRHelpers.ToConcept(%parent.extension[url='http://hl7.org/fhir/StructureDefinition/goal-reasonRejected'].value)",
          "description": "The reason the goal was not accepted",
          "definition":
              "The reason the goal was not accepted. Applies only if the status of the goal is rejected.",
          "mustSupport": false
        },
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "External Ids for this goal",
          "definition":
              "Business identifiers assigned to this goal by the performer or other systems which remain constant as the resource is updated and propagates from server to server.",
          "comment":
              "This is a business identifier, not a resource identifier (see [discussion](http://hl7.org/fhir/R4/resource.html#identifiers)).  It is best practice for the identifier to only appear on a single resource instance, however business practices may occasionally dictate that multiple resource instances with the same identifier can exist - possibly even with different resource types.  For example, multiple Patient and a Person resource instance might share the same social insurance number."
        },
        {
          "name": "lifecycleStatus",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "System.String",
          "target": "%value.value",
          "description":
              "proposed | planned | accepted | active | on-hold | completed | cancelled | entered-in-error | rejected",
          "definition": "The state of the goal throughout its lifecycle.",
          "comment":
              "This element is labeled as a modifier because the lifecycleStatus contains codes that mark the resource as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "achievementStatus",
          "binding": {
            "name": "GoalAchievementStatus",
            "description":
                "Indicates the progression, or lack thereof, towards the goal against the target.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description":
              "in-progress | improving | worsening | no-change | achieved | sustaining | not-achieved | no-progress | not-attainable",
          "definition":
              "Describes the progression, or lack thereof, towards the goal against the target.",
          "mustSupport": true
        },
        {
          "name": "category",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description": "Codes for grouping and sorting goals.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "E.g. Treatment, dietary, behavioral, etc.",
          "definition": "Indicates a category the goal falls within.",
          "mustSupport": true
        },
        {
          "name": "priority",
          "binding": {
            "name": "GoalPriority",
            "description": "The level of importance associated with a goal.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "high-priority | medium-priority | low-priority",
          "definition":
              "Identifies the mutually agreed level of importance associated with reaching/sustaining the goal.",
          "comment":
              "Extensions are available to track priorities as established by each participant (i.e. Priority from the patient's perspective, different practitioners' perspectives, family member's perspectives)\\r\\rThe ordinal extension on Coding can be used to convey a numerically comparable ranking to priority.  (Keep in mind that different coding systems may use a \"low value=important\"."
        },
        {
          "name": "description",
          "binding": {
            "name": null,
            "description": "Value set to describe the Goal",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Code or text describing goal",
          "definition":
              "Human-readable and/or coded description of a specific desired objective of care, such as \"control blood pressure\" or \"negotiate an obstacle course\" or \"dance with child at wedding\".",
          "comment": "If no code is available, use CodeableConcept.text.",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Who this goal is intended for",
          "definition":
              "Identifies the patient, group or organization for whom the goal is being established.",
          "comment":
              "Should include QICore-Organization, but the base profile only allows USCore-Patient derivatives.",
          "mustSupport": true
        },
        {
          "name": "start",
          "elementType": "System.Date",
          "target": "%value.value",
          "description": "When goal pursuit begins",
          "definition":
              "The date or event after which the goal should begin being pursued.",
          "mustSupport": false
        },
        {
          "name": "target",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Target outcome for the goal",
          "definition": "Indicates what should be done by when.",
          "comment":
              "When multiple targets are present for a single goal instance, all targets must be met for the overall goal to be met.",
          "mustSupport": true
        },
        {
          "name": "statusDate",
          "elementType": "System.Date",
          "target": "%value.value",
          "description": "When goal status took effect",
          "definition":
              "Identifies when the current status.  I.e. When initially created, when achieved, when cancelled, etc.",
          "comment": "To see the date for past statuses, query history.",
          "mustSupport": true
        },
        {
          "name": "statusReason",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Reason for current status",
          "definition": "Captures the reason for the current status.",
          "comment":
              "This will typically be captured for statuses such as rejected, on-hold or cancelled, but could be present for others."
        },
        {
          "name": "expressedBy",
          "elementType": "Reference",
          "description": "Who's responsible for creating Goal?",
          "definition":
              "Indicates whose goal this is - patient goal, practitioner goal, etc.",
          "comment":
              "This is the individual responsible for establishing the goal, not necessarily who recorded it.  (For that, use the Provenance resource.).",
          "mustSupport": false
        },
        {
          "name": "addresses",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Issues addressed by this goal",
          "definition":
              "The identified conditions and other health record elements that are intended to be addressed by the goal.",
          "mustSupport": true
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Comments about the goal",
          "definition": "Any comments related to the goal.",
          "comment":
              "May be used for progress notes, concerns or other related information that doesn't actually describe the goal itself."
        },
        {
          "name": "outcomeCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "GoalOutcome",
            "description":
                "The result of the goal; e.g. \"25% increase in shoulder mobility\", \"Anxiety reduced to moderate levels\".  \"15 kg weight loss sustained over 6 months\".",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "What result was achieved regarding the goal?",
          "definition":
              "Identifies the change (or lack of change) at the point when the status of the goal is assessed.",
          "comment": "Note that this should not duplicate the goal status."
        },
        {
          "name": "outcomeReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Observation that resulted from goal",
          "definition": "Details of what's changed (or not changed).",
          "comment":
              "The goal outcome is independent of the outcome of the related activities.  For example, if the Goal is to achieve a target body weight of 150 lb and a care plan activity is defined to diet, then the care plan’s activity outcome could be calories consumed whereas goal outcome is an observation for the actual body weight measured."
        }
      ],
      "contextRelationship": {
        "context": "Patient",
        "relatedKeyElement": "patient"
      }
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Goal.Target",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "measure",
          "binding": {
            "name": null,
            "description": "LOINC codes",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
