              "Indicates a patient's eligibility for a funding program."
        },
        {
          "name": "fundingSource",
          "binding": {
            "name": "FundingSource",
            "description":
                "The source of funding used to purchase the vaccine administered.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Funding source for the vaccine",
          "definition":
              "Indicates the source of the vaccine actually administered. This may be different than the patient eligibility (e.g. the patient may be eligible for a publically purchased vaccine but due to inventory issues, vaccine purchased with private funds was actually administered)."
        },
        {
          "name": "reaction",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Details of a reaction that follows immunization",
          "definition":
              "Categorical data indicating that an adverse event is associated in time to an immunization.",
          "comment":
              "A reaction may be an indication of an allergy or intolerance and, if this is determined to be the case, it should be recorded as a new AllergyIntolerance resource instance as most systems will not query against past Immunization.reaction elements."
        },
        {
          "name": "protocolApplied",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Protocol followed by the provider",
