    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "LaboratoryResultObservation",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-observation-lab",
      "label": "QICore Laboratory Result Observation",
      "target": "Observation",
      "primaryCodePath": "code",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Business Identifier for observation",
          "definition": "A unique identifier assigned to this observation."
        },
        {
          "name": "basedOn",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Fulfills plan, proposal or order",
          "definition":
              "A plan, proposal or order that is fulfilled in whole or in part by this event.  For example, a MedicationRequest may require a patient to have laboratory test performed before  it is dispensed."
        },
        {
          "name": "partOf",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Part of referenced event",
          "definition":
              "A larger event of which this particular Observation is a component or step.  For example,  an observation as part of a procedure.",
          "comment":
              "To link an Observation to an Encounter use `encounter`.  See the  [Notes](http://hl7.org/fhir/R4/observation.html#obsgrouping) below for guidance on referencing another Observation."
        },
        {
          "name": "status",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "System.String",
          "target": "%value.value",
          "description": "registered | preliminary | final | amended +",
          "definition": "The status of the result value.",
          "comment":
              "This element is labeled as a modifier because the status contains codes that mark the resource as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "category",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ObservationCategory",
            "description": "Codes for high level observation categories.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Classification of  type of observation",
          "definition":
              "A code that classifies the general type of observation being made.",
          "comment":
              "In addition to the required category valueset, this element allows various categorization schemes based on the owner’s definition of the category and effectively multiple categories can be used at once.  The level of granularity is defined by the category concepts in the value set.",
          "mustSupport": true
        },
        {
          "name": "Laboratory",
          "binding": {
            "name": "ObservationCategory",
            "description": "Codes for high level observation categories.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Classification of  type of observation",
          "definition":
              "A code that classifies the general type of observation being made.",
          "comment":
              "In addition to the required category valueset, this element allows various categorization schemes based on the owner’s definition of the category and effectively multiple categories can be used at once.  The level of granularity is defined by the category concepts in the value set.",
          "mustSupport": true
        },
        {
          "name": "code",
          "binding": {
            "name": null,
            "description": "LOINC codes",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Laboratory Test Name",
          "definition":
              "The test that was performed.  A LOINC **SHALL** be used if the concept is present in LOINC.",
          "comment":
              "The typical patterns for codes are:  1)  a LOINC code either as a translation from a \"local\" code or as a primary code, or 2)  a local code only if no suitable LOINC exists,  or 3)  both the local and the LOINC translation.   Systems SHALL be capable of sending the local code if one exists.  When using LOINC , Use either the SHORTNAME or LONG_COMMON_NAME field for the display.",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Who and/or what the observation is about",
          "definition":
              "The patient, or group of patients, location, or device this observation is about and into whose record the observation is placed. If the actual focus of the observation is different from the subject (or a sample of, part, or region of the subject), the `focus` element or the `code` itself specifies the actual focus of the observation.",
          "comment":
              "One would expect this element to be a cardinality of 1..1. The only circumstance in which the subject can be missing is when the observation is made by a device that does not know the patient. In this case, the observation SHALL be matched to a patient through some context/channel matching technique, and at this point, the observation should be updated.",
          "mustSupport": true
        },
        {
          "name": "focus",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "What the observation is about, when it is not about the subject of record",
          "definition":
              "The actual focus of an observation when it is not the patient of record representing something or someone associated with the patient such as a spouse, parent, fetus, or donor. For example, fetus observations in a mother's record.  The focus of an observation could also be an existing condition,  an intervention, the subject's diet,  another observation of the subject,  or a body structure such as tumor or implanted device.   An example use case would be using the Observation resource to capture whether the mother is trained to change her child's tracheostomy tube. In this example, the child is the patient of record and the mother is the focus.",
          "comment":
              "Typically, an observation is made about the subject - a patient, or group of patients, location, or device - and the distinction between the subject and what is directly measured for an observation is specified in the observation code itself ( e.g., \"Blood Glucose\") and does not need to be represented separately using this element.  Use `specimen` if a reference to a specimen is required.  If a code is required instead of a resource use either  `bodysite` for bodysites or the standard extension [focusCode](http://hl7.org/fhir/R4/extension-observation-focuscode.html)."
        },
        {
          "name": "encounter",
          "elementType": "Reference",
          "description":
              "Healthcare event during which this observation is made",
          "definition":
              "The healthcare event  (e.g. a patient and healthcare provider interaction) during which this observation is made.",
          "comment":
              "This will typically be the encounter the event occurred within, but some events may be initiated prior to or after the official completion of an encounter but still be tied to the context of the encounter (e.g. pre-admission laboratory tests)."
        },
        {
          "name": "effective",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {"name": "Timing", "type": "NamedTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Clinically relevant time/time-period for observation",
          "definition":
              "For lab tests this is the specimen collection date.  For Ask at Order Entry Questions (AOE)'s this is the date the question was asked.",
          "comment":
              "At least a date should be present unless this observation is a historical report.  For recording imprecise or \"fuzzy\" times (For example, a blood glucose measurement taken \"after breakfast\") use the [Timing](http://hl7.org/fhir/R4/datatypes.html#timing) datatype which allow the measurement to be tied to regular life events.",
          "mustSupport": true
        },
        {
          "name": "issued",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "Date/Time this version was made available",
          "definition":
              "The date and time this version of the observation was made available to providers, typically after the results have been reviewed and verified.",
          "comment":
              "For Observations that don’t require review and verification, it may be the same as the [`lastUpdated` ](http://hl7.org/fhir/R4/resource-definitions.html#Meta.lastUpdated) time of the resource itself.  For Observations that do require review and verification for certain updates, it might not be the same as the `lastUpdated` time of the resource itself due to a non-clinically significant update that doesn’t require the new version to be reviewed and verified again."
        },
        {
          "name": "performer",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Who is responsible for the observation",
          "definition":
              "Who was responsible for asserting the observed value as \"true\"."
        },
        {
          "name": "value",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}String",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Boolean",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Integer",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}Ratio",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Time",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Result Value",
          "definition":
              "The Laboratory result value.  If a coded value,  the valueCodeableConcept.code **SHOULD** be selected from [SNOMED CT](http://hl7.org/fhir/ValueSet/uslab-obs-codedresults) if the concept exists. If a numeric value, valueQuantity.code **SHALL** be selected from [UCUM](http://unitsofmeasure.org).  A FHIR [UCUM Codes value set](http://hl7.org/fhir/STU3/valueset-ucum-units.html) that defines all UCUM codes is in the FHIR specification.",
          "comment":
              "An observation may have; 1)  a single value here, 2)  both a value and a set of related or component values,  or 3)  only a set of related or component values. If a value is present, the datatype for this element should be determined by Observation.code.  A CodeableConcept with just a text would be used instead of a string if the field was usually coded, or if the type associated with the Observation.code defines a coded value.  For additional guidance, see the [Notes section](http://hl7.org/fhir/R4/observation.html#notes) below.",
          "mustSupport": true
        },
        {
          "name": "dataAbsentReason",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Why the result is missing",
          "definition":
              "Provides a reason why the expected value in the element Observation.value[x] is missing.",
          "comment":
              "Null or exceptional values can be represented two ways in FHIR Observations.  One way is to simply include them in the value set and represent the exceptions in the value.  For example, measurement values for a serology test could be  \"detected\", \"not detected\", \"inconclusive\", or  \"specimen unsatisfactory\".   \\\\n\\\\nThe alternate way is to use the value element for actual observations and use the explicit dataAbsentReason element to record exceptional values.  For example, the dataAbsentReason code \"error\" could be used when the measurement was not completed. Note that an observation may only be reported if there are values to report. For example differential cell counts values may be reported only when > 0.  Because of these options, use-case agreements are required to interpret general observations for null or exceptional values.",
          "mustSupport": true
        },
        {
          "name": "interpretation",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ObservationInterpretation",
            "description": "Codes identifying interpretations of observations.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "High, low, normal, etc.",
          "definition":
              "A categorical assessment of an observation value.  For example, high, low, normal.",
          "comment":
              "Historically used for laboratory results (known as 'abnormal flag' ),  its use extends to other use cases where coded interpretations  are relevant.  Often reported as one or more simple compact codes this element is often placed adjacent to the result value in reports and flow sheets to signal the meaning/normalcy status of the result.",
          "mustSupport": true
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Comments about the observation",
          "definition": "Comments about the observation or the results.",
          "comment":
              "May include general statements about the observation, or statements about significant, unexpected or unreliable results values, or information about its source when relevant to its interpretation."
        },
        {
          "name": "bodySite",
          "binding": {
            "name": "BodySite",
            "description":
                "Codes describing anatomical locations. May include laterality.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Observed body part",
          "definition":
              "Indicates the site on the subject's body where the observation was made (i.e. the target site).",
          "comment":
              "Only used if not implicit in code found in Observation.code.  In many systems, this may be represented as a related observation instead of an inline component.   \\\\n\\\\nIf the use case requires BodySite to be handled as a separate resource (e.g. to identify and track separately) then use the standard extension[ bodySite](http://hl7.org/fhir/R4/extension-bodysite.html)."
        },
        {
          "name": "method",
          "binding": {
            "name": "ObservationMethod",
            "description": "Methods for simple observations.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "How it was done",
          "definition":
              "Indicates the mechanism used to perform the observation.",
          "comment": "Only used if not implicit in code for Observation.code."
        },
        {
          "name": "specimen",
          "elementType": "Reference",
          "description": "Specimen used for this observation",
          "definition":
              "The specimen that was used when this observation was made.",
          "comment":
              "Should only be used if not implicit in code found in `Observation.code`.  Observations are not made on specimens themselves; they are made on a subject, but in many cases by the means of a specimen. Note that although specimens are often involved, they are not always tracked and reported explicitly. Also note that observation resources may be used in contexts that track the specimen explicitly (e.g. Diagnostic Report)."
        },
        {
          "name": "device",
          "elementType": "Reference",
          "description": "(Measurement) Device",
          "definition": "The device used to generate the observation data.",
          "comment":
              "Note that this is not meant to represent a device involved in the transmission of the result, e.g., a gateway.  Such devices may be documented using the Provenance resource where relevant."
        },
        {
          "name": "referenceRange",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Provides guide for interpretation",
          "definition":
              "Guidance on how to interpret the value by comparison to a normal or recommended range.  Multiple reference ranges are interpreted as an \"OR\".   In other words, to represent two distinct target populations, two `referenceRange` elements would be used.",
          "comment":
              "Most observations only have one generic reference range. Systems MAY choose to restrict to only supplying the relevant reference range based on knowledge about the patient (e.g., specific to the patient's age, gender, weight and other factors), but this might not be possible or appropriate. Whenever more than one reference range is supplied, the differences between them SHOULD be provided in the reference range and/or age properties."
        },
        {
          "name": "hasMember",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "Related resource that belongs to the Observation group",
          "definition":
              "This observation is a group observation (e.g. a battery, a panel of tests, a set of vital sign measurements) that includes the target as a member of the group.",
          "comment":
              "When using this element, an observation will typically have either a value or a set of related resources, although both may be present in some cases.  For a discussion on the ways Observations can assembled in groups together, see [Notes](http://hl7.org/fhir/R4/observation.html#obsgrouping) below.  Note that a system may calculate results from [QuestionnaireResponse](http://hl7.org/fhir/R4/questionnaireresponse.html)  into a final score and represent the score as an Observation."
        },
        {
          "name": "derivedFrom",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Related measurements the observation is made from",
          "definition":
              "The target resource that represents a measurement from which this observation value is derived. For example, a calculated anion gap or a fetal measurement based on an ultrasound image.",
          "comment":
              "All the reference choices that are listed in this element can represent clinical observations and other measurements that may be the source for a derived value.  The most common reference will be another Observation.  For a discussion on the ways Observations can assembled in groups together, see [Notes](http://hl7.org/fhir/R4/observation.html#obsgrouping) below."
        },
        {
          "name": "component",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Component results",
          "definition":
              "Some observations have multiple component observations.  These component observations are expressed as separate code value pairs that share the same attributes.  Examples include systolic and diastolic component observations for blood pressure measurement and multiple component observations for genetics observations.",
          "comment":
              "For a discussion on the ways Observations can be assembled in groups together see [Notes](http://hl7.org/fhir/R4/observation.html#notes) below.",
          "mustSupport": true
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "LinkType",
      "baseType": "System.String",
      "retrievable": false
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Location",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-location",
      "label": "QICore Location",
      "primaryCodePath": "type",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "Unique code or number identifying the location to its users",
          "definition":
              "Unique code or number identifying the location to its users.",
          "mustSupport": true
        },
        {
          "name": "status",
          "binding": {
            "name": "LocationStatus",
            "description": "Indicates whether the location is still in use.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "LocationStatus",
          "target": "%value.value",
          "description": "active | suspended | inactive",
          "definition":
              "The status property covers the general availability of the resource, not the current value which may be covered by the operationStatus, or by a schedule/slots if they are configured for the location.",
          "mustSupport": true
        },
        {
          "name": "operationalStatus",
          "binding": {
            "name": "OperationalStatus",
            "description":
                "The operational status if the location (where typically a bed/room).",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Code",
          "target": "FHIRHelpers.ToCode(%value)",
          "description":
              "The operational status of the location (typically only for a bed/room)",
          "definition":
              "The operational status covers operation values most relevant to beds (but can also apply to rooms/units/chairs/etc. such as an isolation unit/dialysis chair). This typically covers concepts such as contamination, housekeeping, and other activities like maintenance."
        },
        {
          "name": "name",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Name of the location as used by humans",
          "definition":
              "Name of the location as used by humans. Does not need to be unique.",
          "comment":
              "If the name of a location changes, consider putting the old name in the alias column so that it can still be located through searches.",
          "mustSupport": true
        },
        {
          "name": "alias",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description":
              "A list of alternate names that the location is known as, or was known as, in the past",
          "definition":
              "A list of alternate names that the location is known as, or was known as, in the past.",
          "comment":
              "There are no dates associated with the alias/historic names, as this is not intended to track when names were used, but to assist in searching so that older names can still result in identifying the location."
        },
        {
          "name": "description",
          "elementType": "System.String",
          "target": "%value.value",
          "description":
              "Additional details about the location that could be displayed as further information to identify the location beyond its name",
          "definition":
              "Description of the Location, which helps in finding or referencing the place."
        },
        {
          "name": "mode",
          "binding": {
            "name": "LocationMode",
            "description":
                "Indicates whether a resource instance represents a specific location or a class of locations.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "LocationMode",
          "target": "%value.value",
          "description": "instance | kind",
          "definition":
              "Indicates whether a resource instance represents a specific location or a class of locations.",
          "comment":
              "This is labeled as a modifier because whether or not the location is a class of locations changes how it can be used and understood.",
          "mustSupport": true
        },
        {
          "name": "type",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description":
                "A role of a place that further classifies the setting (e.g., accident site, road side, work site, community location) in which services are delivered.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Type of function performed",
          "definition":
              "Indicates the type of function performed at the location.",
          "mustSupport": true
        },
        {
          "name": "telecom",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Contact details of the location",
          "definition":
              "The contact details of communication devices available at the location. This can include phone numbers, fax numbers, mobile numbers, email addresses and web sites.",
          "mustSupport": true
        },
        {
          "name": "address",
          "elementType": "Address",
          "description": "Physical location",
          "definition": "Physical location.",
          "comment":
              "Additional addresses should be recorded using another instance of the Location resource, or via the Organization.",
          "mustSupport": true
        },
        {
          "name": "physicalType",
          "binding": {
            "name": "PhysicalType",
            "description": "Physical form of the location.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Physical form of the location",
          "definition":
              "Physical form of the location, e.g. building, room, vehicle, road."
        },
        {
          "name": "position",
          "elementType": "Location.Position",
          "description": "The absolute geographic location",
          "definition":
              "The absolute geographic location of the Location, expressed using the WGS84 datum (This is the same co-ordinate system used in KML)."
        },
        {
          "name": "managingOrganization",
          "elementType": "Reference",
          "description": "Organization responsible for provisioning and upkeep",
          "definition":
              "The organization responsible for the provisioning and upkeep of the location.",
          "comment":
              "This can also be used as the part of the organization hierarchy where this location provides services. These services can be defined through the HealthcareService resource.",
          "mustSupport": true
        },
        {
          "name": "partOf",
          "elementType": "Reference",
          "description": "Another Location this one is physically a part of",
          "definition":
              "Another Location of which this Location is physically a part of.",
          "mustSupport": false
        },
        {
          "name": "hoursOfOperation",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "What days/times during a week is this location usually open",
          "definition":
              "What days/times during a week is this location usually open.",
          "comment":
              "This type of information is commonly found published in directories and on websites informing customers when the facility is available.\\\\n\\\\nSpecific services within the location may have their own hours which could be shorter (or longer) than the locations hours."
        },
        {
          "name": "availabilityExceptions",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Description of availability exceptions",
          "definition":
              "A description of when the locations opening ours are different to normal, e.g. public holiday availability. Succinctly describing all possible exceptions to normal site availability as detailed in the opening hours Times."
        },
        {
          "name": "endpoint",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "Technical endpoints providing access to services operated for the location",
          "definition":
              "Technical endpoints providing access to services operated for the location."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Location.HoursOfOperation",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "daysOfWeek",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
