    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Medication",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-medication",
      "label": "QICore Medication",
      "primaryCodePath": "code",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Business identifier for this medication",
          "definition": "Business identifier for this medication.",
          "comment": "The serial number could be included as an identifier."
        },
        {
          "name": "code",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Codes that identify this medication",
          "definition":
              "A code (or set of codes) that specify this medication, or a textual description if no code is available. Usage note: This could be a standard medication code such as a code from RxNorm, SNOMED CT, IDMP etc. It could also be a national or local formulary code, optionally with translations to other code systems.",
          "comment":
              "Depending on the context of use, the code that was actually selected by the user (prescriber, dispenser, etc.) will have the coding.userSelected set to true.  As described in the coding datatype: \"A coding may be marked as a \"userSelected\" if a user selected the particular coded value in a user interface (e.g. the user selects an item in a pick-list). If a user selected coding exists, it is the preferred choice for performing translations etc. Other codes can only be literal translations to alternative code systems, or codes at a lower level of granularity (e.g. a generic code for a vendor-specific primary one).",
          "mustSupport": true
        },
        {
          "name": "status",
          "binding": {
            "name": "MedicationStatus",
            "description":
                "A coded concept defining if the medication is in active use.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "MedicationStatus",
          "target": "%value.value",
          "description": "active | inactive | entered-in-error",
          "definition":
              "A code to indicate if the medication is in active use.",
          "comment":
              "This status is intended to identify if the medication in a local system is in active use within a drug database or inventory.  For example, a pharmacy system may create a new drug file record for a compounded product \"ABC Hospital Special Cream\" with an active status.  At some point in the future, it may be determined that the drug record was created with an error and the status is changed to \"entered in error\".   This status is not intended to specify if a medication is part of a particular formulary.  It is possible that the drug record may be referenced by multiple formularies or catalogues and each of those entries would have a separate status."
        },
        {
          "name": "manufacturer",
          "elementType": "Reference",
          "description": "Manufacturer of the item",
          "definition":
              "Describes the details of the manufacturer of the medication product.  This is not intended to represent the distributor of a medication product.",
          "mustSupport": false
        },
        {
          "name": "form",
          "binding": {
            "name": "MedicationForm",
            "description": "A coded concept defining the form of a medication.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "powder | tablets | capsule +",
          "definition":
              "Describes the form of the item.  Powder; tablets; capsule.",
          "comment":
              "When Medication is referenced from MedicationRequest, this is the ordered form.  When Medication is referenced within MedicationDispense, this is the dispensed form.  When Medication is referenced within MedicationAdministration, this is administered form."
        },
        {
          "name": "amount",
          "elementType": "System.Ratio",
          "target": "FHIRHelpers.ToRatio(%value)",
          "description": "Amount of drug in package",
          "definition":
              "Specific amount of the drug in the packaged product.  For example, when specifying a product that has the same strength (For example, Insulin glargine 100 unit per mL solution for injection), this attribute provides additional clarification of the package amount (For example, 3 mL, 10mL, etc.)."
        },
        {
          "name": "ingredient",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Active or inactive ingredient",
          "definition":
              "Identifies a particular constituent of interest in the product.",
          "comment":
              "The ingredients need not be a complete list.  If an ingredient is not specified, this does not indicate whether an ingredient is present or absent.  If an ingredient is specified it does not mean that all ingredients are specified.  It is possible to specify both inactive and active ingredients.",
          "mustSupport": false
        },
        {
          "name": "batch",
          "elementType": "Medication.Batch",
          "description": "Details about packaged medications",
          "definition":
              "Information that only applies to packages (not products)."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Medication.Batch",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "lotNumber",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Identifier assigned to batch",
          "definition":
              "The assigned lot number of a batch of the specified product."
        },
        {
          "name": "expirationDate",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "When batch will expire",
          "definition": "When this specific batch of product will expire."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Medication.Ingredient",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "item",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              },
              {"name": "Reference", "type": "NamedTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "The actual ingredient or content",
          "definition":
              "The actual ingredient - either a substance (simple ingredient) or another medication of a medication.",
          "mustSupport": false
        },
        {
          "name": "isActive",
          "elementType": "System.Boolean",
          "target": "%value.value",
          "description": "Active ingredient indicator",
          "definition":
              "Indication of whether this ingredient affects the therapeutic action of the drug.",
          "mustSupport": false
        },
        {
          "name": "strength",
          "elementType": "System.Ratio",
          "target": "FHIRHelpers.ToRatio(%value)",
          "description": "Quantity of ingredient present",
          "definition":
              "Specifies how many (or how much) of the items there are in this Medication.  For example, 250 mg per tablet.  This is expressed as a ratio where the numerator is 250mg and the denominator is 1 tablet."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "MedicationAdministration",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-medicationadministration",
      "label": "QICore MedicationAdministration",
      "primaryCodePath": "medication",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "External identifier",
          "definition":
              "Identifiers associated with this Medication Administration that are defined by business processes and/or used to refer to it when a direct URL reference to the resource itself is not appropriate. They are business identifiers assigned to this resource by the performer or other systems and remain constant as the resource is updated and propagates from server to server.",
          "comment": "This is a business identifier, not a resource identifier."
        },
        {
          "name": "instantiates",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "Instantiates protocol or definition",
          "definition":
              "A protocol, guideline, orderset, or other definition that was adhered to in whole or in part by this event."
        },
        {
          "name": "partOf",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Part of referenced event",
          "definition":
              "A larger event of which this particular event is a component or step."
        },
        {
          "name": "status",
          "binding": {
            "name": "MedicationAdministrationStatus",
            "description":
                "A set of codes indicating the current status of a MedicationAdministration.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "MedicationAdministrationStatus",
          "target": "%value.value",
          "description":
              "in-progress | on-hold | completed | entered-in-error | stopped | unknown",
          "definition":
              "Will generally be set to show that the administration has been completed.  For some long running administrations such as infusions, it is possible for an administration to be started but not completed or it may be paused while some other process is under way.",
          "comment":
              "This element is labeled as a modifier because the status contains codes that mark the resource as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "statusReason",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description": null,
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Reason administration not performed",
          "definition":
              "A code indicating why the administration was not performed.",
          "mustSupport": true
        },
        {
          "name": "category",
          "binding": {
            "name": "MedicationAdministrationCategory",
            "description":
                "A coded concept describing where the medication administered is expected to occur.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Type of medication usage",
          "definition":
              "Indicates where the medication is expected to be consumed or administered."
        },
        {
          "name": "medication",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              },
              {"name": "Reference", "type": "NamedTypeSpecifier"}
            ]
          },
          "binding": {
            "name": null,
            "description": "The set of RxNorm codes to represent medications",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "What was administered",
          "definition":
              "Identifies the medication that was administered. This is either a link to a resource representing the details of the medication or a simple attribute carrying a code that identifies the medication from a known list of medications.",
          "comment":
              "If only a code is specified, then it needs to be a code for a specific product. If more information is required, then the use of the medication resource is recommended.  For example, if you require form or lot number, then you must reference the Medication resource.",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Who received medication",
          "definition":
              "The person or animal or group receiving the medication.",
          "mustSupport": true
        },
        {
          "name": "context",
          "elementType": "Reference",
          "description": "Encounter or Episode of Care administered as part of",
          "definition":
              "The visit, admission, or other contact between patient and health care provider during which the medication administration was performed.",
          "mustSupport": true
        },
        {
          "name": "supportingInformation",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Additional information to support administration",
          "definition":
              "Additional information (for example, patient height and weight) that supports the administration of the medication."
        },
        {
          "name": "effective",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Start and end time of administration",
          "definition":
              "A specific date/time or interval of time during which the administration took place (or did not take place, when the 'notGiven' attribute is true). For many administrations, such as swallowing a tablet the use of dateTime is more appropriate.",
          "mustSupport": true
        },
        {
          "name": "performer",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "Who performed the medication administration and what they did",
          "definition":
              "Indicates who or what performed the medication administration and how they were involved.",
          "mustSupport": false
        },
