          "definition":
              "The minimum period of time that must occur between dispenses of the medication.",
          "mustSupport": true
        },
        {
          "name": "validityPeriod",
          "elementTypeSpecifier": {"type": "IntervalTypeSpecifier"},
          "target": "FHIRHelpers.ToInterval(%value)",
          "description": "Time period supply is authorized for",
          "definition":
              "This indicates the validity period of a prescription (stale dating the Prescription).",
          "comment":
              "It reflects the prescribers' perspective for the validity of the prescription. Dispenses must not be made against the prescription outside of this period. The lower-bound of the Dispensing Window signifies the earliest date that the prescription can be filled for the first time. If an upper-bound is not specified then the Prescription is open-ended or will default to a stale-date based on regulations.",
          "mustSupport": true
        },
        {
          "name": "numberOfRepeatsAllowed",
          "elementType": "System.Integer",
          "target": "%value.value",
          "description": "Number of refills authorized",
          "definition":
              "An integer indicating the number of times, in addition to the original dispense, (aka refills or repeats) that the patient can receive the prescribed medication. Usage Notes: This integer does not include the original order dispense. This means that if an order indicates dispense 30 tablets plus \"3 repeats\", then the order can be dispensed a total of 4 times and the patient can receive a total of 120 tablets.  A prescriber may explicitly say that zero refills are permitted after the initial dispense.",
          "comment":
              "If displaying \"number of authorized fills\", add 1 to this number.",
          "mustSupport": true
        },
        {
          "name": "quantity",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description": "Amount of medication to supply per dispense",
          "definition": "The amount that is to be dispensed for one fill.",
          "mustSupport": true
        },
        {
          "name": "expectedSupplyDuration",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description": "Number of days supply per dispense",
          "definition":
              "Identifies the period time over which the supplied product is expected to be used, or the length of time the dispense is expected to last.",
          "comment":
              "In some situations, this attribute may be used instead of quantity to identify the amount supplied by how long it is expected to last, rather than the physical quantity issued, e.g. 90 days supply of medication (based on an ordered dosage). When possible, it is always better to specify quantity, as this tends to be more precise. expectedSupplyDuration will always be an estimate that can be influenced by external factors.",
          "mustSupport": true
        },
        {
          "name": "performer",
          "elementType": "Reference",
          "description": "Intended dispenser",
          "definition":
              "Indicates the intended dispensing Organization specified by the prescriber."
        }
