                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "binding": {
            "name": "MedicationRequestSubstitution",
            "description": "Identifies the type of substitution allowed.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Whether substitution is allowed or not",
          "definition":
              "True if the prescriber allows a different drug to be dispensed from what was prescribed.",
          "comment":
              "This element is labeled as a modifier because whether substitution is allow or not, it cannot be ignored."
        },
        {
          "name": "reason",
          "binding": {
            "name": "MedicationIntendedSubstitutionReason",
            "description":
                "A coded concept describing the reason that a different medication should (or should not) be substituted from what was prescribed.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Why should (not) substitution be made",
          "definition":
              "Indicates the reason for the substitution, or why substitution must or must not be performed."
        }
      ]
