    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "MedicationStatement",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-medicationstatement",
      "label": "QICore MedicationStatement",
      "primaryCodePath": "medication",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "External identifier",
          "definition":
              "Identifiers associated with this Medication Statement that are defined by business processes and/or used to refer to it when a direct URL reference to the resource itself is not appropriate. They are business identifiers assigned to this resource by the performer or other systems and remain constant as the resource is updated and propagates from server to server.",
          "comment": "This is a business identifier, not a resource identifier."
        },
        {
          "name": "basedOn",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Fulfils plan, proposal or order",
          "definition":
              "A plan, proposal or order that is fulfilled in whole or in part by this event."
        },
        {
          "name": "partOf",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Part of referenced event",
          "definition":
              "A larger event of which this particular event is a component or step."
        },
        {
          "name": "status",
          "binding": {
            "name": "MedicationStatementStatus",
            "description":
                "A coded concept indicating the current status of a MedicationStatement.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "MedicationStatementStatus",
          "target": "%value.value",
          "description":
              "active | completed | entered-in-error | intended | stopped | on-hold | unknown | not-taken",
          "definition":
              "A code representing the patient or other source's judgment about the state of the medication used that this statement is about.  Generally, this will be active or completed.",
          "comment":
              "MedicationStatement is a statement at a point in time.  The status is only representative at the point when it was asserted.  The value set for MedicationStatement.status contains codes that assert the status of the use of the medication by the patient (for example, stopped or on hold) as well as codes that assert the status of the medication statement itself (for example, entered in error).\\r\\rThis element is labeled as a modifier because the status contains codes that mark the resource as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "statusReason",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "MedicationStatementStatusReason",
            "description":
                "A coded concept indicating the reason for the status of the statement.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Reason for current status",
          "definition":
              "Captures the reason for the current state of the MedicationStatement.",
          "comment":
              "This is generally only used for \"exception\" statuses such as \"not-taken\", \"on-hold\", \"cancelled\" or \"entered-in-error\". The reason for performing the event at all is captured in reasonCode, not here."
        },
        {
          "name": "category",
          "binding": {
            "name": "MedicationStatementCategory",
            "description":
                "A coded concept identifying where the medication included in the MedicationStatement is expected to be consumed or administered.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Type of medication usage",
          "definition":
              "Indicates where the medication is expected to be consumed or administered."
        },
        {
          "name": "medication",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              },
              {"name": "Reference", "type": "NamedTypeSpecifier"}
            ]
          },
          "binding": {
            "name": null,
            "description": "The set of RxNorm codes to represent medications",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "What medication was taken",
          "definition":
              "Identifies the medication being administered. This is either a link to a resource representing the details of the medication or a simple attribute carrying a code that identifies the medication from a known list of medications.",
          "comment":
              "If only a code is specified, then it needs to be a code for a specific product. If more information is required, then the use of the medication resource is recommended.  For example, if you require form or lot number, then you must reference the Medication resource.",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Who is/was taking  the medication",
          "definition":
              "The person, animal or group who is/was taking the medication.",
          "mustSupport": true
        },
        {
          "name": "context",
          "elementType": "Reference",
          "description":
              "Encounter / Episode associated with MedicationStatement",
          "definition":
              "The encounter or episode of care that establishes the context for this MedicationStatement."
        },
        {
          "name": "effective",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description":
              "The date/time or interval when the medication is/was/will be taken",
          "definition":
              "The interval of time during which it is being asserted that the patient is/was/will be taking the medication (or was not taking, when the MedicationStatement.taken element is No).",
          "comment":
              "This attribute reflects the period over which the patient consumed the medication and is expected to be populated on the majority of Medication Statements. If the medication is still being taken at the time the statement is recorded, the \"end\" date will be omitted.  The date/time attribute supports a variety of dates - year, year/month and exact date.  If something more than this is required, this should be conveyed as text.",
          "mustSupport": true
        },
        {
          "name": "dateAsserted",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "When the statement was asserted?",
          "definition":
              "The date when the medication statement was asserted by the information source.",
          "mustSupport": true
        },
        {
          "name": "informationSource",
          "elementType": "Reference",
          "description":
              "Person or organization that provided the information about the taking of this medication",
          "definition":
              "The person or organization that provided the information about the taking of this medication. Note: Use derivedFrom when a MedicationStatement is derived from other resources, e.g. Claim or MedicationRequest.",
          "mustSupport": true
        },
        {
          "name": "derivedFrom",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Additional supporting information",
          "definition":
              "Allows linking the MedicationStatement to the underlying MedicationRequest, or to other information that supports or is used to derive the MedicationStatement.",
          "comment":
              "Likely references would be to MedicationRequest, MedicationDispense, Claim, Observation or QuestionnaireAnswers.  The most common use cases for deriving a MedicationStatement comes from creating a MedicationStatement from a MedicationRequest or from a lab observation or a claim.  it should be noted that the amount of information that is available varies from the type resource that you derive the MedicationStatement from.",
          "mustSupport": true
        },
        {
          "name": "reasonCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "MedicationReason",
            "description":
                "A coded concept identifying why the medication is being taken.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Reason for why the medication is being/was taken",
          "definition": "A reason for why the medication is being/was taken.",
          "comment":
              "This could be a diagnosis code. If a full condition record exists or additional detail is needed, use reasonForUseReference.",
          "mustSupport": false
        },
        {
          "name": "reasonReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "Condition or observation that supports why the medication is being/was taken",
          "definition":
              "Condition or observation that supports why the medication is being/was taken.",
          "comment":
              "This is a reference to a condition that is the reason why the medication is being/was taken.  If only a code exists, use reasonForUseCode."
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Further information about the statement",
          "definition":
              "Provides extra information about the medication statement that is not conveyed by the other attributes."
        },
        {
          "name": "dosage",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "Details of how medication is/was taken or should be taken",
          "definition":
              "Indicates how the medication is/was or should be taken by the patient.",
          "comment":
              "The dates included in the dosage on a Medication Statement reflect the dates for a given dose.  For example, \"from November 1, 2016 to November 3, 2016, take one tablet daily and from November 4, 2016 to November 7, 2016, take two tablets daily.\"  It is expected that this specificity may only be populated where the patient brings in their labeled container or where the Medication Statement is derived from a MedicationRequest.",
          "mustSupport": false
        }
      ],
      "contextRelationship": [
        {"context": "Practitioner", "relatedKeyElement": "informationSource"},
        {"context": "Patient", "relatedKeyElement": "subject"},
        {"context": "RelatedPerson", "relatedKeyElement": "informationSource"}
      ]
    },
