      "baseType": "Element",
      "retrievable": false,
      "identifier": "http://hl7.org/fhir/StructureDefinition/Meta",
      "label": "Meta",
      "element": [
        {
          "name": "versionId",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Version specific identifier",
          "definition":
              "The version specific identifier, as it appears in the version portion of the URL. This value changes when the resource is created, updated, or deleted.",
          "comment":
              "The server assigns this value, and ignores what the client specifies, except in the case that the server is imposing version integrity on updates/deletes."
        },
        {
          "name": "lastUpdated",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "When the resource version last changed",
          "definition":
              "When the resource last changed - e.g. when the version changed.",
          "comment":
              "This value is always populated except when the resource is first being created. The server / resource manager sets this value; what a client provides is irrelevant. This is equivalent to the HTTP Last-Modified and SHOULD have the same value on a [read](http.html#read) interaction."
        },
        {
          "name": "source",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Identifies where the resource comes from",
          "definition":
              "A uri that identifies the source system of the resource. This provides a minimal amount of [Provenance](provenance.html#) information that can be used to track or differentiate the source of information in the resource. The source may identify another FHIR server, document, message, database, etc.",
          "comment":
              "In the provenance resource, this corresponds to Provenance.entity.what[x]. The exact use of the source (and the implied Provenance.entity.role) is left to implementer discretion. Only one nominated source is allowed; for additional provenance details, a full Provenance resource should be used. \\\\n\\\\nThis element can be used to indicate where the current master source of a resource that has a canonical URL if the resource is no longer hosted at the canonical URL."
        },
        {
          "name": "profile",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "Profiles this resource claims to conform to",
          "definition":
              "A list of profiles (references to [StructureDefinition](structuredefinition.html#) resources) that this resource claims to conform to. The URL is a reference to [StructureDefinition.url](structuredefinition-definitions.html#StructureDefinition.url).",
          "comment":
              "It is up to the server and/or other infrastructure of policy to determine whether/how these claims are verified and/or updated over time.  The list of profile URLs is a set."
        },
        {
          "name": "security",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "SecurityLabels",
            "description":
                "Security Labels from the Healthcare Privacy and Security Classification System.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToCode(%value)",
          "description": "Security Labels applied to this resource",
          "definition":
              "Security labels applied to this resource. These tags connect specific resources to the overall security policy and infrastructure.",
          "comment":
              "The security labels can be updated without changing the stated version of the resource. The list of security labels is a set. Uniqueness is based the system/code, and version and display are ignored."
        },
        {
          "name": "tag",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "Tags",
            "description":
                "Codes that represent various types of tags, commonly workflow-related; e.g. \"Needs review by Dr. Jones\".",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToCode(%value)",
          "description": "Tags applied to this resource",
          "definition":
              "Tags applied to this resource. Tags are intended to be used to identify and relate resources to process and workflow, and applications are not required to consider the tags when interpreting the meaning of a resource.",
          "comment":
              "The tags can be updated without changing the stated version of the resource. The list of tags is a set. Uniqueness is based the system/code, and version and display are ignored."
        }
      ]
    },
