    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Observation.ReferenceRange",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "low",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description": "Low Range, if relevant",
          "definition":
              "The value of the low bound of the reference range.  The low bound of the reference range endpoint is inclusive of the value (e.g.  reference range is >=5 - <=9). If the low bound is omitted,  it is assumed to be meaningless (e.g. reference range is <=2.3)."
        },
        {
          "name": "high",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description": "High Range, if relevant",
          "definition":
              "The value of the high bound of the reference range.  The high bound of the reference range endpoint is inclusive of the value (e.g.  reference range is >=5 - <=9). If the high bound is omitted,  it is assumed to be meaningless (e.g. reference range is >= 2.3)."
        },
        {
          "name": "type",
          "binding": {
            "name": "ObservationRangeMeaning",
            "description": "Code for the meaning of a reference range.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Reference range qualifier",
          "definition":
              "Codes to indicate the what part of the targeted reference population it applies to. For example, the normal or therapeutic range.",
          "comment":
              "This SHOULD be populated if there is more than one range.  If this element is not present then the normal range is assumed."
        },
        {
          "name": "appliesTo",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ObservationRangeType",
            "description":
                "Codes identifying the population the reference range applies to.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Reference range population",
          "definition":
              "Codes to indicate the target population this reference range applies to.  For example, a reference range may be based on the normal population or a particular sex or race.  Multiple `appliesTo`  are interpreted as an \"AND\" of the target populations.  For example, to represent a target population of African American females, both a code of female and a code for African American would be used.",
          "comment":
              "This SHOULD be populated if there is more than one range.  If this element is not present then the normal population is assumed."
        },
        {
          "name": "age",
          "elementTypeSpecifier": {"type": "IntervalTypeSpecifier"},
          "target": "FHIRHelpers.ToInterval(%value)",
          "description": "Applicable age range, if relevant",
          "definition":
              "The age at which this reference range is applicable. This is a neonatal age (e.g. number of weeks at term) if the meaning says so."
        },
        {
          "name": "text",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Text based reference range in an observation",
          "definition":
              "Text based reference range in an observation which may be used when a quantitative range is not appropriate for an observation.  An example would be a reference value of \"Negative\" or a list or table of \"normals\"."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "ObservationCancelled",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-observationcancelled",
      "label": "QICore Observation Cancelled",
      "target": "Observation",
      "primaryCodePath": "code",
      "element": [
        {
          "name": "notDoneReason",
          "elementType": "NotDoneReason",
          "target":
              "FHIRHelpers.ToConcept(%parent.extension[url='http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-notDoneReason'].value)",
          "description": "Extension",
          "definition": "Indicates the reason the event was not done.",
          "mustSupport": true
        },
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Business Identifier for observation",
          "definition": "A unique identifier assigned to this observation."
        },
        {
          "name": "basedOn",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Fulfills plan, proposal or order",
          "definition":
              "A plan, proposal or order that is fulfilled in whole or in part by this event.  For example, a MedicationRequest may require a patient to have laboratory test performed before  it is dispensed."
        },
        {
          "name": "partOf",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Part of referenced event",
          "definition":
              "A larger event of which this particular Observation is a component or step.  For example,  an observation as part of a procedure.",
          "comment":
              "To link an Observation to an Encounter use `encounter`.  See the  [Notes](http://hl7.org/fhir/R4/observation.html#obsgrouping) below for guidance on referencing another Observation."
        },
        {
          "name": "status",
          "binding": {
            "name": "ObservationStatus",
            "description": "Codes providing the status of an observation.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "ObservationStatus",
          "target": "%value.value",
          "description": "registered | preliminary | final | amended +",
          "definition": "The status of the result value.",
          "comment":
              "This element is labeled as a modifier because the status contains codes that mark the resource as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "category",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ObservationCategory",
            "description": "Codes for high level observation categories.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Classification of  type of observation",
          "definition":
              "A code that classifies the general type of observation being made.",
          "comment":
              "In addition to the required category valueset, this element allows various categorization schemes based on the owner’s definition of the category and effectively multiple categories can be used at once.  The level of granularity is defined by the category concepts in the value set.",
          "mustSupport": true
        },
        {
          "name": "code",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{http://hl7.org/fhir}ValueSet",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "binding": {
            "name": "ObservationCode",
            "description": "Codes identifying names of simple observations.",
            "strength": "Example",
            "valueSet": ""
          },
          "target":
              "System.Concept:FHIRHelpers.ToConcept(%value);System.ValueSet:FHIRHelpers.ToValueSet(%parent.code.extension[url='http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-notDoneValueSet'].value.value)",
          "description": "Type of observation (code / type)",
          "definition":
              "Describes what was observed. Sometimes this is called the observation \"name\".",
          "comment":
              "*All* code-value and, if present, component.code-component.value pairs need to be taken into account to correctly understand the meaning of the observation.",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Who and/or what the observation is about",
          "definition":
              "The patient, or group of patients, location, or device this observation is about and into whose record the observation is placed. If the actual focus of the observation is different from the subject (or a sample of, part, or region of the subject), the `focus` element or the `code` itself specifies the actual focus of the observation.",
          "comment":
              "One would expect this element to be a cardinality of 1..1. The only circumstance in which the subject can be missing is when the observation is made by a device that does not know the patient. In this case, the observation SHALL be matched to a patient through some context/channel matching technique, and at this point, the observation should be updated.",
          "mustSupport": true
        },
        {
          "name": "focus",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "What the observation is about, when it is not about the subject of record",
          "definition":
              "The actual focus of an observation when it is not the patient of record representing something or someone associated with the patient such as a spouse, parent, fetus, or donor. For example, fetus observations in a mother's record.  The focus of an observation could also be an existing condition,  an intervention, the subject's diet,  another observation of the subject,  or a body structure such as tumor or implanted device.   An example use case would be using the Observation resource to capture whether the mother is trained to change her child's tracheostomy tube. In this example, the child is the patient of record and the mother is the focus.",
          "comment":
              "Typically, an observation is made about the subject - a patient, or group of patients, location, or device - and the distinction between the subject and what is directly measured for an observation is specified in the observation code itself ( e.g., \"Blood Glucose\") and does not need to be represented separately using this element.  Use `specimen` if a reference to a specimen is required.  If a code is required instead of a resource use either  `bodysite` for bodysites or the standard extension [focusCode](http://hl7.org/fhir/R4/extension-observation-focuscode.html)."
        },
        {
          "name": "encounter",
          "elementType": "Reference",
          "description":
              "Healthcare event during which this observation is made",
          "definition":
