              "Identifier for the organization that is used to identify the organization across multiple disparate systems.",
          "comment": "NPI preferred.",
          "mustSupport": true
        },
        {
          "name": "ein",
          "elementType": "Identifier",
          "description":
              "There is not a general Tax Identifier Numer (TIN) OID. There is an SSN, a PTIN, and an ITIN, but no TIN generally. So the only slice specified here is EIN, if consumers determine a need for an SSN, submit a comment to that effect.",
          "definition":
              "Identifier for the organization that is used to identify the organization across multiple disparate systems.",
          "comment": "NPI preferred.",
          "mustSupport": true
        },
        {
          "name": "active",
          "elementType": "System.Boolean",
          "target": "%value.value",
          "description":
              "Whether the organization's record is still in active use",
          "definition":
              "Whether the organization's record is still in active use.",
          "comment":
              "This active flag is not intended to be used to mark an organization as temporarily closed or under construction. Instead the Location(s) within the Organization should have the suspended status. If further details of the reason for the suspension are required, then an extension on this element should be used.\\\\n\\\\nThis element is labeled as a modifier because it may be used to mark that the resource was created in error.",
          "mustSupport": true
        },
        {
          "name": "type",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description": "Used to categorize the organization",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Kind of organization",
          "definition": "The kind(s) of organization that this is.",
          "comment":
              "Organizations can be corporations, wards, sections, clinical teams, government departments, etc. Note that code is generally a classifier of the type of organization; in many applications, codes are used to identity a particular organization (say, ward) as opposed to another of the same type - these are identifiers, not codes\\\\n\\\\nWhen considering if multiple types are appropriate, you should evaluate if child organizations would be a more appropriate use of the concept, as different types likely are in different sub-areas of the organization. This is most likely to be used where type values have orthogonal values, such as a religious, academic and medical center.\\\\n\\\\nWe expect that some jurisdictions will profile this optionality to be a single cardinality.",
          "mustSupport": true
        },
        {
          "name": "name",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Name used for the organization",
          "definition": "A name associated with the organization.",
          "comment":
              "If the name of an organization changes, consider putting the old name in the alias column so that it can still be located through searches.",
          "mustSupport": true
        },
        {
          "name": "alias",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description":
              "A list of alternate names that the organization is known as, or was known as in the past",
          "definition":
              "A list of alternate names that the organization is known as, or was known as in the past.",
          "comment":
              "There are no dates associated with the alias/historic names, as this is not intended to track when names were used, but to assist in searching so that older names can still result in identifying the organization."
        },
        {
          "name": "telecom",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "A contact detail for the organization",
          "definition": "A contact detail for the organization.",
          "comment":
              "The use code 'home' is not to be used. Note that these contacts are not the contact details of people who are employed by or represent the organization, but official contacts for the organization itself.",
          "mustSupport": true
        },
        {
          "name": "address",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "An address for the organization",
          "definition": "An address for the organization.",
          "comment":
              "Organization may have multiple addresses with different uses or applicable periods. The use code 'home' is not to be used.",
          "mustSupport": true
        },
        {
          "name": "partOf",
          "elementType": "Reference",
          "description":
              "The organization of which this organization forms a part",
          "definition":
              "The organization of which this organization forms a part.",
          "mustSupport": false
        },
        {
          "name": "contact",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Contact for the organization for a certain purpose",
          "definition": "Contact for the organization for a certain purpose.",
          "comment":
              "Where multiple contacts for the same purpose are provided there is a standard extension that can be used to determine which one is the preferred contact to use."
        },
        {
          "name": "endpoint",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "Technical endpoints providing access to services operated for the organization",
          "definition":
              "Technical endpoints providing access to services operated for the organization.",
          "mustSupport": true
        }
      ]
    },
