      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-patient",
      "label": "QICore Patient",
      "element": [
        {
          "name": "race",
          "elementType": "USCoreRaceExtension",
          "target":
              "%parent.extension[url='http://hl7.org/fhir/us/core/StructureDefinition/us-core-race']",
          "description": "US Core Race Extension",
          "definition":
              "Concepts classifying the person into a named category of humans sharing common history, traits, geographical origin or nationality.  The race codes used to represent these concepts are based upon the [CDC Race and Ethnicity Code Set Version 1.0](http://www.cdc.gov/phin/resources/vocabulary/index.html) which includes over 900 concepts for representing race and ethnicity of which 921 reference race.  The race concepts are grouped by and pre-mapped to the 5 OMB race categories:\\\\n\\\\n   - American Indian or Alaska Native\\\\n   - Asian\\\\n   - Black or African American\\\\n   - Native Hawaiian or Other Pacific Islander\\\\n   - White.",
          "mustSupport": false
        },
        {
          "name": "ethnicity",
          "elementType": "USCoreEthnicityExtension",
          "target":
              "%parent.extension[url='http://hl7.org/fhir/us/core/StructureDefinition/us-core-ethnicity']",
          "description": "US Core ethnicity Extension",
          "definition":
              "Concepts classifying the person into a named category of humans sharing common history, traits, geographical origin or nationality.  The ethnicity codes used to represent these concepts are based upon the [CDC ethnicity and Ethnicity Code Set Version 1.0](http://www.cdc.gov/phin/resources/vocabulary/index.html) which includes over 900 concepts for representing race and ethnicity of which 43 reference ethnicity.  The ethnicity concepts are grouped by and pre-mapped to the 2 OMB ethnicity categories: - Hispanic or Latino - Not Hispanic or Latino.",
          "mustSupport": false
        },
        {
          "name": "birthsex",
          "elementType": "USCoreBirthSexExtension",
          "target":
              "%parent.extension[url='http://hl7.org/fhir/us/core/StructureDefinition/us-core-birthsex'].value.value",
          "description": "Extension",
          "definition":
              "A code classifying the person's sex assigned at birth  as specified by the [Office of the National Coordinator for Health IT (ONC)](https://www.healthit.gov/newsroom/about-onc).",
          "comment":
              "The codes required are intended to present birth sex (i.e., the sex recorded on the patient’s birth certificate) and not gender identity or reassigned sex.",
          "mustSupport": false
        },
        {
          "name": "genderIdentity",
          "target":
              "%parent.extension[url='http://hl7.org/fhir/us/core/StructureDefinition/us-core-genderIdentity']",
          "description": "Extension",
          "definition": "An Extension",
          "mustSupport": false
        },
        {
          "name": "religion",
          "elementType": "religion",
          "target":
              "FHIRHelpers.ToConcept(%parent.extension[url='http://hl7.org/fhir/StructureDefinition/patient-religion'].value)",
          "description": "The patient's professed religious affiliations",
          "definition": "The patient's professed religious affiliations.",
          "mustSupport": false
        },
        {
          "name": "birthPlace",
          "elementType": "birthPlace",
          "target":
              "%parent.extension[url='http://hl7.org/fhir/StructureDefinition/patient-birthPlace']",
          "description": "Place of Birth for patient",
          "definition":
              "The registered place of birth of the patient. A sytem may use the address.text if they don't store the birthPlace address in discrete elements.",
          "mustSupport": false
        },
        {
          "name": "nationality",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target":
              "%parent.extension[url='http://hl7.org/fhir/StructureDefinition/patient-nationality']",
          "description": "Nationality",
          "definition": "The nationality of the patient.",
          "mustSupport": false
        },
        {
          "name": "cadavericDonor",
          "elementType": "cadavericDonor",
          "target":
              "%parent.extension[url='http://hl7.org/fhir/StructureDefinition/patient-cadavericDonor'].value.value",
          "description": "Post-mortem donor status",
          "definition":
              "Flag indicating whether the patient authorized the donation of body parts after death.",
          "comment": "Do as standard extension on Patient?",
          "mustSupport": false
        },
        {
          "name": "birthTime",
          "elementType": "birthTime",
          "target":
              "%parent.extension[url='http://hl7.org/fhir/StructureDefinition/patient-birthTime'].value.value",
          "description": "Time of day of birth",
          "definition":
              "The time of day that the Patient was born. This includes the date to ensure that the timezone information can be communicated effectively.",
          "mustSupport": true
        },
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "An identifier for this patient",
          "definition": "An identifier for this patient.",
          "mustSupport": true
        },
        {
          "name": "active",
          "elementType": "System.Boolean",
          "target": "%value.value",
          "description": "Whether this patient's record is in active use",
          "definition":
              "Whether this patient record is in active use. \\\\nMany systems use this property to mark as non-current patients, such as those that have not been seen for a period of time based on an organization's business rules.\\\\n\\\\nIt is often used to filter patient lists to exclude inactive patients\\\\n\\\\nDeceased patients may also be marked as inactive for the same reasons, but may be active for some time after death.",
          "comment":
              "If a record is inactive, and linked to an active record, then future patient/record updates should occur on the other patient."
        },
        {
          "name": "name",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "A name associated with the patient",
          "definition": "A name associated with the individual.",
          "comment":
              "A patient may have multiple names with different uses or applicable periods. For animals, the name is a \"HumanName\" in the sense that is assigned and used by humans and has the same patterns.",
          "mustSupport": true
        },
        {
          "name": "telecom",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "A contact detail for the individual",
          "definition":
              "A contact detail (e.g. a telephone number or an email address) by which the individual may be contacted.",
          "comment":
              "A Patient may have multiple ways to be contacted with different uses or applicable periods.  May need to have options for contacting the person urgently and also to help with identification. The address might not go directly to the individual, but may reach another party that is able to proxy for the patient (i.e. home phone, or pet owner's phone).",
          "mustSupport": true
        },
        {
          "name": "gender",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "System.String",
          "target": "%value.value",
          "description": "male | female | other | unknown",
          "definition":
              "Administrative Gender - the gender that the patient is considered to have for administration and record keeping purposes.",
          "comment":
              "The gender might not match the biological sex as determined by genetics or the individual's preferred identification. Note that for both humans and particularly animals, there are other legitimate possibilities than male and female, though the vast majority of systems and contexts only support male and female.  Systems providing decision support or enforcing business rules should ideally do this on the basis of Observations dealing with the specific sex or gender aspect of interest (anatomical, chromosomal, social, etc.)  However, because these observations are infrequently recorded, defaulting to the administrative gender is common practice.  Where such defaulting occurs, rule enforcement should allow for the variation between administrative and biological, chromosomal and other gender aspects.  For example, an alert about a hysterectomy on a male should be handled as a warning or overridable error, not a \"hard\" error.  See the Patient Gender and Sex section for additional information about communicating patient gender and sex.",
          "mustSupport": true
        },
        {
          "name": "birthDate",
          "elementType": "System.Date",
          "target": "%value.value",
          "description": "The date of birth for the individual",
          "definition": "The date of birth for the individual.",
          "comment":
              "At least an estimated year should be provided as a guess if the real DOB is unknown  There is a standard extension \"patient-birthTime\" available that should be used where Time is required (such as in maternity/infant care systems).",
          "mustSupport": true
        },
        {
          "name": "deceased",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Boolean",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Indicates if the individual is deceased or not",
          "definition": "Indicates if the individual is deceased or not.",
          "comment":
              "The \"Cause of death\" for a patient is typically captured as an Observation.",
          "mustSupport": true
        },
        {
          "name": "address",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "An address for the individual",
          "definition": "An address for the individual.",
          "comment":
              "Patient may have multiple addresses with different uses or applicable periods.",
          "mustSupport": true
        },
        {
          "name": "maritalStatus",
          "binding": {
            "name": "MaritalStatus",
            "description": "The domestic partnership status of a person.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Marital (civil) status of a patient",
          "definition":
              "This field contains a patient's most recent marital (civil) status."
        },
        {
          "name": "multipleBirth",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Boolean",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Integer",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Whether patient is part of a multiple birth",
          "definition":
              "Indicates whether the patient is part of a multiple (boolean) or indicates the actual birth order (integer).",
          "comment":
              "Where the valueInteger is provided, the number is the birth number in the sequence. E.g. The middle birth in triplets would be valueInteger=2 and the third born would have valueInteger=3 If a boolean value was provided for this triplets example, then all 3 patient records would have valueBoolean=true (the ordering is not indicated)."
        },
        {
          "name": "photo",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Image of the patient",
          "definition": "Image of the patient.",
          "comment":
              "Guidelines:\\\\n* Use id photos, not clinical photos.\\\\n* Limit dimensions to thumbnail.\\\\n* Keep byte count low to ease resource updates."
        },
        {
          "name": "contact",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "A contact party (e.g. guardian, partner, friend) for the patient",
          "definition":
              "A contact party (e.g. guardian, partner, friend) for the patient.",
          "comment":
              "Contact covers all kinds of contact parties: family members, business contacts, guardians, caregivers. Not applicable to register pedigree and family ties beyond use of having contact."
        },
        {
          "name": "communication",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "A language which may be used to communicate with the patient about his or her health",
          "definition":
              "A language which may be used to communicate with the patient about his or her health.",
          "comment":
              "If no language is specified, this *implies* that the default local language is spoken.  If you need to convey proficiency for multiple modes, then you need multiple Patient.Communication associations.   For animals, language is not a relevant field, and should be absent from the instance. If the Patient does not speak the default local language, then the Interpreter Required Standard can be used to explicitly declare that an interpreter is required.",
          "mustSupport": false
        },
        {
          "name": "generalPractitioner",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Patient's nominated primary care provider",
          "definition": "Patient's nominated care provider.",
          "comment":
              "This may be the primary care provider (in a GP context), or it may be a patient nominated care manager in a community/disability setting, or even organization that will provide people to perform the care provider roles.  It is not to be used to record Care Teams, these should be in a CareTeam resource that may be linked to the CarePlan or EpisodeOfCare resources.\\\\nMultiple GPs may be recorded against the patient for various reasons, such as a student that has his home GP listed along with the GP at university during the school semesters, or a \"fly-in/fly-out\" worker that has the onsite GP also included with his home GP to remain aware of medical issues.\\\\n\\\\nJurisdictions may decide that they can profile this down to 1 if desired, or 1 per type.",
          "mustSupport": false
        },
        {
          "name": "managingOrganization",
          "elementType": "Reference",
          "description":
              "Organization that is the custodian of the patient record",
          "definition":
              "Organization that is the custodian of the patient record.",
          "comment":
              "There is only one managing organization for a specific patient record. Other organizations will have their own Patient record, and may use the Link property to join the records together (or a Person resource which can include confidence ratings for the association).",
          "mustSupport": false
        },
        {
          "name": "link",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "Link to another patient resource that concerns the same actual person",
          "definition":
              "Link to another patient resource that concerns the same actual patient.",
          "comment":
              "There is no assumption that linked patient records have mutual links.",
          "mustSupport": false
        }
      ],
      "contextRelationship": [
        {"context": "Practitioner", "relatedKeyElement": "generalPractitioner"},
        {"context": "Patient", "relatedKeyElement": "other"},
        {"context": "RelatedPerson", "relatedKeyElement": "other"}
      ]
    },
