              "The date the occurrence of the procedure was first captured in the record regardless of Procedure.status (potentially after the occurrence of the event).",
          "mustSupport": true
        },
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "External Identifiers for this procedure",
          "definition":
              "Business identifiers assigned to this procedure by the performer or other systems which remain constant as the resource is updated and is propagated from server to server.",
          "comment":
              "This is a business identifier, not a resource identifier (see [discussion](http://hl7.org/fhir/R4/resource.html#identifiers)).  It is best practice for the identifier to only appear on a single resource instance, however business practices may occasionally dictate that multiple resource instances with the same identifier can exist - possibly even with different resource types.  For example, multiple Patient and Person resource instances might share the same social insurance number."
        },
        {
          "name": "instantiatesCanonical",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "Instantiates FHIR protocol or definition",
          "definition":
              "The URL pointing to a FHIR-defined protocol, guideline, order set or other definition that is adhered to in whole or in part by this Procedure."
        },
        {
          "name": "instantiatesUri",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "Instantiates external protocol or definition",
          "definition":
              "The URL pointing to an externally maintained protocol, guideline, order set or other definition that is adhered to in whole or in part by this Procedure.",
          "comment":
              "This might be an HTML page, PDF, etc. or could just be a non-resolvable URI identifier."
        },
        {
          "name": "basedOn",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "A request for this procedure",
          "definition":
              "A reference to a resource that contains details of the request for this procedure."
        },
        {
          "name": "partOf",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Part of referenced event",
          "definition":
              "A larger event of which this particular procedure is a component or step.",
          "comment":
              "The MedicationAdministration resource has a partOf reference to Procedure, but this is not a circular reference.   For example, the anesthesia MedicationAdministration is part of the surgical Procedure (MedicationAdministration.partOf = Procedure).  For example, the procedure to insert the IV port for an IV medication administration is part of the medication administration (Procedure.partOf = MedicationAdministration)."
        },
        {
          "name": "status",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "System.String",
          "target": "%value.value",
          "description":
              "preparation | in-progress | ​on-hold​ | stopped​ | completed | entered-in-error​ | unknown​",
          "definition":
              "A code specifying the state of the procedure. Generally, this will be the in-progress or completed state.",
          "comment":
              "The \"unknown\" code is not to be used to convey other statuses.  The \"unknown\" code should be used when one of the statuses applies, but the authoring system doesn't know the current state of the procedure.\\\\n\\\\nThis element is labeled as a modifier because the status contains codes that mark the resource as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "statusReason",
          "binding": {
            "name": "ProcedureNegationReason",
            "description":
                "A code that identifies the reason a procedure was not performed.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Reason for current status",
          "definition":
              "Captures the reason for the current state of the procedure.",
          "comment":
              "This is generally only used for \"exception\" statuses such as \"not-done\", \"suspended\" or \"aborted\". The reason for performing the event at all is captured in reasonCode, not here."
        },
        {
          "name": "category",
          "binding": {
            "name": "ProcedureCategory",
            "description":
                "A code that classifies a procedure for searching, sorting and display purposes.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Classification of the procedure",
          "definition":
              "A code that classifies the procedure for searching, sorting and display purposes (e.g. \"Surgical Procedure\")."
        },
        {
          "name": "code",
          "binding": {
            "name": null,
            "description": "Codes describing the type of  Procedure",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Identification of the procedure",
          "definition":
              "The specific procedure that is performed. Use text if the exact nature of the procedure cannot be coded (e.g. \"Laparoscopic Appendectomy\").",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Who the procedure was performed on",
          "definition":
              "The person, animal or group on which the procedure was performed.",
          "mustSupport": true
        },
        {
          "name": "encounter",
          "elementType": "Reference",
          "description": "Encounter created as part of",
          "definition":
              "The Encounter during which this Procedure was created or performed or to which the creation of this record is tightly associated.",
          "comment":
              "This will typically be the encounter the event occurred within, but some activities may be initiated prior to or after the official completion of an encounter but still be tied to the context of the encounter.",
          "mustSupport": true
        },
        {
          "name": "performed",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}String",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "When the procedure was performed",
          "definition":
              "Estimated or actual date, date-time, period, or age when the procedure was performed.  Allows a period to support complex procedures that span more than one date, and also allows for the length of the procedure to be captured.",
          "comment":
              "Age is generally used when the patient reports an age at which the procedure was performed. Range is generally used when the patient reports an age range when the procedure was performed, such as sometime between 20-25 years old.  dateTime supports a range of precision due to some procedures being reported as past procedures that might not have millisecond precision while other procedures performed and documented during the encounter might have more precise UTC timestamps with timezone.",
          "mustSupport": true
        },
        {
          "name": "recorder",
          "elementType": "Reference",
          "description": "Who recorded the procedure",
          "definition":
              "Individual who recorded the record and takes responsibility for its content."
        },
        {
          "name": "asserter",
          "elementType": "Reference",
          "description": "Person who asserts this procedure",
          "definition": "Individual who is making the procedure statement."
        },
        {
          "name": "performer",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "The people who performed the procedure",
          "definition": "Limited to \"real\" people rather than equipment.",
          "mustSupport": true
        },
        {
          "name": "location",
          "elementType": "Reference",
          "description": "Where the procedure happened",
          "definition":
