              "A larger event of which this particular procedure is a component or step.",
          "comment":
              "The MedicationAdministration resource has a partOf reference to Procedure, but this is not a circular reference.   For example, the anesthesia MedicationAdministration is part of the surgical Procedure (MedicationAdministration.partOf = Procedure).  For example, the procedure to insert the IV port for an IV medication administration is part of the medication administration (Procedure.partOf = MedicationAdministration)."
        },
        {
          "name": "status",
          "binding": {
            "name": null,
            "description": null,
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "System.String",
          "target": "%value.value",
          "description":
              "preparation | in-progress | not-done | on-hold | stopped | completed | entered-in-error | unknown",
          "definition":
              "A code specifying the state of the procedure. Generally, this will be the in-progress or completed state.",
          "comment":
              "The \"unknown\" code is not to be used to convey other statuses.  The \"unknown\" code should be used when one of the statuses applies, but the authoring system doesn't know the current state of the procedure.\\\\n\\\\nThis element is labeled as a modifier because the status contains codes that mark the resource as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "statusReason",
          "binding": {
            "name": null,
            "description": "The reason the procedure was not done",
            "strength": "Extensible",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Reason for current status",
          "definition":
              "Captures the reason for the current state of the procedure.",
          "comment":
              "This is generally only used for \"exception\" statuses such as \"not-done\", \"suspended\" or \"aborted\". The reason for performing the event at all is captured in reasonCode, not here.",
          "mustSupport": true
        },
        {
          "name": "category",
          "binding": {
            "name": "ProcedureCategory",
            "description":
                "A code that classifies a procedure for searching, sorting and display purposes.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Classification of the procedure",
          "definition":
              "A code that classifies the procedure for searching, sorting and display purposes (e.g. \"Surgical Procedure\")."
        },
        {
          "name": "code",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{http://hl7.org/fhir}ValueSet",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "binding": {
            "name": null,
            "description": "Codes describing the type of  Procedure",
            "strength": "Extensible",
            "valueSet": ""
          },
          "target":
              "System.Concept:FHIRHelpers.ToConcept(%value);System.ValueSet:FHIRHelpers.ToValueSet(%parent.code.extension[url='http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-notDoneValueSet'].value.value)",
          "description": "Identification of the procedure",
          "definition":
              "The specific procedure that is performed. Use text if the exact nature of the procedure cannot be coded (e.g. \"Laparoscopic Appendectomy\").",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Who the procedure was performed on",
          "definition":
              "The person, animal or group on which the procedure was performed.",
          "mustSupport": true
        },
        {
          "name": "encounter",
          "elementType": "Reference",
          "description": "Encounter created as part of",
          "definition":
              "The Encounter during which this Procedure was created or performed or to which the creation of this record is tightly associated.",
          "comment":
              "This will typically be the encounter the event occurred within, but some activities may be initiated prior to or after the official completion of an encounter but still be tied to the context of the encounter.",
          "mustSupport": true
        },
        {
          "name": "performed",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}String",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "When the procedure was performed",
          "definition":
              "Estimated or actual date, date-time, period, or age when the procedure was performed.  Allows a period to support complex procedures that span more than one date, and also allows for the length of the procedure to be captured.",
          "comment":
              "Age is generally used when the patient reports an age at which the procedure was performed. Range is generally used when the patient reports an age range when the procedure was performed, such as sometime between 20-25 years old.  dateTime supports a range of precision due to some procedures being reported as past procedures that might not have millisecond precision while other procedures performed and documented during the encounter might have more precise UTC timestamps with timezone.",
          "mustSupport": true
        },
        {
          "name": "recorder",
          "elementType": "Reference",
          "description": "Who recorded the procedure",
          "definition":
              "Individual who recorded the record and takes responsibility for its content."
        },
        {
          "name": "asserter",
          "elementType": "Reference",
          "description": "Person who asserts this procedure",
          "definition": "Individual who is making the procedure statement."
        },
        {
          "name": "performer",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "The people who performed the procedure",
          "definition": "Limited to \"real\" people rather than equipment."
        },
        {
          "name": "location",
          "elementType": "Reference",
          "description": "Where the procedure happened",
          "definition":
              "The location where the procedure actually happened.  E.g. a newborn at home, a tracheostomy at a restaurant."
        },
        {
          "name": "reasonCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ProcedureReason",
            "description":
                "A code that identifies the reason a procedure is  required.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Coded reason procedure performed",
          "definition":
              "The coded reason why the procedure was performed. This may be a coded entity of some type, or may simply be present as text.",
          "comment":
              "Use Procedure.reasonCode when a code sufficiently describes the reason.  Use Procedure.reasonReference when referencing a resource, which allows more information to be conveyed, such as onset date. Procedure.reasonCode and Procedure.reasonReference are not meant to be duplicative.  For a single reason, either Procedure.reasonCode or Procedure.reasonReference can be used.  Procedure.reasonCode may be a summary code, or Procedure.reasonReference may be used to reference a very precise definition of the reason using Condition | Observation | Procedure | DiagnosticReport | DocumentReference.  Both Procedure.reasonCode and Procedure.reasonReference can be used if they are describing different reasons for the procedure."
        },
        {
          "name": "reasonReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "The justification that the procedure was performed",
          "definition": "The justification of why the procedure was performed.",
          "comment":
              "It is possible for a procedure to be a reason (such as C-Section) for another procedure (such as an epidural). Other examples include endoscopy for dilatation and biopsy (a combination of diagnostic and therapeutic use). \\\\nUse Procedure.reasonCode when a code sufficiently describes the reason.  Use Procedure.reasonReference when referencing a resource, which allows more information to be conveyed, such as onset date. Procedure.reasonCode and Procedure.reasonReference are not meant to be duplicative.  For a single reason, either Procedure.reasonCode or Procedure.reasonReference can be used.  Procedure.reasonCode may be a summary code, or Procedure.reasonReference may be used to reference a very precise definition of the reason using Condition | Observation | Procedure | DiagnosticReport | DocumentReference.  Both Procedure.reasonCode and Procedure.reasonReference can be used if they are describing different reasons for the procedure."
        },
        {
          "name": "bodySite",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "BodySite",
            "description":
                "Codes describing anatomical locations. May include laterality.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Target body sites",
          "definition":
              "Detailed and structured anatomical location information. Multiple locations are allowed - e.g. multiple punch biopsies of a lesion.",
          "comment":
              "If the use case requires attributes from the BodySite resource (e.g. to identify and track separately) then use the standard extension [procedure-targetbodystructure](http://hl7.org/fhir/R4/extension-procedure-targetbodystructure.html)."
        },
        {
          "name": "outcome",
          "binding": {
            "name": "ProcedureOutcome",
            "description":
                "An outcome of a procedure - whether it was resolved or otherwise.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "The result of procedure",
          "definition":
              "The outcome of the procedure - did it resolve the reasons for the procedure being performed?",
          "comment":
              "If outcome contains narrative text only, it can be captured using the CodeableConcept.text."
        },
        {
          "name": "report",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Any report resulting from the procedure",
          "definition":
              "This could be a histology result, pathology report, surgical report, etc.",
          "comment":
              "There could potentially be multiple reports - e.g. if this was a procedure which took multiple biopsies resulting in a number of anatomical pathology reports."
        },
        {
          "name": "complication",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ProcedureComplication",
            "description":
                "Codes describing complications that resulted from a procedure.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Complication following the procedure",
          "definition":
              "Any complications that occurred during the procedure, or in the immediate post-performance period. These are generally tracked separately from the notes, which will typically describe the procedure itself rather than any 'post procedure' issues.",
          "comment":
              "If complications are only expressed by the narrative text, they can be captured using the CodeableConcept.text."
        },
        {
          "name": "complicationDetail",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "A condition that is a result of the procedure",
          "definition":
              "Any complications that occurred during the procedure, or in the immediate post-performance period."
        },
        {
          "name": "followUp",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ProcedureFollowUp",
            "description":
                "Specific follow up required for a procedure e.g. removal of sutures.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Instructions for follow up",
          "definition":
              "If the procedure required specific follow up - e.g. removal of sutures. The follow up may be represented as a simple note or could potentially be more complex, in which case the CarePlan resource can be used."
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Additional information about the procedure",
          "definition": "Any other notes and comments about the procedure."
        },
        {
          "name": "focalDevice",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Manipulated, implanted, or removed device",
          "definition":
              "A device that is implanted, removed or otherwise manipulated (calibration, battery replacement, fitting a prosthesis, attaching a wound-vac, etc.) as a focal portion of the Procedure."
        },
        {
          "name": "usedReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Items used during procedure",
          "definition":
              "Identifies medications, devices and any other substance used as part of the procedure.",
          "comment":
              "For devices actually implanted or removed, use Procedure.device."
        },
        {
          "name": "usedCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ProcedureUsed",
            "description": "Codes describing items used during a procedure.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Coded items used during the procedure",
          "definition":
              "Identifies coded items that were used as part of the procedure.",
          "comment":
              "For devices actually implanted or removed, use Procedure.device."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "PublicationStatus",
      "baseType": "System.String",
      "retrievable": false
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "QuantityComparator",
      "baseType": "System.String",
      "retrievable": false
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Questionnaire",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier": "http://hl7.org/fhir/StructureDefinition/Questionnaire",
      "label": "Questionnaire",
      "primaryCodePath": "name",
      "element": [
        {
          "name": "url",
          "elementType": "System.String",
          "target": "%value.value",
          "description":
              "Canonical identifier for this questionnaire, represented as a URI (globally unique)",
          "definition":
              "An absolute URI that is used to identify this questionnaire when it is referenced in a specification, model, design or an instance; also called its canonical identifier. This SHOULD be globally unique and SHOULD be a literal address at which at which an authoritative instance of this questionnaire is (or will be) published. This URL can be the target of a canonical reference. It SHALL remain the same when the questionnaire is stored on different servers.",
          "comment":
              "The name of the referenced questionnaire can be conveyed using the http://hl7.org/fhir/StructureDefinition/display extension."
        },
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Additional identifier for the questionnaire",
          "definition":
              "A formal identifier that is used to identify this questionnaire when it is represented in other formats, or referenced in a specification, model, design or an instance.",
          "comment":
              "Typically, this is used for identifiers that can go in an HL7 V3 II (instance identifier) data type, and can then identify this questionnaire outside of FHIR, where it is not possible to use the logical URI."
        },
        {
          "name": "version",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Business version of the questionnaire",
          "definition":
              "The identifier that is used to identify this version of the questionnaire when it is referenced in a specification, model, design or instance. This is an arbitrary value managed by the questionnaire author and is not expected to be globally unique. For example, it might be a timestamp (e.g. yyyymmdd) if a managed version is not available. There is also no expectation that versions can be placed in a lexicographical sequence.",
          "comment":
              "There may be different questionnaire instances that have the same identifier but different versions.  The version can be appended to the url in a reference to allow a reference to a particular business version of the questionnaire with the format [url]|[version]."
        },
        {
          "name": "name",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Name for this questionnaire (computer friendly)",
          "definition":
              "A natural language name identifying the questionnaire. This name should be usable as an identifier for the module by machine processing applications such as code generation.",
          "comment":
              "The name is not expected to be globally unique. The name should be a simple alphanumeric type name to ensure that it is machine-processing friendly."
        },
        {
          "name": "title",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Name for this questionnaire (human friendly)",
          "definition":
              "A short, descriptive, user-friendly title for the questionnaire.",
          "comment":
              "This name does not need to be machine-processing friendly and may contain punctuation, white-space, etc."
        },
        {
          "name": "derivedFrom",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "Instantiates protocol or definition",
          "definition":
              "The URL of a Questionnaire that this Questionnaire is based on."
        },
        {
          "name": "status",
          "binding": {
            "name": "PublicationStatus",
            "description": "The lifecycle status of an artifact.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "PublicationStatus",
          "target": "%value.value",
          "description": "draft | active | retired | unknown",
          "definition":
              "The status of this questionnaire. Enables tracking the life-cycle of the content.",
          "comment":
              "Allows filtering of questionnaires that are appropriate for use versus not."
        },
        {
          "name": "experimental",
          "elementType": "System.Boolean",
          "target": "%value.value",
          "description": "For testing purposes, not real usage",
          "definition":
              "A Boolean value to indicate that this questionnaire is authored for testing purposes (or education/evaluation/marketing) and is not intended to be used for genuine usage.",
          "comment":
              "Allows filtering of questionnaires that are appropriate for use versus not."
        },
        {
          "name": "subjectType",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ResourceType",
            "description":
                "One of the resource types defined as part of this version of FHIR.",
            "strength": "Required",
            "valueSet": ""
          },
          "target": "%value.value",
          "description":
              "Resource that can be subject of QuestionnaireResponse",
          "definition":
              "The types of subjects that can be the subject of responses created for the questionnaire.",
          "comment": "If none are specified, then the subject is unlimited."
        },
        {
          "name": "date",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "Date last changed",
          "definition":
              "The date  (and optionally time) when the questionnaire was published. The date must change when the business version changes and it must change if the status code changes. In addition, it should change when the substantive content of the questionnaire changes.",
          "comment":
              "Note that this is not the same as the resource last-modified-date, since the resource may be a secondary representation of the questionnaire. Additional specific dates may be added as extensions or be found by consulting Provenances associated with past versions of the resource."
        },
        {
          "name": "publisher",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Name of the publisher (organization or individual)",
          "definition":
              "The name of the organization or individual that published the questionnaire.",
          "comment":
              "Usually an organization but may be an individual. The publisher (or steward) of the questionnaire is the organization or individual primarily responsible for the maintenance and upkeep of the questionnaire. This is not necessarily the same individual or organization that developed and initially authored the content. The publisher is the primary point of contact for questions or issues with the questionnaire. This item SHOULD be populated unless the information is available from context."
        },
        {
          "name": "contact",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Contact details for the publisher",
          "definition":
              "Contact details to assist a user in finding and communicating with the publisher.",
          "comment":
              "May be a web site, an email address, a telephone number, etc."
        },
        {
          "name": "description",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Natural language description of the questionnaire",
          "definition":
              "A free text natural language description of the questionnaire from a consumer's perspective.",
          "comment":
              "This description can be used to capture details such as why the questionnaire was built, comments about misuse, instructions for clinical use and interpretation, literature references, examples from the paper world, etc. It is not a rendering of the questionnaire as conveyed in the 'text' field of the resource itself. This item SHOULD be populated unless the information is available from context (e.g. the language of the questionnaire is presumed to be the predominant language in the place the questionnaire was created)."
        },
        {
          "name": "useContext",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "The context that the content is intended to support",
          "definition":
              "The content was developed with a focus and intent of supporting the contexts that are listed. These contexts may be general categories (gender, age, ...) or may be references to specific programs (insurance plans, studies, ...) and may be used to assist with indexing and searching for appropriate questionnaire instances.",
          "comment":
              "When multiple useContexts are specified, there is no expectation that all or any of the contexts apply."
        },
        {
          "name": "jurisdiction",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "Jurisdiction",
            "description":
                "Countries and regions within which this artifact is targeted for use.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description":
              "Intended jurisdiction for questionnaire (if applicable)",
          "definition":
              "A legal or geographic region in which the questionnaire is intended to be used.",
          "comment":
              "It may be possible for the questionnaire to be used in jurisdictions other than those for which it was originally designed or intended."
        },
        {
          "name": "purpose",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Why this questionnaire is defined",
          "definition":
              "Explanation of why this questionnaire is needed and why it has been designed as it has.",
          "comment":
              "This element does not describe the usage of the questionnaire. Instead, it provides traceability of ''why'' the resource is either needed or ''why'' it is defined as it is.  This may be used to point to source materials or specifications that drove the structure of this questionnaire."
        },
        {
          "name": "copyright",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Use and/or publishing restrictions",
          "definition":
              "A copyright statement relating to the questionnaire and/or its contents. Copyright statements are generally legal restrictions on the use and publishing of the questionnaire."
        },
        {
          "name": "approvalDate",
          "elementType": "System.Date",
          "target": "%value.value",
          "description": "When the questionnaire was approved by publisher",
          "definition":
              "The date on which the resource content was approved by the publisher. Approval happens once when the content is officially approved for usage.",
          "comment":
              "The 'date' element may be more recent than the approval date because of minor changes or editorial corrections."
        },
        {
          "name": "lastReviewDate",
          "elementType": "System.Date",
          "target": "%value.value",
          "description": "When the questionnaire was last reviewed",
          "definition":
              "The date on which the resource content was last reviewed. Review happens periodically after approval but does not change the original approval date.",
          "comment":
              "If specified, this date follows the original approval date."
        },
        {
          "name": "effectivePeriod",
          "elementTypeSpecifier": {"type": "IntervalTypeSpecifier"},
          "target": "FHIRHelpers.ToInterval(%value)",
          "description": "When the questionnaire is expected to be used",
          "definition":
              "The period during which the questionnaire content was or is planned to be in active use.",
          "comment":
              "The effective period for a questionnaire  determines when the content is applicable for usage and is independent of publication and review dates. For example, a measure intended to be used for the year 2016 might be published in 2015."
        },
        {
          "name": "code",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "QuestionnaireConcept",
            "description":
                "Codes for questionnaires, groups and individual questions.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToCode(%value)",
          "description": "Concept that represents the overall questionnaire",
          "definition":
              "An identifier for this question or group of questions in a particular terminology such as LOINC."
        },
        {
          "name": "item",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Questions and sections within the Questionnaire",
          "definition":
              "A particular question, question grouping or display text that is part of the questionnaire.",
          "comment":
              "The content of the questionnaire is constructed from an ordered, hierarchical collection of items."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Questionnaire.Item",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "linkId",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Unique id for item in questionnaire",
          "definition":
              "An identifier that is unique within the Questionnaire allowing linkage to the equivalent item in a QuestionnaireResponse resource.",
          "comment":
              "This ''can'' be a meaningful identifier (e.g. a LOINC code) but is not intended to have any meaning.  GUIDs or sequential numbers are appropriate here."
        },
        {
          "name": "definition",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "ElementDefinition - details for the item",
          "definition":
              "This element is a URI that refers to an [ElementDefinition](elementdefinition.html) that provides information about this item, including information that might otherwise be included in the instance of the Questionnaire resource. A detailed description of the construction of the URI is shown in Comments, below. If this element is present then the following element values MAY be derived from the Element Definition if the corresponding elements of this Questionnaire resource instance have no value:\\\\n\\\\n* code (ElementDefinition.code) \\\\n* type (ElementDefinition.type) \\\\n* required (ElementDefinition.min) \\\\n* repeats (ElementDefinition.max) \\\\n* maxLength (ElementDefinition.maxLength) \\\\n* answerValueSet (ElementDefinition.binding)\\\\n* options (ElementDefinition.binding).",
          "comment":
              "The uri refers to an ElementDefinition in a [StructureDefinition](structuredefinition.html#) and always starts with the [canonical URL](references.html#canonical) for the target resource. When referring to a StructureDefinition, a fragment identifier is used to specify the element definition by its id [Element.id](element-definitions.html#Element.id). E.g. http://hl7.org/fhir/StructureDefinition/Observation#Observation.value[x]. In the absence of a fragment identifier, the first/root element definition in the target is the matching element definition."
        },
        {
          "name": "code",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "QuestionnaireConcept",
            "description":
                "Codes for questionnaires, groups and individual questions.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToCode(%value)",
          "description": "Corresponding concept for this item in a terminology",
          "definition":
              "A terminology code that corresponds to this group or question (e.g. a code from LOINC, which defines many questions and answers).",
          "comment":
              "The value may come from the ElementDefinition referred to by .definition."
        },
        {
          "name": "prefix",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "E.g. \"1(a)\", \"2.5.3\"",
          "definition":
              "A short label for a particular group, question or set of display text within the questionnaire used for reference by the individual completing the questionnaire.",
          "comment":
              "These are generally unique within a questionnaire, though this is not guaranteed. Some questionnaires may have multiple questions with the same label with logic to control which gets exposed.  Typically, these won't be used for \"display\" items, though such use is not prohibited.  Systems SHOULD NOT generate their own prefixes if prefixes are defined for any items within a Questionnaire."
        },
        {
          "name": "text",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Primary text for the item",
          "definition":
              "The name of a section, the text of a question or text content for a display item.",
          "comment":
              "When using this element to represent the name of a section, use group type item and also make sure to limit the text element to a short string suitable for display as a section heading.  Group item instructions should be included as a display type item within the group."
        },
        {
          "name": "type",
          "binding": {
            "name": "QuestionnaireItemType",
            "description":
                "Distinguishes groups from questions and display text and indicates data type for questions.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "QuestionnaireItemType",
          "target": "%value.value",
          "description":
              "group | display | boolean | decimal | integer | date | dateTime +",
          "definition":
              "The type of questionnaire item this is - whether text for display, a grouping of other items or a particular type of data to be captured (string, integer, coded choice, etc.).",
          "comment":
              "Additional constraints on the type of answer can be conveyed by extensions. The value may come from the ElementDefinition referred to by .definition."
        },
        {
          "name": "enableWhen",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Only allow data when",
          "definition":
              "A constraint indicating that this item should only be enabled (displayed/allow answers to be captured) when the specified condition is true.",
          "comment":
              "If multiple repetitions of this extension are present, the item should be enabled when the condition for *any* of the repetitions is true.  I.e. treat \"enableWhen\"s as being joined by an \"or\" clause.  This element is a modifier because if enableWhen is present for an item, \"required\" is ignored unless one of the enableWhen conditions is met. When an item is disabled, all of its descendants are disabled, regardless of what their own enableWhen logic might evaluate to."
        },
        {
          "name": "enableBehavior",
          "binding": {
            "name": "EnableWhenBehavior",
            "description":
                "Controls how multiple enableWhen values are interpreted -  whether all or any must be true.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "EnableWhenBehavior",
          "target": "%value.value",
          "description": "all | any",
          "definition":
              "Controls how multiple enableWhen values are interpreted -  whether all or any must be true.",
          "comment":
              "This element must be specified if more than one enableWhen value is provided."
        },
        {
          "name": "required",
          "elementType": "System.Boolean",
          "target": "%value.value",
          "description": "Whether the item must be included in data results",
          "definition":
              "An indication, if true, that the item must be present in a \"completed\" QuestionnaireResponse.  If false, the item may be skipped when answering the questionnaire.",
          "comment":
              "Questionnaire.item.required only has meaning for elements that are conditionally enabled with enableWhen if the condition evaluates to true.  If an item that contains other items is marked as required, that does not automatically make the contained elements required (though required groups must contain at least one child element). The value may come from the ElementDefinition referred to by .definition."
        },
        {
          "name": "repeats",
          "elementType": "System.Boolean",
          "target": "%value.value",
          "description": "Whether the item may repeat",
          "definition":
              "An indication, if true, that the item may occur multiple times in the response, collecting multiple answers for questions or multiple sets of answers for groups.",
          "comment":
              "If a question is marked as repeats=true, then multiple answers can be provided for the question in the corresponding QuestionnaireResponse.  When rendering the questionnaire, it is up to the rendering software whether to render the question text for each answer repetition (i.e. \"repeat the question\") or to simply allow entry/selection of multiple answers for the question (repeat the answers).  Which is most appropriate visually may depend on the type of answer as well as whether there are nested items.\\\\n\\\\nThe resulting QuestionnaireResponse will be populated the same way regardless of rendering - one 'question' item with multiple answer values.\\\\n\\\\n The value may come from the ElementDefinition referred to by .definition."
        },
        {
          "name": "readOnly",
          "elementType": "System.Boolean",
          "target": "%value.value",
          "description": "Don't allow human editing",
          "definition":
              "An indication, when true, that the value cannot be changed by a human respondent to the Questionnaire.",
          "comment":
              "The value of readOnly elements can be established by asserting  extensions for defaultValues, linkages that support pre-population and/or extensions that support calculation based on other answers."
        },
        {
          "name": "maxLength",
          "elementType": "System.Integer",
          "target": "%value.value",
          "description": "No more than this many characters",
          "definition":
              "The maximum number of characters that are permitted in the answer to be considered a \"valid\" QuestionnaireResponse.",
          "comment":
              "For base64binary, reflects the number of characters representing the encoded data, not the number of bytes of the binary data. The value may come from the ElementDefinition referred to by .definition."
        },
        {
          "name": "answerValueSet",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Valueset containing permitted answers",
          "definition":
              "A reference to a value set containing a list of codes representing permitted answers for a \"choice\" or \"open-choice\" question.",
          "comment":
              "LOINC defines many useful value sets for questionnaire responses. See [LOINC Answer Lists](loinc.html#alist). The value may come from the ElementDefinition referred to by .definition."
        },
        {
          "name": "answerOption",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Permitted answer",
          "definition":
              "One of the permitted answers for a \"choice\" or \"open-choice\" question.",
          "comment":
              "This element can be used when the value set machinery of answerValueSet is deemed too cumbersome or when there's a need to capture possible answers that are not codes."
        },
        {
          "name": "initial",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Initial value(s) when item is first rendered",
          "definition":
              "One or more values that should be pre-populated in the answer when initially rendering the questionnaire for user input.",
          "comment":
              "The user is allowed to change the value and override the default (unless marked as read-only). If the user doesn't change the value, then this initial value will be persisted when the QuestionnaireResponse is initially created.  Note that initial values can influence results.  The data type of initial[x] must agree with the item.type, and only repeating items can have more then one initial value."
        },
        {
          "name": "item",
          "elementTypeSpecifier": {
            "type": "ListTypeSpecifier",
            "elementTypeSpecifier": {
              "name": "Questionnaire.Item",
              "type": "NamedTypeSpecifier"
            }
          },
          "description": "Nested questionnaire items",
          "definition":
              "Text, questions and other groups to be nested beneath a question or group.",
          "comment":
              "There is no specified limit to the depth of nesting.  However, Questionnaire authors are encouraged to consider the impact on the user and user interface of overly deep nesting."
        }
      ]
    },
