    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "QuestionnaireResponse",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-questionnaireresponse",
      "label": "QICore QuestionnaireResponse",
      "element": [
        {"name": "meta", "elementType": "QuestionnaireResponse.Meta"},
        {
          "name": "signature",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target":
              "%parent.extension[url='http://hl7.org/fhir/StructureDefinition/questionnaireresponse-signature']",
          "description": "A signature attesting to the content",
          "definition":
              "Represents a wet or electronic signature for either the form overall or for the question or item it's associated with.",
          "mustSupport": false
        },
        {
          "name": "completionMode",
          "elementType": "completionMode",
          "target":
              "FHIRHelpers.ToConcept(%parent.extension[url='http://hl7.org/fhir/StructureDefinition/questionnaireresponse-completionMode'].value)",
          "description": "E.g. Verbal, written, electronic",
          "definition":
              "Indicates how the individual completing the QuestionnaireResponse provided their responses.",
          "mustSupport": false
        },
        {
          "name": "identifier",
          "elementType": "Identifier",
          "description": "Unique id for this set of answers",
          "definition":
              "A business identifier assigned to a particular completed (or partially completed) questionnaire.",
          "mustSupport": true
        },
        {
          "name": "basedOn",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Request fulfilled by this QuestionnaireResponse",
          "definition":
              "The order, proposal or plan that is fulfilled in whole or in part by this QuestionnaireResponse.  For example, a ServiceRequest seeking an intake assessment or a decision support recommendation to assess for post-partum depression.",
          "mustSupport": false
        },
        {
          "name": "partOf",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Part of this action",
          "definition":
              "A procedure or observation that this questionnaire was performed as part of the execution of.  For example, the surgery a checklist was executed as part of.",
          "comment":
              "Composition of questionnaire responses will be handled by the parent questionnaire having answers that reference the child questionnaire.  For relationships to referrals, and other types of requests, use basedOn.",
          "mustSupport": false
        },
        {
          "name": "questionnaire",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Form being answered",
          "definition":
              "The Questionnaire that defines and organizes the questions for which answers are being provided.",
          "comment":
              "For SDC, this SHALL be the version-specific URL of the form as hosted on the Form Manager.",
          "mustSupport": true
        },
        {
          "name": "status",
          "binding": {
            "name": "QuestionnaireResponseStatus",
            "description": "Lifecycle status of the questionnaire response.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "QuestionnaireResponseStatus",
          "target": "%value.value",
          "description":
              "in-progress | completed | amended | entered-in-error | stopped",
          "definition":
              "The position of the questionnaire response within its overall lifecycle.",
          "comment":
              "This element is labeled as a modifier because the status contains codes that mark the resource as not currently valid.",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "The subject of the questions",
          "definition":
              "The subject of the questionnaire response.  This could be a patient, organization, practitioner, device, etc.  This is who/what the answers apply to, but is not necessarily the source of information.",
          "comment": "-",
          "mustSupport": true
        },
        {
          "name": "encounter",
          "elementType": "Reference",
          "description": "Encounter created as part of",
          "definition":
              "The Encounter during which this questionnaire response was created or to which the creation of this record is tightly associated.",
          "comment":
              "This will typically be the encounter the event occurred within, but some activities may be initiated prior to or after the official completion of an encounter but still be tied to the context of the encounter. A questionnaire that was initiated during an encounter but not fully completed during the encounter would still generally be associated with the encounter.",
          "mustSupport": true
        },
        {
          "name": "authored",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "Date the answers were gathered",
          "definition":
              "Identifies when this version of the answer set was created.  Changes whenever the answers are updated.",
          "comment":
              "May be different from the lastUpdateTime of the resource itself, because that reflects when the data was known to the server, not when the data was captured.\\\\n\\\\nThis element is optional to allow for systems that might not know the value, however it SHOULD be populated if possible.",
          "mustSupport": true
        },
        {
          "name": "author",
          "elementType": "Reference",
          "description": "Person who received and recorded the answers",
          "definition":
              "Person who received the answers to the questions in the QuestionnaireResponse and recorded them in the system.",
          "comment":
              "Mapping a subject's answers to multiple choice options and determining what to put in the textual answer is a matter of interpretation.  Authoring by device would indicate that some portion of the questionnaire had been auto-populated.",
          "mustSupport": true
        },
        {
          "name": "source",
          "elementType": "Reference",
          "description": "The person who answered the questions",
          "definition":
              "The person who answered the questions about the subject.",
          "comment":
              "If not specified, no inference can be made about who provided the data.",
          "mustSupport": true
        },
        {
          "name": "item",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Groups and questions",
          "definition":
              "A group or question item from the original questionnaire for which answers are provided.",
          "comment":
              "Groups cannot have answers and therefore must nest directly within item. When dealing with questions, nesting must occur within each answer because some questions may have multiple answers (and the nesting occurs for each answer).",
          "mustSupport": true
        }
      ],
      "contextRelationship": [
        {"context": "Practitioner", "relatedKeyElement": "author"},
        {"context": "Practitioner", "relatedKeyElement": "source"},
        {"context": "Patient", "relatedKeyElement": "subject"},
        {"context": "Patient", "relatedKeyElement": "author"},
        {"context": "Encounter", "relatedKeyElement": "encounter"},
        {"context": "Device", "relatedKeyElement": "author"},
        {"context": "RelatedPerson", "relatedKeyElement": "author"},
        {"context": "RelatedPerson", "relatedKeyElement": "source"}
      ]
    },
