              "The individual who initiated the request and has responsibility for its activation.",
          "comment":
              "This not the dispatcher, but rather who is the authorizer.  This element is not intended to handle delegation which would generally be managed through the Provenance resource.",
          "mustSupport": true
        },
        {
          "name": "performerType",
          "binding": {
            "name": "ServiceRequestParticipantRole",
            "description":
                "Indicates specific responsibility of an individual within the care team, such as \"Primary physician\", \"Team coordinator\", \"Caregiver\", etc.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Performer role",
          "definition":
              "Desired type of performer for doing the requested service.",
          "comment":
              "This is a  role, not  a participation type.  In other words, does not describe the task but describes the capacity.  For example, “compounding pharmacy”, “psychiatrist” or “internal referral”."
        },
        {
          "name": "performer",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Requested performer",
          "definition":
              "The desired performer for doing the requested service.  For example, the surgeon, dermatopathologist, endoscopist, etc.",
          "comment":
              "If multiple performers are present, it is interpreted as a list of *alternative* performers without any preference regardless of order.  If order of preference is needed use the [request-performerOrder extension](http://hl7.org/fhir/R4/extension-request-performerorder.html).  Use CareTeam to represent a group of performers (for example, Practitioner A *and* Practitioner B).",
