          "name": "bodySite",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description":
                "Anatomic location where the procedure should be performed. This is the target site",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Location on Body",
          "definition":
              "Anatomic location where the procedure should be performed. This is the target site.",
          "comment":
