                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Ratio",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Service amount",
          "definition":
              r"""An amount of service being requested which can be a quantity ( for example $1,500 home modification), a ratio ( for example, 20 half day visits per month), or a range (2.0 to 1.8 Gy per fraction)."""
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description": "Individual or Entity the service is ordered for",
          "definition":
              "On whom or what the service is to be performed. This is usually a human patient, but can also be requested on animals, groups of humans or animals, devices such as dialysis machines, or even locations (typically for environmental scans).",
          "mustSupport": true
        },
        {
          "name": "encounter",
          "elementType": "Reference",
          "description": "Encounter in which the request was created",
          "definition":
              "An encounter that provides additional information about the healthcare context in which this request is made.",
          "mustSupport": true
        },
        {
          "name": "occurrence",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {"name": "Timing", "type": "NamedTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "When service should occur",
          "definition":
              "The date/time at which the requested service should occur.",
          "mustSupport": true
        },
        {
          "name": "asNeeded",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Boolean",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "binding": {
            "name": null,
            "description":
                "A coded concept identifying the pre-condition that should hold prior to performing a procedure.  For example \"pain\", \"on flare-up\", etc.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Preconditions for service",
          "definition":
              "If a CodeableConcept is present, it indicates the pre-condition for performing the service.  For example \"pain\", \"on flare-up\", etc."
        },
        {
          "name": "authoredOn",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "Date request signed",
          "definition": "When the request transitioned to being actionable.",
          "mustSupport": true
        },
        {
          "name": "requester",
          "elementType": "Reference",
          "description": "Who/what is requesting service",
          "definition":
              "The individual who initiated the request and has responsibility for its activation.",
          "comment":
              "This not the dispatcher, but rather who is the authorizer.  This element is not intended to handle delegation which would generally be managed through the Provenance resource.",
          "mustSupport": true
        },
        {
          "name": "performerType",
          "binding": {
            "name": "ServiceRequestParticipantRole",
            "description":
                "Indicates specific responsibility of an individual within the care team, such as \"Primary physician\", \"Team coordinator\", \"Caregiver\", etc.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Performer role",
          "definition":
              "Desired type of performer for doing the requested service.",
          "comment":
              "This is a  role, not  a participation type.  In other words, does not describe the task but describes the capacity.  For example, “compounding pharmacy”, “psychiatrist” or “internal referral”."
        },
        {
          "name": "performer",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Requested performer",
          "definition":
              "The desired performer for doing the requested service.  For example, the surgeon, dermatopathologist, endoscopist, etc.",
          "comment":
              "If multiple performers are present, it is interpreted as a list of *alternative* performers without any preference regardless of order.  If order of preference is needed use the [request-performerOrder extension](http://hl7.org/fhir/R4/extension-request-performerorder.html).  Use CareTeam to represent a group of performers (for example, Practitioner A *and* Practitioner B).",
          "mustSupport": false
        },
        {
          "name": "locationCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "ServiceRequestLocation",
            "description": "A location type where services are delivered.",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Requested location",
          "definition":
              "The preferred location(s) where the procedure should actually happen in coded or free text form. E.g. at home or nursing day care center."
        },
        {
          "name": "locationReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Requested location",
          "definition":
              "A reference to the the preferred location(s) where the procedure should actually happen. E.g. at home or nursing day care center."
        },
        {
          "name": "reasonCode",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description": "Explanation/Justification for procedure or service",
            "strength": "Example",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Explanation/Justification for procedure or service",
          "definition":
              "An explanation or justification for why this service is being requested in coded or textual form.   This is often for billing purposes.  May relate to the resources referred to in `supportingInfo`.",
          "comment":
              "This element represents why the referral is being made and may be used to decide how the service will be performed, or even if it will be performed at all.   Use `CodeableConcept.text` element if the data is free (uncoded) text as shown in the [CT Scan example](servicerequest-example-di.html).",
          "mustSupport": false
        },
        {
          "name": "reasonReference",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Explanation/Justification for service or service",
          "definition":
              "Indicates another resource that provides a justification for why this service is being requested.   May relate to the resources referred to in `supportingInfo`.",
          "comment":
              "This element represents why the referral is being made and may be used to decide how the service will be performed, or even if it will be performed at all.    To be as specific as possible,  a reference to  *Observation* or *Condition* should be used if available.  Otherwise when referencing  *DiagnosticReport*  it should contain a finding  in `DiagnosticReport.conclusion` and/or `DiagnosticReport.conclusionCode`.   When using a reference to *DocumentReference*, the target document should contain clear findings language providing the relevant reason for this service request.  Use  the CodeableConcept text element in `ServiceRequest.reasonCode` if the data is free (uncoded) text as shown in the [CT Scan example](servicerequest-example-di.html).",
          "mustSupport": true
        },
        {
          "name": "insurance",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Associated insurance coverage",
          "definition":
              "Insurance plans, coverage extensions, pre-authorizations and/or pre-determinations that may be needed for delivering the requested service."
        },
        {
          "name": "supportingInfo",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Additional clinical information",
          "definition":
              "Additional clinical information about the patient or specimen that may influence the services or their interpretations.     This information includes diagnosis, clinical findings and other observations.  In laboratory ordering these are typically referred to as \"ask at order entry questions (AOEs)\".  This includes observations explicitly requested by the producer (filler) to provide context or supporting information needed to complete the order. For example,  reporting the amount of inspired oxygen for blood gas measurements.",
          "comment":
              "To represent information about how the services are to be delivered use the `instructions` element."
        },
        {
          "name": "specimen",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Procedure Samples",
          "definition":
              "One or more specimens that the laboratory procedure will use.",
          "comment":
              "Many diagnostic procedures need a specimen, but the request itself is not actually about the specimen. This element is for when the diagnostic is requested on already existing specimens and the request points to the specimen it applies to.    Conversely, if the request is entered first with an unknown specimen, then the [Specimen](http://hl7.org/fhir/R4/specimen.html) resource points to the ServiceRequest."
        },
        {
          "name": "bodySite",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": null,
            "description":
                "Anatomic location where the procedure should be performed. This is the target site",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Location on Body",
          "definition":
              "Anatomic location where the procedure should be performed. This is the target site.",
          "comment":
              "Only used if not implicit in the code found in ServiceRequest.code.  If the use case requires BodySite to be handled as a separate resource instead of an inline coded element (e.g. to identify and track separately)  then use the standard extension [procedure-targetBodyStructure](http://hl7.org/fhir/R4/extension-procedure-targetbodystructure.html).",
          "mustSupport": true
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Comments",
          "definition":
              "Any other notes and comments made about the service request. For example, internal billing notes."
        },
        {
          "name": "patientInstruction",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Patient or consumer-oriented instructions",
          "definition":
              "Instructions in terms that are understood by the patient or consumer."
        },
        {
          "name": "relevantHistory",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Request provenance",
          "definition": "Key events in the history of the request.",
          "comment":
              "This might not include provenances for all versions of the request – only those deemed “relevant” or important.\\rThis SHALL NOT include the Provenance associated with this current version of the resource.  (If that provenance is deemed to be a “relevant” change, it will need to be added as part of a later update.  Until then, it can be queried directly as the Provenance that points to this version using _revinclude\\rAll Provenances should have some historical version of this Request as their subject."
        }
      ],
      "contextRelationship": [
        {"context": "Practitioner", "relatedKeyElement": "performer"},
        {"context": "Practitioner", "relatedKeyElement": "requester"},
        {"context": "Patient", "relatedKeyElement": "subject"},
        {"context": "Patient", "relatedKeyElement": "performer"},
        {"context": "Encounter", "relatedKeyElement": "encounter"},
        {"context": "Device", "relatedKeyElement": "performer"},
        {"context": "Device", "relatedKeyElement": "requester"},
        {"context": "RelatedPerson", "relatedKeyElement": "performer"}
      ]
    },
