    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Signature",
      "baseType": "Element",
      "retrievable": false,
      "identifier": "http://hl7.org/fhir/StructureDefinition/Signature",
      "label": "Signature",
      "element": [
        {
          "name": "type",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "SignatureType",
            "description":
                "An indication of the reason that an entity signed the object.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToCode(%value)",
          "description":
              "Indication of the reason the entity signed the object(s)",
          "definition":
              "An indication of the reason that the entity signed this document. This may be explicitly included as part of the signature information and can be used when determining accountability for various actions concerning the document.",
          "comment":
              "Examples include attesting to: authorship, correct transcription, and witness of specific event. Also known as a &quot;Commitment Type Indication&quot;."
        },
        {
          "name": "when",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "When the signature was created",
          "definition": "When the digital signature was signed.",
          "comment": "This should agree with the information in the signature."
        },
        {
          "name": "who",
          "elementType": "Reference",
          "description": "Who signed",
          "definition":
              "A reference to an application-usable description of the identity that signed  (e.g. the signature used their private key).",
          "comment": "This should agree with the information in the signature."
        },
        {
          "name": "onBehalfOf",
          "elementType": "Reference",
          "description": "The party represented",
          "definition":
              "A reference to an application-usable description of the identity that is represented by the signature.",
          "comment": "The party that can't sign. For example a child."
        },
        {
          "name": "targetFormat",
          "binding": {
            "name": "MimeType",
            "description":
                "The mime type of an attachment. Any valid mime type is allowed.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "MimeType",
          "target": "%value.value",
          "description": "The technical format of the signed resources",
          "definition":
              "A mime type that indicates the technical format of the target resources signed by the signature.",
          "comment":
              "\"xml\", \"json\" and \"ttl\" are allowed, which describe the simple encodings described in the specification (and imply appropriate bundle support). Otherwise, mime types are legal here."
        },
        {
          "name": "sigFormat",
          "binding": {
            "name": "MimeType",
            "description":
                "The mime type of an attachment. Any valid mime type is allowed.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "MimeType",
          "target": "%value.value",
          "description": "The technical format of the signature",
          "definition":
              "A mime type that indicates the technical format of the signature. Important mime types are application/signature+xml for X ML DigSig, application/jose for JWS, and image/* for a graphical image of a signature, etc."
        },
        {
          "name": "data",
          "elementType": "System.String",
          "target": "%value.value",
          "description":
              "The actual signature content (XML DigSig. JWS, picture, etc.)",
          "definition":
              "The base64 encoding of the Signature content. When signature is not recorded electronically this element would be empty.",
          "comment":
              "Where the signature type is an XML DigSig, the signed content is a FHIR Resource(s), the signature is of the XML form of the Resource(s) using  XML-Signature (XMLDIG) \"Detached Signature\" form."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "SortDirection",
      "baseType": "System.String",
      "retrievable": false
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Specimen",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-specimen",
      "label": "QICore Specimen",
      "primaryCodePath": "type",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "External Identifier",
          "definition": "Id for specimen."
        },
        {
          "name": "accessionIdentifier",
          "elementType": "Identifier",
          "description": "Identifier assigned by the lab",
          "definition":
              "The identifier assigned by the lab when accessioning specimen(s). This is not necessarily the same as the specimen identifier, depending on local lab procedures."
        },
        {
          "name": "status",
          "binding": {
            "name": "SpecimenStatus",
            "description":
                "Codes providing the status/availability of a specimen.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "SpecimenStatus",
          "target": "%value.value",
          "description":
              "available | unavailable | unsatisfactory | entered-in-error",
          "definition": "The availability of the specimen.",
          "comment":
              "This element is labeled as a modifier because the status contains codes that mark the resource as not currently valid."
        },
        {
          "name": "type",
          "binding": {
            "name": null,
            "description": "The kind of material that forms the specimen",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Kind of material that forms the specimen",
          "definition": "The kind of material that forms the specimen.",
          "comment":
              "The type can change the way that a specimen is handled and drives what kind of analyses can properly be performed on the specimen. It is frequently used in diagnostic work flow decision making systems.",
          "mustSupport": true
        },
        {
          "name": "subject",
          "elementType": "Reference",
          "description":
              "Where the specimen came from. This may be from patient(s), from a location (e.g., the source of an environmental sample), or a sampling of a substance or a device",
          "definition":
              "Where the specimen came from. This may be from patient(s), from a location (e.g., the source of an environmental sample), or a sampling of a substance or a device.",
          "mustSupport": true
        },
        {
          "name": "receivedTime",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "The time when specimen was received for processing",
          "definition":
              "Time when specimen was received for processing or testing.",
          "mustSupport": true
        },
        {
          "name": "parent",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Specimen from which this specimen originated",
          "definition":
              "Reference to the parent (source) specimen which is used when the specimen was either derived from or a component of another specimen.",
          "comment":
              "The parent specimen could be the source from which the current specimen is derived by some processing step (e.g. an aliquot or isolate or extracted nucleic acids from clinical samples) or one of many specimens that were combined to create a pooled sample.",
          "mustSupport": false
        },
        {
          "name": "request",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Why the specimen was collected",
          "definition":
              "Details concerning a service request that required a specimen to be collected.",
          "comment":
              "The request may be explicit or implied such with a ServiceRequest that requires a blood draw."
        },
        {
          "name": "collection",
          "elementType": "Specimen.Collection",
          "description": "Collection details",
          "definition": "Details concerning the specimen collection.",
          "mustSupport": false
        },
        {
          "name": "processing",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Processing and processing step details",
          "definition":
              "Details concerning processing and processing steps for the specimen.",
          "mustSupport": false
        },
        {
          "name": "container",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Direct container of specimen (tube/slide, etc.)",
          "definition":
              "The container holding the specimen.  The recursive nature of containers; i.e. blood in tube in tray in rack is not addressed here.",
          "mustSupport": false
        },
        {
          "name": "condition",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "SpecimenCondition",
            "description": "Codes describing the state of the specimen.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "State of the specimen",
          "definition":
              "A mode or state of being that describes the nature of the specimen.",
          "comment":
              "Specimen condition is an observation made about the specimen.  It's a point-in-time assessment.  It can be used to assess its quality or appropriateness for a specific test."
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Comments",
          "definition":
              "To communicate any details or issues about the specimen or during the specimen collection. (for example: broken vial, sent with patient, frozen)."
        }
      ],
      "contextRelationship": [
        {"context": "Practitioner", "relatedKeyElement": "collector"},
        {"context": "Patient", "relatedKeyElement": "subject"},
        {"context": "Device", "relatedKeyElement": "subject"}
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Specimen.Collection",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "collector",
          "elementType": "Reference",
          "description": "Who collected the specimen",
          "definition": "Person who collected the specimen.",
          "mustSupport": false
        },
        {
          "name": "collected",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Collection time",
          "definition":
              "Time when specimen was collected from subject - the physiologically relevant time.",
          "mustSupport": true
        },
        {
          "name": "duration",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description": "How long it took to collect specimen",
          "definition":
              "The span of time over which the collection of a specimen occurred."
        },
        {
          "name": "quantity",
          "elementType": "System.Quantity",
          "target": "FHIRHelpers.ToQuantity(%value)",
          "description": "The quantity of specimen collected",
          "definition":
              "The quantity of specimen collected; for instance the volume of a blood sample, or the physical measurement of an anatomic pathology sample."
        },
        {
          "name": "method",
          "binding": {
            "name": "SpecimenCollectionMethod",
            "description":
                "The  technique that is used to perform the procedure.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Technique used to perform collection",
          "definition":
              "A coded value specifying the technique that is used to perform the procedure."
        },
        {
          "name": "bodySite",
          "binding": {
            "name": null,
            "description":
                "Anatomical location from which the specimen was collected (if subject is a patient). This is the target site. This element is not used for environmental specimens.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Anatomical collection site",
          "definition":
              "Anatomical location from which the specimen was collected (if subject is a patient). This is the target site.  This element is not used for environmental specimens.",
          "comment":
              "If the use case requires  BodySite to be handled as a separate resource instead of an inline coded element (e.g. to identify and track separately)  then use the standard extension [bodySite](http://hl7.org/fhir/R4/extension-bodysite.html).",
          "mustSupport": true
        },
        {
          "name": "fastingStatus",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Concept",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "binding": {
            "name": "FastingStatus",
            "description":
                "Codes describing the fasting status of the patient.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description":
              "Whether or how long patient abstained from food and/or drink",
          "definition":
              "Abstinence or reduction from some or all food, drink, or both, for a period of time prior to sample collection.",
          "comment":
              "Representing fasting status using this element is preferred to representing it with an observation using a 'pre-coordinated code'  such as  LOINC 2005-7 (Calcium [Moles/​time] in 2 hour Urine --12 hours fasting), or  using  a component observation ` such as `Observation.component code`  = LOINC 49541-6 (Fasting status - Reported)."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Specimen.Container",
      "baseType": "BackboneElement",
      "retrievable": false,
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Id for the container",
          "definition":
              "Id for container. There may be multiple; a manufacturer's bar code, lab assigned identifier, etc. The container ID may differ from the specimen id in some circumstances."
        },
        {
          "name": "description",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Textual description of the container",
          "definition": "Textual description of the container."
        },
        {
          "name": "type",
          "binding": {
            "name": "SpecimenContainerType",
            "description": "Type of specimen container.",
            "strength": "Example",
            "valueSet": ""
          },
