    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Substance",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-substance",
      "label": "QICore Substance",
      "primaryCodePath": "code",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Unique identifier",
          "definition": "Unique identifier for the substance.",
          "comment":
              "This identifier is associated with the kind of substance in contrast to the  Substance.instance.identifier which is associated with the package/container."
        },
        {
          "name": "status",
          "binding": {
            "name": "FHIRSubstanceStatus",
            "description":
                "A code to indicate if the substance is actively used.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "FHIRSubstanceStatus",
          "target": "%value.value",
          "description": "active | inactive | entered-in-error",
          "definition": "A code to indicate if the substance is actively used."
        },
        {
          "name": "category",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "SubstanceCategory",
            "description": "Category or classification of substance.",
            "strength": "Extensible",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "What class/type of substance this is",
          "definition":
              "A code that classifies the general type of substance.  This is used  for searching, sorting and display purposes.",
          "comment":
              "The level of granularity is defined by the category concepts in the value set.   More fine-grained filtering can be performed using the metadata and/or terminology hierarchy in Substance.code."
        },
        {
          "name": "code",
          "binding": {
            "name": null,
            "description": "Substance codes",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "What substance this is",
          "definition":
              "A code (or set of codes) that identify this substance.",
          "comment":
              "This could be a reference to an externally defined code.  It could also be a locally assigned code (e.g. a formulary),  optionally with translations to the standard drug codes.",
          "mustSupport": true
        },
        {
          "name": "description",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Textual description of the substance, comments",
          "definition":
              "A description of the substance - its appearance, handling requirements, and other usage notes."
        },
        {
          "name": "instance",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description":
              "If this describes a specific package/container of the substance",
          "definition":
              "Substance may be used to describe a kind of substance, or a specific package/container of the substance: an instance.",
          "mustSupport": false
        },
        {
          "name": "ingredient",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Composition information about the substance",
          "definition": "A substance can be composed of other substances.",
          "mustSupport": false
        }
      ]
    },
