    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Task",
      "baseType": "DomainResource",
      "retrievable": true,
      "identifier":
          "http://hl7.org/fhir/us/qicore/StructureDefinition/qicore-task",
      "label": "QICore Task",
      "primaryCodePath": "code",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Task Instance Identifier",
          "definition": "The business identifier for this task.",
          "mustSupport": true
        },
        {
          "name": "instantiatesCanonical",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Formal definition of task",
          "definition":
              "The URL pointing to a *FHIR*-defined protocol, guideline, orderset or other definition that is adhered to in whole or in part by this Task."
        },
        {
          "name": "instantiatesUri",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Formal definition of task",
          "definition":
              "The URL pointing to an *externally* maintained  protocol, guideline, orderset or other definition that is adhered to in whole or in part by this Task."
        },
        {
          "name": "basedOn",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Request fulfilled by this task",
          "definition":
              "BasedOn refers to a higher-level authorization that triggered the creation of the task.  It references a \"request\" resource such as a ServiceRequest, MedicationRequest, ServiceRequest, CarePlan, etc. which is distinct from the \"request\" resource the task is seeking to fulfill.  This latter resource is referenced by FocusOn.  For example, based on a ServiceRequest (= BasedOn), a task is created to fulfill a procedureRequest ( = FocusOn ) to collect a specimen from a patient."
        },
        {
          "name": "groupIdentifier",
          "elementType": "Identifier",
          "description": "Requisition or grouper id",
          "definition":
              "An identifier that links together multiple tasks and other requests that were created in the same context."
        },
        {
          "name": "partOf",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Composite task",
          "definition": "Task that this particular task is part of.",
          "comment": "This should usually be 0..1."
        },
        {
          "name": "status",
          "binding": {
            "name": "TaskStatus",
            "description": "The current status of the task.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "TaskStatus",
          "target": "%value.value",
          "description":
              "Draft​ | Requested​ | Received​ | Accepted​ | Ready​ | Cancelled​ | In-progress​ | On-hold​ | Failed​ |",
          "definition": "The current status of the task.",
          "mustSupport": true
        },
        {
          "name": "statusReason",
          "binding": {
            "name": "TaskStatusReason",
            "description":
                "Codes to identify the reason for current status.  These will typically be specific to a particular workflow.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Reason for current status",
          "definition":
              "An explanation as to why this task is held, failed, was refused, etc.",
          "comment":
              "This applies to the current status.  Look at the history of the task to see reasons for past statuses."
        },
        {
          "name": "businessStatus",
          "binding": {
            "name": "TaskBusinessStatus",
            "description":
                "The domain-specific business-contextual sub-state of the task.  For example: \"Blood drawn\", \"IV inserted\", \"Awaiting physician signature\", etc.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "E.g. \"Specimen collected\", \"IV prepped\"",
          "definition":
              "Contains business-specific nuances of the business state."
        },
        {
          "name": "intent",
          "binding": {
            "name": "TaskIntent",
            "description":
                "Distinguishes whether the task is a proposal, plan or full order.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "TaskIntent",
          "target": "%value.value",
          "description":
              "unknown | proposal | plan | order | original-order | reflex-order | filler-order | instance-order | option",
          "definition":
              "Indicates the \"level\" of actionability associated with the Task, i.e. i+R[9]Cs this a proposed task, a planned task, an actionable task, etc.",
          "comment":
              "This element is immutable.  Proposed tasks, planned tasks, etc. must be distinct instances.\\\\n\\\\nIn most cases, Tasks will have an intent of \"order\".",
          "mustSupport": true
        },
        {
          "name": "priority",
          "binding": {
            "name": "TaskPriority",
            "description": "The task's priority.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "TaskPriority",
          "target": "%value.value",
          "description": "routine | urgent | asap | stat",
          "definition":
              "Indicates how quickly the Task should be addressed with respect to other requests.",
          "mustSupport": true
        },
        {
          "name": "code",
          "binding": {
            "name": null,
            "description":
                "Codes to identify what the task involves. These will typically be specific to a particular workflow",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Task Type",
          "definition":
              "A name or code (or both) briefly describing what the task involves.",
          "comment":
              "The title (eg \"My Tasks\", \"Outstanding Tasks for Patient X\") should go into the code.",
          "mustSupport": true
        },
        {
          "name": "description",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Human-readable explanation of task",
          "definition": "A free-text description of what is to be performed."
        },
        {
          "name": "focus",
          "elementType": "Reference",
          "description": "What task is acting on",
          "definition":
              "The request being actioned or the resource being manipulated by this task.",
          "comment":
              "If multiple resources need to be manipulated, use sub-tasks.  (This ensures that status can be tracked independently for each referenced resource.)."
        },
        {
          "name": "for",
          "elementType": "Reference",
          "description": "Beneficiary of the Task",
          "definition":
              "The entity who benefits from the performance of the service specified in the task (e.g., the patient)."
        },
        {
          "name": "encounter",
          "elementType": "Reference",
          "description": "Healthcare event during which this task originated",
          "definition":
              "The healthcare event  (e.g. a patient and healthcare provider interaction) during which this task was created."
        },
        {
          "name": "executionPeriod",
          "elementTypeSpecifier": {"type": "IntervalTypeSpecifier"},
          "target": "FHIRHelpers.ToInterval(%value)",
          "description": "Start and end time of execution",
          "definition":
              "Identifies the time action was first taken against the task (start) and/or the time final action was taken against the task prior to marking it as completed (end).",
          "mustSupport": false
        },
        {
          "name": "authoredOn",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "Task Creation Date",
          "definition": "The date and time this task was created."
        },
        {
          "name": "lastModified",
          "elementType": "System.DateTime",
          "target": "%value.value",
          "description": "Task Last Modified Date",
          "definition": "The date and time of last modification to this task."
        },
        {
          "name": "requester",
          "elementType": "Reference",
          "description": "Who is asking for task to be done",
          "definition": "The creator of the task."
        },
        {
          "name": "performerType",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "TaskPerformerType",
            "description": "The type(s) of task performers allowed.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Requested performer",
          "definition": "The kind of participant that should perform the task."
        },
        {
          "name": "owner",
          "elementType": "Reference",
          "description": "Responsible individual",
          "definition":
              "Individual organization or Device currently responsible for task execution.",
          "comment": "Tasks may be created with an owner not yet identified."
        },
        {
          "name": "location",
          "elementType": "Reference",
          "description": "Where task occurs",
          "definition":
              "Principal physical location where the this task is performed."
        },
        {
          "name": "reasonCode",
          "binding": {
            "name": "TaskReason",
            "description":
                "Indicates why the task is needed.  E.g. Suspended because patient admitted to hospital.",
            "strength": "Example",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "Why task is needed",
          "definition":
              "A description or code indicating why this task needs to be performed.",
          "comment":
              "This should only be included if there is no focus or if it differs from the reason indicated on the focus.",
          "mustSupport": false
        },
        {
          "name": "reasonReference",
          "elementType": "Reference",
          "description": "Why task is needed",
          "definition":
              "A resource reference indicating why this task needs to be performed.",
          "comment":
              "Tasks might be justified based on an Observation, a Condition, a past or planned procedure, etc.   This should only be included if there is no focus or if it differs from the reason indicated on the focus.    Use the CodeableConcept text element in `Task.reasonCode` if the data is free (uncoded) text."
        },
        {
          "name": "insurance",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Associated insurance coverage",
          "definition":
              "Insurance plans, coverage extensions, pre-authorizations and/or pre-determinations that may be relevant to the Task."
        },
        {
          "name": "note",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Comments made about the task",
          "definition":
              "Free-text information captured about the task as it progresses."
        },
        {
          "name": "relevantHistory",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Key events in history of the Task",
          "definition":
              "Links to Provenance records for past versions of this Task that identify key state transitions or updates that are likely to be relevant to a user looking at the current version of the task.",
          "comment":
              "This element does not point to the Provenance associated with the *current* version of the resource - as it would be created after this version existed.  The Provenance for the current version can be retrieved with a _revinclude."
        },
        {
          "name": "restriction",
          "elementType": "Task.Restriction",
          "description": "Constraints on fulfillment tasks",
          "definition":
              "If the Task.focus is a request resource and the task is seeking fulfillment (i.e. is asking for the request to be actioned), this element identifies any limitations on what parts of the referenced request should be actioned."
        },
        {
          "name": "input",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Information used to perform task",
          "definition":
              "Additional information that may be needed in the execution of the task."
        },
        {
          "name": "output",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Information produced as part of task",
          "definition": "Outputs produced by the Task."
        }
      ]
    },
