      "baseType": "System.String",
      "retrievable": false
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Timing",
      "baseType": "BackboneElement",
      "retrievable": false,
      "identifier": "http://hl7.org/fhir/StructureDefinition/Timing",
      "label": "Timing",
      "primaryCodePath": "code",
      "element": [
        {
          "name": "event",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "When the event occurs",
          "definition": "Identifies specific times when the event occurs."
        },
        {
          "name": "repeat",
          "elementType": "Timing.Repeat",
          "description": "When the event is to occur",
          "definition":
              "A set of rules that describe when the event is scheduled."
        },
        {
          "name": "code",
          "binding": {
            "name": "TimingAbbreviation",
            "description": "Code for a known / defined timing pattern.",
            "strength": "Preferred",
            "valueSet": ""
          },
          "elementType": "System.Concept",
          "target": "FHIRHelpers.ToConcept(%value)",
          "description": "BID | TID | QID | AM | PM | QD | QOD | +",
          "definition":
              "A code for the timing schedule (or just text in code.text). Some codes such as BID are ubiquitous, but many institutions define their own additional codes. If a code is provided, the code is understood to be a complete statement of whatever is specified in the structured timing data, and either the code or the data may be used to interpret the Timing, with the exception that .repeat.bounds still applies over the code (and is not contained in the code).",
          "comment":
              "BID etc. are defined as 'at institutionally specified times'. For example, an institution may choose that BID is \"always at 7am and 6pm\".  If it is inappropriate for this choice to be made, the code BID should not be used. Instead, a distinct organization-specific code should be used in place of the HL7-defined BID code and/or a structured representation should be used (in this case, specifying the two event times)."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "Timing.Repeat",
      "baseType": "Element",
      "retrievable": false,
      "element": [
        {
          "name": "bounds",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {
                "name": "{urn:hl7-org:elm-types:r1}Quantity",
                "type": "NamedTypeSpecifier"
              },
              {"type": "IntervalTypeSpecifier"},
              {"type": "IntervalTypeSpecifier"}
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description":
              "Length/Range of lengths, or (Start and/or end) limits",
          "definition":
              "Either a duration for the length of the timing schedule, a range of possible length, or outer bounds for start and/or end limits of the timing schedule."
        },
        {
          "name": "count",
          "elementType": "System.Integer",
          "target": "%value.value",
          "description": "Number of times to repeat",
          "definition":
              "A total count of the desired number of repetitions across the duration of the entire timing specification. If countMax is present, this element indicates the lower bound of the allowed range of count values.",
          "comment":
              "If you have both bounds and count, then this should be understood as within the bounds period, until count times happens."
        },
        {
          "name": "countMax",
          "elementType": "System.Integer",
          "target": "%value.value",
          "description": "Maximum number of times to repeat",
          "definition":
              "If present, indicates that the count is a range - so to perform the action between [count] and [countMax] times."
        },
        {
          "name": "duration",
          "elementType": "System.Decimal",
          "target": "%value.value",
          "description": "How long when it happens",
          "definition":
              "How long this thing happens for when it happens. If durationMax is present, this element indicates the lower bound of the allowed range of the duration.",
          "comment":
              "For some events the duration is part of the definition of the event (e.g. IV infusions, where the duration is implicit in the specified quantity and rate). For others, it's part of the timing specification (e.g. exercise)."
        },
        {
          "name": "durationMax",
          "elementType": "System.Decimal",
          "target": "%value.value",
          "description": "How long when it happens (Max)",
          "definition":
              "If present, indicates that the duration is a range - so to perform the action between [duration] and [durationMax] time length.",
          "comment":
              "For some events the duration is part of the definition of the event (e.g. IV infusions, where the duration is implicit in the specified quantity and rate). For others, it's part of the timing specification (e.g. exercise)."
        },
        {
          "name": "durationUnit",
          "binding": {
            "name": "UnitsOfTime",
            "description": "A unit of time (units from UCUM).",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "UnitsOfTime",
          "target": "%value.value",
          "description": "s | min | h | d | wk | mo | a - unit of time (UCUM)",
          "definition": "The units of time for the duration, in UCUM units."
        },
        {
          "name": "frequency",
          "elementType": "System.Integer",
          "target": "%value.value",
          "description": "Event occurs frequency times per period",
          "definition":
              "The number of times to repeat the action within the specified period. If frequencyMax is present, this element indicates the lower bound of the allowed range of the frequency."
        },
        {
          "name": "frequencyMax",
          "elementType": "System.Integer",
          "target": "%value.value",
          "description": "Event occurs up to frequencyMax times per period",
          "definition":
              "If present, indicates that the frequency is a range - so to repeat between [frequency] and [frequencyMax] times within the period or period range."
        },
        {
          "name": "period",
          "elementType": "System.Decimal",
          "target": "%value.value",
          "description": "Event occurs frequency times per period",
          "definition":
              "Indicates the duration of time over which repetitions are to occur; e.g. to express \"3 times per day\", 3 would be the frequency and \"1 day\" would be the period. If periodMax is present, this element indicates the lower bound of the allowed range of the period length."
        },
        {
          "name": "periodMax",
          "elementType": "System.Decimal",
          "target": "%value.value",
          "description": "Upper limit of period (3-4 hours)",
          "definition":
              "If present, indicates that the period is a range from [period] to [periodMax], allowing expressing concepts such as \"do this once every 3-5 days."
        },
        {
          "name": "periodUnit",
          "binding": {
            "name": "UnitsOfTime",
            "description": "A unit of time (units from UCUM).",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "UnitsOfTime",
          "target": "%value.value",
          "description": "s | min | h | d | wk | mo | a - unit of time (UCUM)",
          "definition": "The units of time for the period in UCUM units."
        },
        {
          "name": "dayOfWeek",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "DayOfWeek",
            "description": null,
            "strength": "Required",
            "valueSet": ""
          },
          "target": "%value.value",
          "description": "mon | tue | wed | thu | fri | sat | sun",
          "definition":
              "If one or more days of week is provided, then the action happens only on the specified day(s).",
          "comment":
              "If no days are specified, the action is assumed to happen every day as otherwise specified. The elements frequency and period cannot be used as well as dayOfWeek."
        },
        {
          "name": "timeOfDay",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "target": "%value.value",
          "description": "Time of day for action",
          "definition": "Specified time of day for action to take place.",
          "comment":
              "When time of day is specified, it is inferred that the action happens every day (as filtered by dayofWeek) on the specified times. The elements when, frequency and period cannot be used as well as timeOfDay."
        },
        {
          "name": "when",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "binding": {
            "name": "EventTiming",
            "description": "Real world event relating to the schedule.",
            "strength": "Required",
            "valueSet": ""
          },
          "target": "%value.value",
          "description": "Code for time period of occurrence",
          "definition":
              "An approximate time period during the day, potentially linked to an event of daily living that indicates when the action should occur.",
          "comment":
              "When more than one event is listed, the event is tied to the union of the specified events."
        },
        {
          "name": "offset",
          "elementType": "System.Integer",
          "target": "%value.value",
          "description": "Minutes from event (before or after)",
          "definition":
              "The number of minutes from the event. If the event code does not indicate whether the minutes is before or after the event, then the offset is assumed to be after the event."
        }
      ]
    },
    {
      "type": "ClassInfo",
      "namespace": "QICore",
      "name": "TriggerDefinition",
      "baseType": "Element",
      "retrievable": false,
      "identifier": "http://hl7.org/fhir/StructureDefinition/TriggerDefinition",
      "label": "TriggerDefinition",
      "element": [
        {
          "name": "type",
          "binding": {
            "name": "TriggerType",
            "description": "The type of trigger.",
            "strength": "Required",
            "valueSet": ""
          },
          "elementType": "TriggerType",
          "target": "%value.value",
          "description":
              "named-event | periodic | data-changed | data-added | data-modified | data-removed | data-accessed | data-access-ended",
          "definition": "The type of triggering event."
        },
        {
          "name": "name",
          "elementType": "System.String",
          "target": "%value.value",
          "description": "Name or URI that identifies the event",
          "definition":
              "A formal name for the event. This may be an absolute URI that identifies the event formally (e.g. from a trigger registry), or a simple relative URI that identifies the event in a local context.",
          "comment":
              "An event name can be provided for all event types, but is required for named events. If a name is provided for a type other than named events, it is considered to be a shorthand for the semantics described by the formal description of the event."
        },
        {
          "name": "timing",
          "elementTypeSpecifier": {
            "type": "ChoiceTypeSpecifier",
            "choice": [
              {"name": "Timing", "type": "NamedTypeSpecifier"},
              {"name": "Reference", "type": "NamedTypeSpecifier"},
              {
                "name": "{urn:hl7-org:elm-types:r1}Date",
                "type": "NamedTypeSpecifier"
              },
              {
                "name": "{urn:hl7-org:elm-types:r1}DateTime",
                "type": "NamedTypeSpecifier"
              }
            ]
          },
          "target": "FHIRHelpers.ToValue(%value)",
          "description": "Timing of the event",
          "definition":
              "The timing of the event (if this is a periodic trigger)."
        },
        {
          "name": "data",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
          "description": "Triggering data of the event (multiple = 'and')",
          "definition":
              "The triggering data of the event (if this is a data trigger). If more than one data is requirement is specified, then all the data requirements must be true.",
          "comment": "This element shall be present for any data type trigger."
        },
        {
          "name": "condition",
          "elementType": "Expression",
          "description": "Whether the event triggers (boolean expression)",
          "definition":
              "A boolean-valued expression that is evaluated in the context of the container of the trigger definition and returns whether or not the trigger fires.",
          "comment":
              "This element can be only be specified for data type triggers and provides additional semantics for the trigger. The context available within the condition is based on the type of data event. For all events, the current resource will be available as context. In addition, for modification events, the previous resource will also be available. The expression may be inlined, or may be a simple absolute URI, which is a reference to a named expression within a logic library referenced by a library element or extension within the containing resource. If the expression is a FHIR Path expression, it evaluates in the context of a resource of one of the type identified in the data requirement, and may also refer to the variable %previous for delta comparisons on events of type data-changed, data-modified, and data-deleted which will always have the same type."
        }
      ]
    },
