          "http://hl7.org/fhir/us/core/StructureDefinition/us-core-bmi",
      "label": "US Core BMI Profile",
      "target": "Observation",
      "primaryCodePath": "code",
      "element": [
        {
          "name": "identifier",
          "elementTypeSpecifier": {"type": "ListTypeSpecifier"},
